INSERT INTO `pages` VALUES (1,'SOBRE NÓS','<p>No dia 18 de setembro de 1991 come&ccedil;a a trajet&oacute;ria de sucesso da UDI, Unidade de Diagn&oacute;stico por Imagem, instalada na Rua Piau&iacute;, em Po&ccedil;os de Caldas. Inicialmente realizava somente exames de Tomografia Computadorizada. Seis anos depois, em 1997, a cl&iacute;nica passou a oferecer servi&ccedil;os de Resson&acirc;ncia Magn&eacute;tica. Em fun&ccedil;&atilde;o da crescente demanda de servi&ccedil;os, tornou-se necess&aacute;rio a amplia&ccedil;&atilde;o da cl&iacute;nica, o que resultou na mudan&ccedil;a de endere&ccedil;o para Rua Nico Duarte, 964, no bairro Vila Cruz, onde estamos instalados desde Janeiro de 2010 at&eacute; os dias atuais, oferecendo maior conforto, equipamentos de alta tecnologia aos nossos pacientes. No m&ecirc;s de mar&ccedil;o de 2012, o nome da UDI foi alterado para Pixel Diagn&oacute;stico por Imagem, devido &agrave;s novas parcerias e com o intuito de ampliar sua oferta de novas tecnologias e aumento de seu quadro profissional, sempre objetivando a melhoria dos servi&ccedil;os oferecidos &agrave; popula&ccedil;&atilde;o de Po&ccedil;os de Caldas e todo Sul de Minas.</p>','2020-10-24 19:20:42','2020-10-10 12:08:23',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,'João Dias','TOMOGRAFIA COMPUTADORIZADA E RESSONÂNCIA MAGNÉTICA: QUAIS AS DIFERENÇAS?','2020-10-25 12:49:10','2020-10-25 12:52:46','<p>O funcionamento de exames como a tomografia computadorizada e resson&acirc;ncia magn&eacute;tica s&atilde;o bem distintos.</p>\r\n<p>A tomografia, basicamente, utiliza radia&ccedil;&atilde;o ionizante. As imagens s&atilde;o geradas por feixes que atravessam os &oacute;rg&atilde;os e analisadas por meio das diferen&ccedil;as na densidade dos tecidos.&nbsp;</p>\r\n<p>Deste modo, o m&eacute;dico consegue diferenciar os ossos do ar e identificar partes como f&iacute;gado, rins e ba&ccedil;o, por exemplo.</p>\r\n<p>Podemos dizer assim, que a tomografia &eacute; um raio x muito mais sens&iacute;vel.&nbsp;</p>\r\n<p>J&aacute; a resson&acirc;ncia magn&eacute;tica, se baseia no uso de um campo magn&eacute;tico de alta pot&ecirc;ncia. Atrav&eacute;s da intera&ccedil;&atilde;o com as mol&eacute;culas de &aacute;gua, esse campo consegue gerar imagens em tr&ecirc;s planos.&nbsp;</p>\r\n<p>Considera-se a resson&acirc;ncia magn&eacute;tica como uma fotografia tridimensional de dentro do corpo.&nbsp;</p>','João Dias','joaodias@gmail.com','127.0.0.1','/pergunta','/pergunta?_method=POST','POST','N','MozillaNetscape5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/85.0.4183.83 Safari/537.36truept-BRtrueLinux x86_64Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/85.0.4183.83 Safari/537.36');
