INSERT INTO `posts` VALUES (11,'ESTUDANTES DO CURSO DE MEDICINA DA PUC MINAS ','<p>Na busca por conhecimento e inspira&ccedil;&atilde;o, alunos do curso de Medicina de Po&ccedil;os de Caldas fizeram uma visita &agrave;s instala&ccedil;&otilde;es da Pixel Diagn&oacute;stico e tiveram a oportunidade de conhecer e realizar um bate-papo com o Dr. Germano de Almeida Fleming.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Atentos a todos os detalhes e m&eacute;todos de seguran&ccedil;a, os estudantes visitaram os setores de funcionamento da institui&ccedil;&atilde;o, tais como Ultrassonografia, Radiologia Convencional, Tomografia Computadorizada e Densitometria &Oacute;ssea e ficaram empolgados com os avan&ccedil;os tecnol&oacute;gicos &nbsp;emergentes na &aacute;rea. Na oportunidade, os alunos puderam vivenciar&nbsp;a pr&aacute;tica em uma unidade de diagn&oacute;sticos, conhecendo, de perto, os modernos equipamentos</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A atividade permite que os alunos acompanhem o trabalho realizado por profissionais da &aacute;rea e possam conhecer os avan&ccedil;os tecnol&oacute;gicos j&aacute; inseridos no campo radiol&oacute;gico uma vez que, durante as visitas, acompanha-se a explica&ccedil;&atilde;o de como s&atilde;o feitos os exames radiol&oacute;gicos, podendo visualizar os equipamentos em funcionamento.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A visita tamb&eacute;m contou com um bate-papo super descontra&iacute;do e informativo com o Dr. Germano, abordando os detalhes e as premissas da Radiologia, no qual assuntos sobre a hist&oacute;ria,&nbsp; curiosidades, a pr&aacute;tica, os obst&aacute;culos e o futuro da medicina contempor&acirc;nea foram minuciosamente discutidos, al&eacute;m de relatos da carreira do m&eacute;dico radiologista. Tal oportunidade ofereceu aos estudantes, uma visualiza&ccedil;&atilde;o do exerc&iacute;cio da profiss&atilde;o e do estilo de vida dos profissionais da &aacute;rea. Apaixonados pelo estudo e pela medicina, a experi&ecirc;ncia foi vista, por ambas as partes, como uma troca de conhecimento e experi&ecirc;ncias.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Como despedida, o Dr. Germano aconselhou os jovens &ldquo;sejam cautelosos e fi&eacute;is aos seus planos de carreira, priorizando aquilo que lhes fa&ccedil;am felizes e ansiando sempre pelo conhecimento espec&iacute;fico. Abracem uma &aacute;rea na qual o seu cora&ccedil;&atilde;o bata mais forte e se empenhem em ser os mais capacitados nela&rdquo;.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A Pixel Diagn&oacute;stico tem como prioridade incentivar a medicina informativa e eficaz e conta com profissionais preparados e emprenhados em melhor atend&ecirc;-los, esclarecendo todas as suas d&uacute;vidas.</p>',1,'2020-10-03 12:34:32','2020-10-11 12:32:04','2020-10-03-estudantes-do-curso-de-medicina-da-puc-minas','ressonância,','O Programador',NULL),(12,'NOVIDADES NA TECNOLOGIA MEDICINAL – PROTOCOLO DE RASTREAMENTO PREVENTIVO','<p><em>Recentemente a Pixel implantou mais uma novidade em sua gama de exames de Resson&acirc;ncia Magn&eacute;tica: O protocolo de rastreamento preventivo.O que h&aacute; de novo? O que seria este exame?</em></p>\r\n<p>&nbsp;</p>\r\n<p>Conscientes do quanto &eacute; ruim a luta contra alguma doen&ccedil;a, do modo como isso interfere na nossa disposi&ccedil;&atilde;o e nos priva da nossa qualidade de vida, a medicina especializada criou a medicina preventiva &ndash; uma &aacute;rea que busca garantir que a sa&uacute;de esteja sempre em dia. A medicina preventiva consiste em prevenir doen&ccedil;as ou les&otilde;es por meio de a&ccedil;&otilde;es antecipadas, focando na manuten&ccedil;&atilde;o constante da sa&uacute;de ao contr&aacute;rio tratar seus sintomas. Assim, evita-se que as enfermidades se instalem e provoquem consequ&ecirc;ncias danosas.</p>\r\n<p>Normalmente, quando seu m&eacute;dico lhe pede um exame t&atilde;o espec&iacute;fico quanto a resson&acirc;ncia, &eacute; porque alguns sintomas ou diagn&oacute;stico pr&eacute;vio de doen&ccedil;a j&aacute; lhes foram apresentados. Neste caso, a solicita&ccedil;&atilde;o de exame de determinada regi&atilde;o em seu corpo j&aacute; se enquadra na &aacute;rea de tratamento e suporte &agrave; sa&uacute;de. O protocolo de rastreamento preventivo vem com outra diretriz. Ele tem por objetivo fazer uma avalia&ccedil;&atilde;o geral &nbsp;destinada justamente a preven&ccedil;&atilde;o com um exame de imagem de alt&iacute;ssima qualidade.</p>\r\n<p>Este protocolo consiste em uma varredura das regi&otilde;es da cabe&ccedil;a, pesco&ccedil;o, t&oacute;rax, abdome e pelve. N&atilde;o &eacute; um exame completo de todas estas regi&otilde;es, mas selecionamos algumas sequ&ecirc;ncias importantes de cada regi&atilde;o que s&atilde;o capazes de detectar qualquer patologia e assim, caso o m&eacute;dico radiologista evidencie alguma altera&ccedil;&atilde;o, indicar&aacute; o exame espec&iacute;fico para aquela determinada regi&atilde;o afetada para o fechamento do diagn&oacute;stico.</p>\r\n<p>&Eacute; interessante a forma na qual esse tipo de exame busca mudar as maneiras da medicina estar presente no cotidiano da popula&ccedil;&atilde;o: o indiv&iacute;duo passa a se engajar e se preocupar mais com a preven&ccedil;&atilde;o do que simplesmente com o tratamento. Preocupando-se mais com o bem-estar e com o cuidado de vida de um jeito mais harm&ocirc;nico e equilibrado. Este tipo de informa&ccedil;&atilde;o ajuda o m&eacute;dico a olhar o paciente como um todo e contribui na preven&ccedil;&atilde;o de poss&iacute;veis doen&ccedil;as, sendo elas cr&ocirc;nicas ou n&atilde;o. O paciente passa a disponibilizar dados da sua vida que auxiliam o m&eacute;dico a prevenir ou identificar a doen&ccedil;a e escolher o tratamento mais adequado para o seu caso. Esta &eacute; uma excelente ferramenta para o uso da resson&acirc;ncia tamb&eacute;m para preven&ccedil;&atilde;o e rastreio de patologias ainda silenciosas.</p>\r\n<p>O procedimento possui um custo bem acess&iacute;vel e ben&eacute;fico. &Eacute; r&aacute;pido, indolor e seu tempo estimado gira em torno de 30 minutos. Evite contratempos, previna-se!</p>',1,'2020-10-10 12:37:08','2020-10-10 12:37:08','2020-10-10-novidades-na-tecnologia-medicinal-protocolo-de-rastreamento-preventivo',NULL,'Pixel',NULL),(13,'A IMPORTÂNCIA DA COMUNICAÇÃO ENTRE O PACIENTE E O PROFISSIONAL DE SAÚDE','<p><em>Recentes e</em><em>studos nacionais e internacionais&nbsp;</em><em>ressaltam&nbsp;</em><em>que a comunica&ccedil;&atilde;</em><em>o m</em><em>&eacute;</em><em>dico-paciente&nbsp;</em><em>&eacute;&nbsp;</em><em>o principal</em><em>&nbsp;elemento para que o&nbsp;</em><em>cuidado com a sa</em><em>&uacute;de seja o melhor poss&iacute;vel. Por&eacute;m, os&nbsp;</em><em>curtos&nbsp;</em><em>tempos&nbsp;</em><em>de consulta e a falta de comunica&ccedil;&atilde;o podem</em><em>&nbsp;contribuir</em><em>&nbsp;para&nbsp;</em><em>a amplia&ccedil;&atilde;o do&nbsp;</em><em>distanciamento</em><em>&nbsp;e na hiper formalidade do di&aacute;logo&nbsp;</em><em>entre&nbsp;</em><em>m&eacute;dicos, profissionais da &aacute;rea</em><em>&nbsp;e paciente</em><em>s.&nbsp;</em><em>Tendo isso em vista, quais as a&ccedil;&otilde;es necess&aacute;rias para a reconstru&ccedil;&atilde;o desta ponte, gerando uma boa comunica&ccedil;&atilde;o entre as partes?</em></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Usualmente, as pessoas buscam atendimento de sa&uacute;de ao notar algum desconforto e tal fato j&aacute; faz com que elas tragam consigo medos, inseguran&ccedil;as, receios, expectativas e d&uacute;vidas. Essa situa&ccedil;&atilde;o requer aten&ccedil;&atilde;o por parte dos profissionais de sa&uacute;de, para que saibam acolher e lidar bem com as diversas situa&ccedil;&otilde;es.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A comunica&ccedil;&atilde;o efetiva tem sido apontada como fonte indispens&aacute;vel &agrave; motiva&ccedil;&atilde;o, incentivo e suporte em todas as etapas do cuidado em sa&uacute;de. Ouvir a hist&oacute;ria do paciente, entender o que ele est&aacute; passando, absorver as informa&ccedil;&otilde;es e poder transmitir o que &eacute; necess&aacute;rio &eacute; imprescind&iacute;vel.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &Eacute; importante que os pacientes e seus acompanhantes saibam que perguntas detalhadas s&atilde;o essenciais para uma compreens&atilde;o ampla do problema de sa&uacute;de. Muitas vezes, por d&uacute;vida, desconhecimento, vergonha ou ansiedade, os pacientes n&atilde;o explicam sobre sua condi&ccedil;&atilde;o de sa&uacute;de. Por isso, cabe ao profissional estar aberto a falar e a ouvir, passar confian&ccedil;a e transmitir as informa&ccedil;&otilde;es de maneira clara.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Enquanto alguns pacientes se mostram bastante proativos durante uma investiga&ccedil;&atilde;o diagn&oacute;stica ou um tratamento, outros n&atilde;o sabem ao certo o que perguntar, quando e como. Quando o paciente n&atilde;o se sente seguro para conversar, se inicia a dificuldade para estabelecer um v&iacute;nculo e a pr&oacute;pria condu&ccedil;&atilde;o m&eacute;dica do caso.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A comunica&ccedil;&atilde;o eficaz, resulta em uma s&eacute;rie de benef&iacute;cios. Ela repercute positivamente no relacionamento, na qualidade do atendimento, na diminui&ccedil;&atilde;o das queixas e dos erros, al&eacute;m de melhorar o v&iacute;nculo e possibilitar uma maior rela&ccedil;&atilde;o de confian&ccedil;a entre m&eacute;dico e paciente. O papel dos profissionais da &aacute;rea &eacute; procurar orient&aacute;-los da melhor maneira poss&iacute;vel. Encorajar os pacientes a ter maior participa&ccedil;&atilde;o e inform&aacute;-los de que eles podem levar as suas d&uacute;vidas anotadas, pode ser uma campanha a ser adotada para a melhoria do atendimento. Tamb&eacute;m podem e deveriam anotar as orienta&ccedil;&otilde;es mais importantes que o m&eacute;dico lhes passou, e precau&ccedil;&otilde;es a tomar, dentre outros. O objetivo &eacute; oferecer mais dados sobre uma doen&ccedil;a ou tratamento, servindo de esclarecimento e suporte a um tratamento. Portanto ao encontrar seu m&eacute;dico questione e diga tudo o que est&aacute; acontecendo com voc&ecirc;.</p>',1,'2020-10-10 12:38:38','2020-10-10 12:38:38','2020-10-10-a-importancia-da-comunicacao-entre-o-paciente-e-o-profissional-de-saude',NULL,'Pixel',NULL),(14,'BENEFÍCIOS DO CONTROLE DE QUALIDADE EM RESSONÂNCIA PUC','<p>O controle de qualidade &eacute; importante para garantir o funcionamento satisfat&oacute;rio de determinado produto ou servi&ccedil;o. Na resson&acirc;ncia magn&eacute;tica, isto beneficia na alta qualidade das imagens e seus diagn&oacute;sticos, garante a precis&atilde;o e a seguran&ccedil;a dos envolvidos.<br /><br />Diariamente, no in&iacute;cio do dia ou em troca de turnos devem ser realizados uma s&eacute;rie de revis&otilde;es para garantir que todos os itens necess&aacute;rios para a realiza&ccedil;&atilde;o do exame est&atilde;o dispon&iacute;veis e em conformidade. Esta inspe&ccedil;&atilde;o pode conter a verifica&ccedil;&atilde;o da temperatura do ar condicionado, condi&ccedil;&atilde;o das bobinas, baterias de equipamentos e materiais em geral. O sistema de refrigera&ccedil;&atilde;o e o magneto devem ser verificados diariamente e os dados coletados devem ser registrados em planilha.<br /><br />Al&eacute;m de efici&ecirc;ncia nos resultados de imagens, a revis&atilde;o dos equipamentos assegura o bom desempenho dos aparelhos j&aacute; que com a rotina intensa do setor de diagn&oacute;stico colabora para o desgaste natural dos equipamentos.<br /><br />Com o controle de qualidade em resson&acirc;ncia magn&eacute;tica, s&atilde;o realizados testes de distor&ccedil;&atilde;o geom&eacute;trica, resolu&ccedil;&atilde;o espacial de alto contraste, espessura de corte, posi&ccedil;&atilde;o do corte, uniformidade da imagem, percentual de artefato fantasma, detec&ccedil;&atilde;o de objetos de baixo contraste, cursos de aperfei&ccedil;oamento dos funcion&aacute;rios.<br />Com o &oacute;timo desempenho dos aparelhos, se beneficia com precis&atilde;o nos resultados, o que evita que haja repeti&ccedil;&otilde;es dos exames e a satisfa&ccedil;&atilde;o dos clientes.<br /><br />A Pixel Diagn&oacute;stico Por Imagem, localizada no sul de Minas em Po&ccedil;os de Caldas, se assegura da qualidade e do comprometimento com o controle di&aacute;rio dos seus equipamentos e sua equipe de profissionais capacitados.&nbsp;<br /><br />Agora que voc&ecirc; sabe um pouco sobre os benef&iacute;cios do controle de qualidade em resson&acirc;ncia magn&eacute;tica, ligue e marque seu exame na Pixel (35) 3722-1617 WhatsApp&nbsp;<br />(35) 99785-7697</p>',1,'2020-10-10 12:49:23','2020-10-11 14:33:42','2020-10-10-beneficios-do-controle-de-qualidade-em-ressonancia-puc','ressonância, magnética, Diagnóstico, Pixel, Poços de Caldas, ','Pixel','O controle de qualidade é importante para garantir o funcionamento satisfatório de determinado produto ou serviço. Na ressonância magnética, isto beneficia na alta qualidade das imagens e seus diagnósticos, garante a precisão e a segurança dos envolvidos.'),(15,'LAUDOS WEB','<p>Cl&iacute;nica Pixel sistema de laudos web a favor da sa&uacute;de Com o objetivo de oferecer os melhores servi&ccedil;os, adquirindo aparelhos de &uacute;ltima gera&ccedil;&atilde;o e buscando o melhor atendimento e assim continuar sendo refer&ecirc;ncia em exames de Diagn&oacute;stico por Imagem, a cl&iacute;nica Pixel aposta na tecnologia para otimizar o trabalho oferecido. Pensando nisso, investimos na moderniza&ccedil;&atilde;o dos processos incluindo a disponibilidade de seus exames via web. Em um cen&aacute;rio onde os avan&ccedil;os tecnol&oacute;gicos s&atilde;o vistos como diferencial para as empresas de todos os segmentos, uma &aacute;rea como a nossa que prioriza agilidade e a praticidade esta adapta&ccedil;&atilde;o passa a ser fundamental. A internet nos possibilita resolver muitas tarefas do dia-a-dia. O processo para acesso aos resultados &eacute; simples: primeiro, os exames s&atilde;o realizados com o aux&iacute;lio de um computador com software do aparelho. Os arquivos gerados s&atilde;o transmitidos via plataforma e salvos na nuvem. Logando no sistema com a senha que &eacute; gerada individual, o m&eacute;dico pode verificar os arquivos dos exames enviados, avalia a conclus&atilde;o do diagn&oacute;stico encontrado e, caso seja necess&aacute;rio, pode ainda entrar em contato com a cl&iacute;nica para discutir o caso com o especialista respons&aacute;vel por aquele exame. Se necess&aacute;rio disponibilizamos tamb&eacute;m o exame impresso, da mesma forma que acontece no processo tradicional. Geralmente, a conclus&atilde;o dos resultados impressos levaria uma semana para ser entregue. No entanto, o programa fornece o resultado online, dentro de 48 horas. O m&eacute;todo tem atingido bons resultados, facilitando o trabalho dos m&eacute;dicos e estreitando a comunica&ccedil;&atilde;o entre os pacientes e profissionais. Segundo o diretor respons&aacute;vel pela Cl&iacute;nica Pixel, Dr. Germano de Almeida Fleming, essas imagens ficam arquivadas no site&nbsp;<a href=\"https://www.google.com/url?q=http%3A%2F%2Fwww.pixeldiagnostico.com.br&amp;sa=D&amp;usd=2&amp;usg=AFQjCNHiPFFpZSW7Y64MUzciNtsVEeYQuw\" target=\"_blank\" rel=\"noopener\">www.pixeldiagnostico.com.br</a>, na op&ccedil;&atilde;o Laudos Web, de forma permanente, o que garante que o seu exame esta guardado por tempo indeterminado. Outro ponto importante que o m&eacute;dico ressaltou, &eacute; que o m&eacute;todo acaba simplificando a vida dos pacientes, principalmente dos que residem em outra cidade que n&atilde;o ter&atilde;o mais necessidade de voltar apenas para buscar esses resultados, evitando inclusive danos e dobras durante a viagem. &Eacute; fato que muitos profissionais t&ecirc;m certa dificuldade em aderir ao novo sistema, mas esta op&ccedil;&atilde;o al&eacute;m de comodidade, tamb&eacute;m agiliza o diagn&oacute;stico e tratamento do paciente e contribui com a sustentabilidade, uma vez que o papel especial obrigat&oacute;rio para este tipo de fotografia, come&ccedil;a ent&atilde;o a ser substitu&iacute;do por imagens online. Por&eacute;m, para os m&eacute;dicos que trabalham em lugares que n&atilde;o possuem estrutura de internet, a Cl&iacute;nica Pixel continua fornecendo as imagens na forma tradicional. V&aacute;rios m&eacute;dicos j&aacute; desfrutam e elogiam a comodidade que o sistema web oferece! Conhe&ccedil;a a nossa cl&iacute;nica e aproveite voc&ecirc; tamb&eacute;m.</p>',1,'2020-10-18 20:50:21','2020-10-18 20:50:21','2020-10-18-laudos-web',NULL,'Pixel','Clínica Pixel sistema de laudos web a favor da saúde Com o objetivo de oferecer os melhores serviços, adquirindo aparelhos de última geração e buscando o melhor atendimento e assim continuar sendo referência em exames de Diagnóstico por Imagem, a clínica Pixel aposta na tecnologia para otimizar o trabalho oferecido. Pensando nisso, investimos na modernização dos processos incluindo a disponibilidade de seus exames via web.'),(16,'OBESIDADE O MAL DO SÉCULO','<p>A obesidade &eacute; um problema de sa&uacute;de que afeta o mundo todo e est&aacute; cada vez mais crescente em todos os pa&iacute;ses por pessoas de todas as idades. Apesar das grandes porcentagens, existem muitas maneiras de prevenir a obesidade em crian&ccedil;as e adultos. N&atilde;o s&oacute; o tratamento, mas a preven&ccedil;&atilde;o desempenha um papel importante na boa sa&uacute;de. A obesidade est&aacute; associada a uma longa lista de doen&ccedil;as cr&ocirc;nicas, muitas das quais se tornam mais dif&iacute;ceis de tratar com o tempo. Algumas das mais comuns s&atilde;o press&atilde;o alta, doen&ccedil;a card&iacute;aca, apneia do sono, s&iacute;ndrome metab&oacute;lica e diabetes tipo 2. Preven&ccedil;&atilde;o para os mais jovens A preven&ccedil;&atilde;o da obesidade come&ccedil;a desde cedo. Alimentar as crian&ccedil;as com por&ccedil;&otilde;es apropriadas, com alimentos saud&aacute;veis evitando industrializados, com altas n&iacute;veis de a&ccedil;ucares e gorduras. Esta &eacute; uma idade relativamente f&aacute;cil para come&ccedil;ar o problema do sobrepeso pois crian&ccedil;as e adolescentes est&atilde;o mais propensas a escolherem sempre comidas de fast-food. Desde cedo &eacute; preciso incentiv&aacute;-las a comerem frutas e verduras, para j&aacute; criarem este h&aacute;bito ao inv&eacute;s de serem acostumadas a comerem apenas o que desejam. Alimentos &ldquo;menos saud&aacute;veis&rdquo; deve ser de uma op&ccedil;&atilde;o em raras ocasi&otilde;es. Outro ponto importante sobre a obesidade em crian&ccedil;as &eacute; que os pais mudem seus h&aacute;bitos alimentares como forma de incentivo di&aacute;rio. &Eacute; de extrema import&acirc;ncia contra a obesidade n&atilde;o se submeter a combina&ccedil;&atilde;o da m&aacute; alimenta&ccedil;&atilde;o juntamente ao sedentarismo. A Organiza&ccedil;&atilde;o Mundial de Sa&uacute;de (OMS) recomenda que crian&ccedil;as e adolescentes tenham pelo menos 60 minutos de atividade f&iacute;sica di&aacute;ria, como exerc&iacute;cios e esportes. De prefer&ecirc;ncia sem fins competitivos e respeitando o limite f&iacute;sico de cada corpo. Preven&ccedil;&atilde;o para adultos Para todas as idades o consumo de alimentos saud&aacute;veis e frescos como verduras, legumes, frutas e cereais devem ser consumidos em maior quantidade do que alimentos processados, ou serem evitados. A recomenda&ccedil;&atilde;o di&aacute;ria para a ingest&atilde;o de frutas e vegetais &eacute; de cinco a nove por&ccedil;&otilde;es por dia para adultos. As fibras trazem sensa&ccedil;&atilde;o de saciedade, evitando excessos. O treinamento com pesos &eacute; t&atilde;o importante para a manuten&ccedil;&atilde;o do peso quanto a atividade aer&oacute;bica. Al&eacute;m da atividade aer&oacute;bica semanal, a OMS recomenda o treinamento com pesos que envolve todos os m&uacute;sculos principais pelo menos duas vezes por semana. Incorporar atividade f&iacute;sica regular em sua agenda &eacute; importante para manter ou perder peso, entre outros benef&iacute;cios. Se recomenda cerca no m&iacute;nimo de 1 hora e 30 minutos por dia de atividade aer&oacute;bica. Um peso saud&aacute;vel &eacute; importante para manter uma boa sa&uacute;de. Tomar medidas para prevenir a obesidade em sua vida di&aacute;ria &eacute; um bom primeiro passo. Mesmo pequenas mudan&ccedil;as, podem ajudar a prevenir a obesidade. A cl&iacute;nica Pixel se preocupa com a preven&ccedil;&atilde;o da sua sa&uacute;de, informa&ccedil;&otilde;es como estas contribuem para a conscientiza&ccedil;&atilde;o e aquisi&ccedil;&atilde;o de novos h&aacute;bitos a voc&ecirc; e sua fam&iacute;lia.</p>',1,'2020-10-18 21:11:42','2020-10-18 21:11:42','2020-10-19-obesidade-o-mal-do-seculo',NULL,'Pixel','A obesidade é um problema de saúde que afeta o mundo todo e está cada vez mais crescente em todos os países por pessoas de todas as idades. Apesar das grandes porcentagens, existem muitas maneiras de prevenir a obesidade em crianças e adultos. Não só o tratamento, mas a prevenção desempenha um papel importante na boa saúde. A obesidade está associada a uma longa lista de doenças crônicas, muitas das quais se tornam mais difíceis de tratar com o tempo.'),(17,'EXCESSO DE EXERCÍCIOS','<p>As atividades f&iacute;sicas s&atilde;o essenciais para a sa&uacute;de do corpo e da mente, mas at&eacute; que ponto esta pr&aacute;tica &eacute; saud&aacute;vel? Toda pr&aacute;tica esportiva tem risco de les&atilde;o. Pessoas sedent&aacute;rias n&atilde;o est&atilde;o preparadas para o excesso de atividades. Causa estresse, desgaste e fadiga muscular &ndash; a chamada s&iacute;ndrome de overtraining. Isso &eacute; um problema recorrente em pessoas mal informadas que pensam que exerc&iacute;cios, independente de quanto, s&atilde;o sempre bons pra sa&uacute;de. Movimentos n&atilde;o espec&iacute;ficos para seu biotipo de corpo podem fazer mal f&iacute;sico e mental. Alguns dos sintomas mais comuns do overtraining s&atilde;o as dores nas articula&ccedil;&otilde;es, ossos fr&aacute;geis, ins&ocirc;nia, problemas de cora&ccedil;&atilde;o, aumento da produ&ccedil;&atilde;o de cortisol e at&eacute; mesmo depress&atilde;o. As atividades f&iacute;sicas podem ser praticadas diariamente, por&eacute;m de acordo com a necessidade e resist&ecirc;ncia de cada um. O ideal &eacute; come&ccedil;ar 3 vezes na semana e cerca de 1 hora de pr&aacute;tica, alternando os dias entre as atividades. Dormir e se alimentar bem tamb&eacute;m s&atilde;o indispens&aacute;veis e claro, sempre estar acompanhado de um profissional da &aacute;rea. A preocupa&ccedil;&atilde;o &eacute; que qualquer atividade f&iacute;sica ou esportiva seja praticada com seguran&ccedil;a. O que deve ser uma responsabilidade, em primeiro lugar, dos profissionais e depois dos praticantes, que t&ecirc;m de se esfor&ccedil;ar, mas n&atilde;o ir al&eacute;m do limite. O cuidado com o corpo e a sa&uacute;de deve ser prioridade na vida de cada um de n&oacute;s. O compromisso da cl&iacute;nica Pixel &eacute; cuidar de voc&ecirc;!</p>',1,'2020-10-21 13:36:37','2020-10-21 13:36:37','2020-10-21-excesso-de-exercicios',NULL,'Pixel','As atividades físicas são essenciais para a saúde do corpo e da mente, mas até que ponto esta prática é saudável? Toda prática esportiva tem risco de lesão. Pessoas sedentárias não estão preparadas para o excesso de atividades. Causa estresse, desgaste e fadiga muscular – a chamada síndrome de overtraining.'),(18,'A EVOLUÇÃO DA RADIOLOGIA','<p>A Radiologia &eacute; a ci&ecirc;ncia do uso de imagens para ajudar a diagnosticar e tratar doen&ccedil;as no corpo humano. Ela surgiu h&aacute; 124 anos, em 1895, quando o f&iacute;sico alem&atilde;o Wilhelm Roentgen acidentalmente fez o primeiro Raio-x da hist&oacute;ria, da m&atilde;o de sua esposa. Em 1896, foi descoberta a radioatividade. No mesmo ano, fundou-se o primeiro jornal de radiologia chamado Archives of Clinical Skiagraphy . Muitas novas descobertas aconteceram ao longo da hist&oacute;ria da radiologia. Em 1913, outra descoberta foi feita quando a pesquisa de Albert Salomon levou &agrave; mamografia. Cerca de 14 anos depois, desenvolveu angiografia cerebral e outros seis anos depois, f&iacute;sicos e cientistas foram capazes de produzir radiois&oacute;topos artificialmente. Ao longo dos anos, muitas novas t&eacute;cnicas que caem na categoria de radiologia foram introduzidas. A tomografia computadorizada foi uma delas. &Eacute; um m&eacute;todo de diagn&oacute;stico por imagem que tamb&eacute;m utiliza o raio-X para criar imagens de alt&iacute;ssima resolu&ccedil;&atilde;o espacial de todo o corpo humano, com destaque para estruturas e &oacute;rg&atilde;os internos, ossos, tecidos de partes moles e vasos sangu&iacute;neos, nos equipamentos mais modernos de tomografia s&atilde;o realizadas aquisi&ccedil;&otilde;es volum&eacute;tricas que permitem reconstitui&ccedil;&otilde;es das imagens em m&uacute;ltiplos planos, inclusive visualiza&ccedil;&otilde;es em 3D. Al&eacute;m disso, a ultrassonografia come&ccedil;ou a ser usada na d&eacute;cada de 1950 com m&aacute;quinas de ultrassom &ldquo;em tempo real&rdquo; chegando &agrave; comunidade m&eacute;dica no final dos anos 70, destacando-se como um m&eacute;todo importante para as doen&ccedil;as abdominop&eacute;lvicas e, principalmente, no monitoramento de mulheres gr&aacute;vidas hoje em dia. O primeiro scanner de resson&acirc;ncia magn&eacute;tica comercial foi desenvolvido em 1977. &Eacute; feita atrav&eacute;s da utiliza&ccedil;&atilde;o de um potente campo magn&eacute;tico, ondas de radiofrequ&ecirc;ncia e computadores, para produzir imagens com alta resolu&ccedil;&atilde;o de contraste das estruturas internas do corpo. A Pixel tem orgulho de fazer parte desta hist&oacute;ria. Navegue em nosso blog para mais curiosidades e dicas de sa&uacute;de.</p>',1,'2020-10-21 13:40:33','2020-10-21 13:40:33','2020-10-21-a-evolucao-da-radiologia',NULL,'Pixel','A Radiologia é a ciência do uso de imagens para ajudar a diagnosticar e tratar doenças no corpo humano. Ela surgiu há 124 anos, em 1895, quando o físico alemão Wilhelm Roentgen acidentalmente fez o primeiro Raio-x da história, da mão de sua esposa. Em 1896, foi descoberta a radioatividade. No mesmo ano, fundou-se o primeiro jornal de radiologia chamado Archives of Clinical Skiagraphy . Muitas novas descobertas aconteceram ao longo da história da radiologia. '),(19,'MEDICINA DIAGNÓSTICA','<p>A Pixel Diagn&oacute;stico por Imagem &eacute; uma cl&iacute;nica radiol&oacute;gica localizada em Po&ccedil;os de Caldas, no sul de Minas. N&oacute;s oferecemos maior conforto e equipamentos de alta tecnologia.&nbsp;<br />O diagn&oacute;stico m&eacute;dico &eacute; o processo de determinar qual doen&ccedil;a ou condi&ccedil;&atilde;o explica os sintomas e sinais de uma doen&ccedil;a. A radiologia diagn&oacute;stica tem um papel extremamente importante no diagnostico m&eacute;dico, com imagens de alta resolu&ccedil;&atilde;o do interior do corpo, capaz de reproduzir a imagem em tempo real de &oacute;rg&atilde;os.&nbsp;<br />Essa an&aacute;lise &eacute; feita por meio de diferentes tipos de imagens. Isso permite que o m&eacute;dico identifique, de maneira mais facilitada e r&aacute;pida sobre o que est&aacute; acontecendo com o paciente.&nbsp;<br />Facilidade e efic&aacute;cia para diagnosticar poss&iacute;veis problemas, doen&ccedil;as e traumas. A radiologia fez um grande avan&ccedil;o na medicina e faz parte dos exames m&eacute;dicos para tratamentos e auxiliando na preven&ccedil;&otilde;es de poss&iacute;veis enfermidades.<br />A mulher pode ter uma gravidez segura e acompanhada regularmente por imagens do &uacute;tero com a ultrassonografia, podendo ver condi&ccedil;&otilde;es do feto.&nbsp;<br />A tomografia computadorizada combina efeitos especiais de raio x com computadores programados para reproduzir imagens do corpo humano, podendo ser avaliado em qualquer &acirc;ngulo.&nbsp;<br />Na odontologia &eacute; poss&iacute;vel verificar condi&ccedil;&otilde;es de ra&iacute;zes e ossos da face, para poss&iacute;veis problemas de agenesias, desgaste de ossos dentre outras anormalidades e tamb&eacute;m ter o acompanhamento e documenta&ccedil;&atilde;o do complexo buco-maxilo-facial e estruturas anexas.<br />A resson&acirc;ncia magn&eacute;tica &eacute; uma das mais eficientes em quest&atilde;o de imagens resolutivas de todo o corpo.<br />Al&eacute;m de diagn&oacute;sticos, a radiologia na medicina auxilia na preven&ccedil;&atilde;o de futuras complica&ccedil;&otilde;es e doen&ccedil;as.<br /><br />Marque seu diagn&oacute;stico na Pixel (35) 3722-1617</p>',1,'2020-10-21 13:48:18','2020-10-21 13:48:18','2020-10-21-medicina-diagnostica',NULL,'Pixel','A Pixel Diagnóstico por Imagem é uma clínica radiológica localizada em Poços de Caldas, no sul de Minas. Nós oferecemos maior conforto e equipamentos de alta tecnologia. \r\nO diagnóstico médico é o processo de determinar qual doença ou condição explica os sintomas e sinais de uma doença. '),(20,'PREVENTIVO','<p>A cl&iacute;nica Pixel realiza desde o in&iacute;cio deste ano, o exame de Resson&acirc;ncia Magn&eacute;tica de corpo com o objetivo de despertar a aten&ccedil;&atilde;o do nosso p&uacute;blico para a preven&ccedil;&atilde;o de doen&ccedil;as ou complica&ccedil;&otilde;es. Chamado de Rastreamento Preventivo este exame faz uma avalia&ccedil;&atilde;o geral das regi&otilde;es da cabe&ccedil;a, pesco&ccedil;o, t&oacute;rax, abdome e pelve, caso seja encontrada alguma altera&ccedil;&atilde;o o m&eacute;dico radiologista indicar&aacute; o exame espec&iacute;fico para aquela determinada regi&atilde;o.<br />Este exame &eacute; um diferencial entre as cl&iacute;nicas radiol&oacute;gicas mais modernas, apesar de pouco conhecido. Neste ano o mesmo exame tamb&eacute;m foi implantado no Hospital de Coimbra em Portugal e em Cabo Frio &ndash; RJ. Diferente da cl&iacute;nica Pixel, estes outros realizam o exame com o prop&oacute;sito de uma investiga&ccedil;&atilde;o voltada para tratamentos oncol&oacute;gicos.&nbsp;<br /><br />A Resson&acirc;ncia Magn&eacute;tica &eacute; um dos exames mais modernos e que revolucionou o diagn&oacute;stico m&eacute;dico. Trata-se de um exame que n&atilde;o usa radia&ccedil;&atilde;o, mas adquire as informa&ccedil;&otilde;es fornecidas pelo campo magn&eacute;tico e ondas de radiofrequ&ecirc;ncia geradas pelo aparelho e traduzidas por um computador especial.<br /><br />Segundo o Diretor Cl&iacute;nico do Hospital da Luz Coimbra, a oferta de exames de RM de corpo ocupa, um espa&ccedil;o muito importante no diagn&oacute;stico e seguimento dos pacientes do foro oncol&oacute;gico. &Eacute; sem d&uacute;vida um passo seguro para a oferta de uma medicina mais personalizada, e o seu uso pode poupar boa parte dos pacientes com exames desnecess&aacute;rios.<br /><br />A realiza&ccedil;&atilde;o da resson&acirc;ncia magn&eacute;tica de corpo est&aacute; indicada como exame preventivo, permitindo a detec&ccedil;&atilde;o precoce de les&otilde;es. Independentemente da idade o cuidado com a sa&uacute;de &eacute; essencial, pesquisas da OMS (Organiza&ccedil;&atilde;o Mundial de Sa&uacute;de) apontam que 73% das mortes no Brasil ocorrem de doen&ccedil;as consider&aacute;veis evit&aacute;veis.&nbsp;<br /><br />O cuidado com a sa&uacute;de &eacute; um conjunto que envolve uma alimenta&ccedil;&atilde;o saud&aacute;vel, a pr&aacute;tica regular de atividades f&iacute;sica e acompanhamento m&eacute;dico. A sa&uacute;de reflete diretamente em todos os aspectos da nossa vida, cuide-se.&nbsp;<br /><br />Marque seu exame de Resson&acirc;ncia Magn&eacute;tica de corpo na Pixel, um dos centros radiol&oacute;gicos mais modernos da regi&atilde;o do sul de Minas.<br />Pixel, sua sa&uacute;de, nossa Imagem.<br />(35) 3722-1617</p>',1,'2020-10-21 13:50:18','2020-10-21 13:50:18','2020-10-21-preventivo',NULL,'Pixel','A clínica Pixel realiza desde o início deste ano, o exame de Ressonância Magnética de corpo com o objetivo de despertar a atenção do nosso público para a prevenção de doenças ou complicações. Chamado de Rastreamento Preventivo este exame faz uma avaliação geral das regiões da cabeça, pescoço, tórax, abdome e pelve, caso seja encontrada alguma alteração o médico radiologista indicará o exame específico para aquela determinada região.'),(21,'DOENÇAS MAIS COMUNS NO INVERNO','<p>A baixa nas temperaturas traz uma s&eacute;rie de doen&ccedil;as e problemas respirat&oacute;rios. Mas n&atilde;o &eacute; s&oacute; o frio, o h&aacute;bito de se manter em lugares fechados e movimentados s&atilde;o decorrentes da chegada do inverno e favorecem o aparecimento de algumas doen&ccedil;as.<br /><br /><br />Coriza e espirros, febre, dores musculares, falta de disposi&ccedil;&atilde;o, dor de cabe&ccedil;a e atr&aacute;s dos olhos s&atilde;o sintomas t&iacute;picos das doen&ccedil;as nesta esta&ccedil;&atilde;o do ano.<br /><br /><br />Algumas das doen&ccedil;as mais comuns no inverno s&atilde;o resfriado, gripe, sinusite, bronquite, rinite, asma, laringite, faringite, pneumonia, amidalite e otite.<br />A gripe &eacute; uma doen&ccedil;a muito contagiosa, que ataca as vias respirat&oacute;rias (nariz, garganta e pulm&otilde;es) e &eacute; causada por um v&iacute;rus chamado Influenza. O resfriado &eacute; uma infec&ccedil;&atilde;o leve das vias a&eacute;reas superiores (nariz e garganta). N&atilde;o existe rem&eacute;dio para cur&aacute;-lo, apenas para amenizar os sintomas. A sinusite &eacute; uma inflama&ccedil;&atilde;o dos seios da face. Ocorre geralmente ap&oacute;s resfriados prolongados ou crises de alergia (rinite).<br /><br /><br />&nbsp;Mas claro que podemos prevenir com alguns h&aacute;bitos simples. Lavar a m&atilde;os com frequ&ecirc;ncia e antes de se alimentar pode evitar contamina&ccedil;&otilde;es vinda de objetos e espirros. Andar sempre com um &aacute;lcool em gel, abrir as janelas para ventila&ccedil;&atilde;o da casa, manter edredons e cobertores limpos. &Eacute; importante agasalhar-se bem e evitar correntes de ar frias.<br /><br />A preven&ccedil;&atilde;o &eacute; a melhor forma de se manter sadio em &eacute;pocas frias.<br />Navegue pelo blog da Pixel para mais dicas de sa&uacute;de.<br /><br />Pixel Diagn&oacute;stico por Imagem<br />&nbsp;(35) 3722-1617</p>\r\n<p>&nbsp;</p>\r\n<p>#dicasdeinverno #inverno #pocosdecaldas</p>',1,'2020-10-21 13:51:56','2020-10-21 13:51:56','2020-10-21-doencas-mais-comuns-no-inverno',NULL,'Pixel','A baixa nas temperaturas traz uma série de doenças e problemas respiratórios. Mas não é só o frio, o hábito de se manter em lugares fechados e movimentados são decorrentes da chegada do inverno e favorecem o aparecimento de algumas doenças.\r\n\r\n\r\nCoriza e espirros, febre, dores musculares, falta de disposição, dor de cabeça e atrás dos olhos são sintomas típicos das doenças nesta estação do ano.\r\n'),(22,'DICAS DE INVERNO','<p>Friozinho ta a&iacute;! E temos algumas dicas de cuidados para seu bem-estar e sa&uacute;de neste inverno. - Beber bastante &aacute;gua e usar hidratantes corporais e faciais podem amenizar o ressecamento da pele. - Se movimente! Mantenha a circula&ccedil;&atilde;o de sangue. - Frutas c&iacute;tricas e alimentos antioxidantes ajudam a estimular a respira&ccedil;&atilde;o, protegem e fortalecem o sistema imune. - Ch&aacute;s, sopas, caldos e banhos quentes para aquecer o corpo. - Evitar lugares fechados com risco de contamina&ccedil;&atilde;o de v&iacute;rus. - Procure consumir alimentos com vitamina D como peixeis do tipo salm&atilde;o, atum, sardinha. Tamb&eacute;m gema de ovo, cogumelos, bife de f&iacute;gado, e queijos. Estamos sempre buscando dicas de sa&uacute;de e bem-estar. Confira tamb&eacute;m nossas outras dicas.</p>',1,'2020-10-21 13:53:05','2020-10-21 13:53:05','2020-10-21-dicas-de-inverno',NULL,'Pixel','Friozinho ta aí! E temos algumas dicas de cuidados para seu bem-estar e saúde neste inverno. - Beber bastante água e usar hidratantes corporais e faciais podem amenizar o ressecamento da pele.'),(23,'QUANDO INDICAR TOMOGRAFIA COMPUTADORIZADA E/OU RESSONÂNCIA MAGNÉTICA','<p>Em breve teremos &agrave; disposi&ccedil;&atilde;o um canal de comunica&ccedil;&atilde;o entre a cl&iacute;nica, pacientes e amigos para esclarecimento de d&uacute;vidas. Pensando nisso, no post abaixo segue algumas orienta&ccedil;&otilde;es de qual exame ser realizado de acordo com cada diagn&oacute;stico. A comunica&ccedil;&atilde;o &eacute; considerada fator indispens&aacute;vel em qualquer circunst&acirc;ncia. Na &aacute;rea da sa&uacute;de, al&eacute;m de indispens&aacute;vel, &eacute; imprescind&iacute;vel que m&eacute;dico e paciente falem a mesma linguagem para que o tratamento seja efetivo. A cl&iacute;nica Pixel tem como prioridade a efetividade na solu&ccedil;&atilde;o de problemas e a qualidade do atendimento de todos os seus pacientes. Pensando nisso, buscamos todas as ferramentas que estejam &agrave; nossa disposi&ccedil;&atilde;o para usar como diferencial aos nossos clientes.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p aria-controls=\"text-align: center;\"><em><strong>Quando indicar Tomografia Computadorizada e/ou&nbsp;Resson&acirc;ncia Magn&eacute;tica</strong></em></p>\r\n<table class=\"table table-striped\" style=\"border-collapse: collapse; width: 99.3616%; height: 1475px; background-color: #843fa1;\" border=\"1\">\r\n<tbody>\r\n<tr aria-controls=\"height: 88px;\">\r\n<td style=\"width: 11.4616%; height: 88px;\" bgcolor=\"#f1f1f1\" height=\"89\">\r\n<p align=\"center\"><strong>&Oacute;RG&Atilde;O</strong></p>\r\n</td>\r\n<td style=\"width: 50.6835%; height: 88px;\" bgcolor=\"#f1f1f1\">\r\n<p align=\"center\"><strong>EXAME</strong></p>\r\n</td>\r\n<td style=\"width: 1.05932%; height: 88px;\" colspan=\"2\" bgcolor=\"#f1f1f1\">\r\n<p align=\"center\"><strong>OBSERVA&Ccedil;&Atilde;O</strong></p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 184px;\">\r\n<td style=\"width: 11.4616%; height: 10px;\" bgcolor=\"#fefefe\" height=\"170\">\r\n<p align=\"center\">&Oacute;RBITA</p>\r\n</td>\r\n<td style=\"width: 50.6835%; height: 10px;\" bgcolor=\"#fefefe\">\r\n<p align=\"center\">TC e/ou RM</p>\r\n</td>\r\n<td style=\"width: 1.05932%; height: 10px;\" colspan=\"2\" bgcolor=\"#fefefe\">\r\n<p>A TC mostra bem as estruturas da &oacute;rbita. Em determinadas situa&ccedil;&otilde;es, devido aos cortes multiplanares e pela t&eacute;cnica de supress&atilde;o de gordura a RM &eacute; bastante &uacute;til no estudo da &oacute;rbita.</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 317px;\">\r\n<td style=\"width: 11.4616%; height: 222px;\" bgcolor=\"#f1f1f1\" height=\"151\">\r\n<p align=\"center\">HIP&Oacute;FISE</p>\r\n</td>\r\n<td style=\"width: 50.6835%; height: 222px;\" bgcolor=\"#f1f1f1\">\r\n<p align=\"center\">RM</p>\r\n</td>\r\n<td style=\"width: 1.05932%; height: 222px;\" colspan=\"2\" bgcolor=\"#f1f1f1\">\r\n<p>Exame de realiza&ccedil;&atilde;o mais c&ocirc;moda para o paciente. Contraste praticamente isento de rea&ccedil;&atilde;o. Visualiza&ccedil;&atilde;o perfeita do hipot&aacute;lamo, haste hipofis&aacute;ria, hip&oacute;fise e regi&atilde;o para-selar.</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 141px;\">\r\n<td style=\"width: 11.4616%; height: 141px;\" bgcolor=\"#fefefe\" height=\"132\">\r\n<p align=\"center\">OUVIDO</p>\r\n<p align=\"center\">(ESTRUTURA &Oacute;SSEA)</p>\r\n</td>\r\n<td style=\"width: 50.6835%; height: 141px;\" bgcolor=\"#fefefe\">\r\n<p align=\"center\">TC</p>\r\n</td>\r\n<td style=\"width: 1.05932%; height: 141px;\" colspan=\"2\" bgcolor=\"#fefefe\">\r\n<p>TC de alta resolu&ccedil;&atilde;o evidencia todas as estruturas &oacute;sseas do ouvido.</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 163px;\">\r\n<td style=\"width: 11.4616%; height: 163px;\" bgcolor=\"#f1f1f1\" height=\"132\">\r\n<p align=\"center\">OUVIDO</p>\r\n<p align=\"center\">(NERVO ESTEATO AC&Uacute;STICO)</p>\r\n</td>\r\n<td style=\"width: 50.6835%; height: 163px;\" bgcolor=\"#f1f1f1\">\r\n<p align=\"center\">RM</p>\r\n</td>\r\n<td style=\"width: 1.05932%; height: 163px;\" colspan=\"2\" bgcolor=\"#f1f1f1\">\r\n<p>Somente a RM mostra o nervo esteato ac&uacute;stico sem interfer&ecirc;ncia de estruturas vizinhas.</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 405px;\">\r\n<td style=\"width: 11.4616%; height: 405px;\" bgcolor=\"#fefefe\" height=\"215\">\r\n<p align=\"center\">COLUNA VERTEBRAL</p>\r\n</td>\r\n<td style=\"width: 50.6835%; height: 405px;\" bgcolor=\"#fefefe\">\r\n<p align=\"center\">RM</p>\r\n</td>\r\n<td style=\"width: 1.05932%; height: 405px;\" colspan=\"2\" bgcolor=\"#fefefe\">\r\n<p>Os cortes multiplanares faz da RM o m&eacute;todo ideal para o estudo da coluna vertebral. Na suspeita de met&aacute;stases, &eacute; eficiente como a cintilografia. H&eacute;rnia discal &eacute; bem evidenciada na RM, bem como patologias da medula e comprometimento extra-medular.</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 163px;\">\r\n<td style=\"width: 11.4616%; height: 163px;\" bgcolor=\"#f1f1f1\" height=\"76\">\r\n<p align=\"center\">SEIOS DA FACE</p>\r\n</td>\r\n<td style=\"width: 50.6835%; height: 163px;\" bgcolor=\"#f1f1f1\">\r\n<p align=\"center\">TC e/ou RM</p>\r\n</td>\r\n<td style=\"width: 1.05932%; height: 163px;\" colspan=\"2\" bgcolor=\"#f1f1f1\">\r\n<p>A TC mostra bem os seios da face e suas patologias. Em algumas situa&ccedil;&otilde;es a RM est&aacute; indicada.</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 273px;\">\r\n<td style=\"width: 11.4616%; height: 273px;\" bgcolor=\"#fefefe\" height=\"113\">\r\n<p align=\"center\">PESCO&Ccedil;O</p>\r\n</td>\r\n<td style=\"width: 50.6835%; height: 273px;\" bgcolor=\"#fefefe\">\r\n<p align=\"center\">TC e/ou RM</p>\r\n</td>\r\n<td style=\"width: 1.05932%; height: 273px;\" colspan=\"2\" bgcolor=\"#fefefe\">\r\n<p>A TC mostra bem as diversas patologias envolvendo o pesco&ccedil;o. Por&eacute;m, a RM acrescenta outras informa&ccedil;&otilde;es auxiliando nas diversas patologias.</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 10px;\">\r\n<td style=\"width: 11.4616%; height: 10px;\" bgcolor=\"#f1f1f1\" height=\"168\">\r\n<p align=\"center\">ENC&Eacute;FALO</p>\r\n</td>\r\n<td style=\"width: 50.6835%; height: 10px;\" bgcolor=\"#f1f1f1\">\r\n<p align=\"center\">RM</p>\r\n</td>\r\n<td style=\"width: 1.05932%; height: 10px;\" colspan=\"2\" bgcolor=\"#f1f1f1\">\r\n<p>Quando se tratar de trauma pode ser indicado a TC. Nas demais situa&ccedil;&otilde;es a RM mostra melhor a anatomia e &eacute; mais sens&iacute;vel &aacute;s diversas patologias, inclusive avalia&ccedil;&atilde;o funcional.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>',1,'2020-10-21 14:04:19','2020-10-24 17:00:25','2020-10-21-quando-indicar-tomografia-computadorizada-eou-ressonancia-magnetica',NULL,'Pixel','Em breve teremos à disposição um canal de comunicação entre a clínica, pacientes e amigos para esclarecimento de dúvidas. Pensando nisso, no post abaixo segue algumas orientações de qual exame ser realizado de acordo com cada diagnóstico. A comunicação é considerada fator indispensável em qualquer circunstância.'),(24,'ACOMPANHAMENTO OBSTÉTRICO','<p>A gravidez &eacute; uma fase muito delicada e especial para a mulher. O acompanhamento obst&eacute;trico mais conhecido como pr&eacute;-natal, tem o objetivo de avaliar a sa&uacute;de da mulher, conhecer seu hist&oacute;rico m&eacute;dico e prever poss&iacute;veis complica&ccedil;&otilde;es que possam acontecer durante a gesta&ccedil;&atilde;o, acompanhar a evolu&ccedil;&atilde;o do bebe, fazer diagn&oacute;sticos precoces de malforma&ccedil;&otilde;es fetais ou doen&ccedil;as cong&ecirc;nitas no beb&ecirc;. A ultrassonografia obst&eacute;trica &eacute; um procedimento utilizado para o acompanhamento da gesta&ccedil;&atilde;o. Este exame pode estabelecer a presen&ccedil;a de um embri&atilde;o/feto, estimar a idade da gravidez, diagnosticar anormalidades cong&ecirc;nitas do feto, avaliar a posi&ccedil;&atilde;o do feto e a posi&ccedil;&atilde;o da placenta, determinar se h&aacute; gravidezes m&uacute;ltiplas, definir a quantidade de l&iacute;quido amni&oacute;tico ao redor do beb&ecirc;, verificar se h&aacute; abertura ou encurtamento do colo do &uacute;tero, avaliar o crescimento e o bem-estar fetal. A ultrassonografia usa ondas sonoras para produzir imagens, bem como do &uacute;tero e dos ov&aacute;rios da m&atilde;e. Ele n&atilde;o usa radia&ccedil;&atilde;o ionizante, n&atilde;o tem efeitos prejudiciais e &eacute; o m&eacute;todo mais utilizado para monitorar o per&iacute;odo de gravidez e os beb&ecirc;s em gesta&ccedil;&atilde;o. Como as imagens de ultrassom s&atilde;o capturadas em tempo real, elas podem mostrar a estrutura e o movimento dos &oacute;rg&atilde;os internos do corpo, bem como o fluxo de sangue pelos vasos sangu&iacute;neos. A ultrassonografia &eacute; realizada com o uso de um pequeno transdutor (sonda) e um gel pr&oacute;prio, que s&atilde;o colocados diretamente sobre a pele. Ondas sonoras de alta frequ&ecirc;ncia s&atilde;o transmitidas da sonda atrav&eacute;s do gel para o corpo. O transdutor coleta os sons que se recuperam e um computador usa essas ondas sonoras para criar uma imagem. A ultrassonografia &eacute; extremamente segura e recomendada para todas mulheres gr&aacute;vidas ou com suspeita de gravidez. O exame &eacute; requerido pelo m&eacute;dico ginecologista e deve ser realizado com um especialista. A Pixel Diagn&oacute;stico por Imagem oferece o maior conforto com equipamentos de alta tecnologia e imagem de &oacute;tima resolu&ccedil;&atilde;o de ultrassonografia. Agende seu hor&aacute;rio (35) 3722-1617 ou pelo whatsapp (35)99835-7697.</p>',1,'2020-10-21 14:08:03','2020-10-21 14:08:03','2020-10-21-acompanhamento-obstetrico',NULL,'Pixel','A gravidez é uma fase muito delicada e especial para a mulher. O acompanhamento obstétrico mais conhecido como pré-natal, tem o objetivo de avaliar a saúde da mulher, conhecer seu histórico médico e prever possíveis complicações que possam acontecer durante a gestação, acompanhar a evolução do bebe, fazer diagnósticos precoces de malformações fetais ou doenças congênitas no bebê. A ultrassonografia obstétrica é um procedimento utilizado para o acompanhamento da gestação.'),(25,'DOUTOR O QUE EU FAÇO?','<p>A Coluna Dr. Responde &eacute; um canal onde o p&uacute;blico poder&aacute; fazer perguntas voltadas a &aacute;rea de diagn&oacute;stico por imagem e sa&uacute;de. Responderemos as perguntas mais pertinentes semanalmente. Nosso intuito &eacute; esclarecer d&uacute;vidas e quebrar alguns mitos sobre exames como resson&acirc;ncia magn&eacute;tica, ultrassonografia entre outros. Fique ligado na pr&oacute;xima segunda-feira, a coluna j&aacute; estar&aacute; no ar! Al&eacute;m da coluna disponibilizamos tamb&eacute;m artigos no blog com conte&uacute;dos referentes a nossa &aacute;rea, como por exemplo qual o melhor exame &agrave; ser realizado em determinado diagn&oacute;stico. Abaixo segue mais alguns diagn&oacute;sticos e os exames mais pertinentes.</p>\r\n<table class=\"table table-striped\" class=\"table table-striped\" style=\"border-collapse: collapse; width: 100%; height: 682px;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 119px;\">\r\n<td style=\"width: 31.6739%; height: 119px;\" width=\"124\">\r\n<p>PESCO&Ccedil;O</p>\r\n</td>\r\n<td style=\"width: 31.8842%; height: 119px;\" width=\"109\">\r\n<p>TC e/ou RM</p>\r\n</td>\r\n<td style=\"width: 31.9894%; height: 119px;\" width=\"254\">\r\n<p>A TC mostra bem as diversas patologias envolvendo o pesco&ccedil;o. Por&eacute;m, a RM acrescenta outras informa&ccedil;&otilde;es auxiliando nas diversas patologias.</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 119px;\">\r\n<td style=\"width: 31.6739%; height: 119px;\" width=\"124\">\r\n<p>SISTEMA CAROT&Iacute;DEO-VERTEBRAL</p>\r\n</td>\r\n<td style=\"width: 31.8842%; height: 119px;\" width=\"109\">\r\n<p>ANGIO-RESSON&Acirc;NCIA MAGN&Eacute;TICA</p>\r\n</td>\r\n<td style=\"width: 31.9894%; height: 119px;\" width=\"254\">\r\n<p>Por se tratar de exame sem invas&atilde;o e imagens dessas estruturas vasculares de boa qualidade. Boa para mostar estenose destes vasos.</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 97px;\">\r\n<td style=\"width: 31.6739%; height: 97px;\" width=\"124\">\r\n<p>ABDOMEN SUPERIOR E PELVE</p>\r\n</td>\r\n<td style=\"width: 31.8842%; height: 97px;\" width=\"109\">\r\n<p>TC e/ou RM</p>\r\n</td>\r\n<td style=\"width: 31.9894%; height: 97px;\" width=\"254\">\r\n<p>Os dois m&eacute;todos s&atilde;o eficientes; dependendo da patologia a ser avaliada, &eacute; melhor um m&eacute;todo ou outro.</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 141px;\">\r\n<td style=\"width: 31.6739%; height: 141px;\" width=\"124\">\r\n<p>SISTEMA M&Uacute;SCULO-ESQUEL&Eacute;TICO</p>\r\n</td>\r\n<td style=\"width: 31.8842%; height: 141px;\" width=\"109\">\r\n<p>RM</p>\r\n</td>\r\n<td style=\"width: 31.9894%; height: 141px;\" width=\"254\">\r\n<p>Junto com o estudo do enc&eacute;falo e coluna o sistema m&uacute;sculo-esquel&eacute;tico &eacute; onde a RM tem sua mais eficiente aplica&ccedil;&atilde;o. Praticamente todas as articula&ccedil;&otilde;es s&atilde;o estudadas pela RM.</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 185px;\">\r\n<td style=\"width: 31.6739%; height: 185px;\" width=\"124\">\r\n<p>COLUNA VERTEBRAL</p>\r\n</td>\r\n<td style=\"width: 31.8842%; height: 185px;\" width=\"109\">\r\n<p>RM</p>\r\n</td>\r\n<td style=\"width: 31.9894%; height: 185px;\" width=\"254\">\r\n<p>Os cortes multiplanares faz da RM o m&eacute;todo ideal para o estudo da coluna vertebral. Na suspeita de met&aacute;stases, &eacute; eficiente como a cintilografia. H&eacute;rnia discal &eacute; bem evidenciada na RM, bem como patologias da medula e comprometimento extra-medular.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 31.6739%;\" width=\"124\">\r\n<p>T&Oacute;RAX</p>\r\n</td>\r\n<td style=\"width: 31.8842%;\" width=\"109\">\r\n<p>TC</p>\r\n</td>\r\n<td style=\"width: 31.9894%;\" width=\"254\">\r\n<p>A TC ainda &eacute; mais eficiente no estudo do t&oacute;rax, principalmente na avalia&ccedil;&atilde;o pulmonar.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>',1,'2020-10-21 14:15:54','2020-10-24 17:12:26','2020-10-21-doutor-o-que-eu-faco',NULL,'Pixel','A Coluna Dr. Responde é um canal onde o público poderá fazer perguntas voltadas a área de diagnóstico por imagem e saúde. Responderemos as perguntas mais pertinentes semanalmente. Nosso intuito é esclarecer dúvidas e quebrar alguns mitos sobre exames como ressonância magnética, ultrassonografia entre outros.'),(26,'DIA NACIONAL DE CONSCIENTIZAÇÃO SOBRE A ESCLEROSE MÚLTIPLA','<p>Resson&acirc;ncia Magn&eacute;tica (RM) &eacute; um exame de diagn&oacute;stico por imagens que retrata as imagens em alta defini&ccedil;&atilde;o dos &oacute;rg&atilde;os e tecidos do corpo. Atrav&eacute;s desse exame, pode-se realizar uma pesquisa e an&aacute;lise de doen&ccedil;as neurologias, ortop&eacute;dicas, abdominais, cervicais, card&iacute;acas, entre elas, a esclerose m&uacute;ltipla (EM).<br /><br />Dia 30 de agosto &eacute; o &ldquo;Dia Nacional de Conscientiza&ccedil;&atilde;o sobre a Esclerose M&uacute;ltipla&rdquo;, vamos entender um pouco mais sobre essa doen&ccedil;a: A esclerose m&uacute;ltipla &eacute; uma doen&ccedil;a autoimune que afeta o c&eacute;rebro, nervos &oacute;pticos e a medula espinhal (sistema nervoso central). Isso acontece porque o sistema imunol&oacute;gico do corpo confunde c&eacute;lulas saud&aacute;veis com as \"intrusas\" e as ataca, provocando les&otilde;es.<br /><br />As principais manifesta&ccedil;&otilde;es t&iacute;picas incluem: dem&ecirc;ncia, movimentos descoordenados, fraqueza e perda sensorial e nas crian&ccedil;as, perda das fun&ccedil;&otilde;es j&aacute; adquiridas.<br />A fase inicial da EM &eacute; bastante sutil. Os sintomas s&atilde;o transit&oacute;rios, podem ocorrer a qualquer momento e duram aproximadamente uma semana.<br /><br />A EM se caracteriza por ser uma doen&ccedil;a potencialmente debilitante. Essa doen&ccedil;a tem sido foco de muitos estudos no mundo todo, o que tem possibilitado uma constante e significativa evolu&ccedil;&atilde;o na qualidade de vida dos pacientes. Alguns cientistas teorizam que a esclerose m&uacute;ltipla se desenvolve em pessoas que nascem com uma predisposi&ccedil;&atilde;o gen&eacute;tica que, ao ser exposta a algum agente ambiental, desencadeia uma resposta autoimune.<br /><br />A Imaginologia tem um papel muito importante para o paciente, n&atilde;o somente no diagn&oacute;stico inicial, mas tamb&eacute;m como monitoramento de sua terapia. A inten&ccedil;&atilde;o &eacute; que o diagn&oacute;stico por imagem auxiliasse na detec&ccedil;&atilde;o do subgrupo de condi&ccedil;&otilde;es trat&aacute;veis.<br />O hist&oacute;rico cl&iacute;nico e o suporte de exames subsidi&aacute;rios laboratoriais e de imagem s&atilde;o meios que levam a equipe m&eacute;dica a detectar a doen&ccedil;a.<br /><br />Uma vez confirmado o diagn&oacute;stico, o tratamento tem dois objetivos principais abreviar a fase aguda e tentar aumentar o intervalo entre um surto e outro. Resumindo, o tratamento ajuda a espa&ccedil;ar os epis&oacute;dios de recorr&ecirc;ncia e tamb&eacute;m os impactos negativos que a doen&ccedil;a provoca na vida do portador de EM.<br /><br />Atrav&eacute;s da RM pode-se demonstrar as placas de EM como &aacute;reas arredondadas e ovaladas hiperintensas nas imagens. A medula, sendo tamb&eacute;m comprometida, provoca sintomas como perda de sensibilidade espor&aacute;dica, fraqueza esp&aacute;stica e disfun&ccedil;&otilde;es &ldquo;no andar&rdquo; e tamb&eacute;m no sistema urin&aacute;rio.<br /><br />&nbsp;A EM &eacute; caracterizada por m&uacute;ltiplos epis&oacute;dios cl&iacute;nicos ao longo do tempo. As mulheres s&atilde;o afetadas cerca de cinco vezes mais frequentes que os homens, com um pico de instala&ccedil;&atilde;o na 2&deg; e 3&deg; d&eacute;cadas.<br /><br />Para encerrar o assunto, ressalta-se que as experi&ecirc;ncias cl&iacute;nicas indicam que a RM pode confirmar o diagn&oacute;stico da EM ou mudar sua probabilidade diagn&oacute;stica.<br />O cuidado com a sa&uacute;de e a preven&ccedil;&atilde;o &eacute; a melhor escolha para voc&ecirc; e sua fam&iacute;lia. Navegue pelo blog da Pixel para mais dicas de sa&uacute;de.</p>',1,'2020-10-21 14:19:36','2020-10-21 14:19:36','2020-10-21-dia-nacional-de-conscientizacao-sobre-a-esclerose-multipla',NULL,'Pixel','Ressonância Magnética (RM) é um exame de diagnóstico por imagens que retrata as imagens em alta definição dos órgãos e tecidos do corpo.'),(27,'ANGIORRESSONÂNCIA MAGNÉTICA PREVINE A MORTE POR ANEURISMA','<p>&Eacute; cada vez mais comum a indica&ccedil;&atilde;o de resson&acirc;ncia magn&eacute;tica com a finalidade preventiva. Em muitos casos, s&atilde;o encontrados pontos de dilata&ccedil;&atilde;o nas paredes das art&eacute;rias, o que pode levar &agrave; sua ruptura &ndash; o chamado aneurisma. &ldquo;Como o diagn&oacute;stico da complica&ccedil;&atilde;o do aneurisma cerebral &eacute; muitas vezes fatal, o melhor m&eacute;todo dispon&iacute;vel para a sua detec&ccedil;&atilde;o precoce &eacute; a Angioresson&acirc;ncia magn&eacute;tica. Trata-se de um exame n&atilde;o-invasivo, indolor e capaz de demonstrar aneurisma de pequenas dimens&otilde;es, o que ajuda muito no tratamento do paciente&rdquo;, diz o m&eacute;dico radiologista F&aacute;bio Eduardo Fernandes da Silva, da URP Diagn&oacute;sticos M&eacute;dicos, de S&atilde;o Paulo.&nbsp;<br /><br /><br />O aneurisma geralmente ocorre em adultos na faixa dos 40 anos. Apensar de nem sempre o paciente apresentar os sintomas, a cl&aacute;ssica hist&oacute;ria cl&iacute;nica consiste em dor de cabe&ccedil;a s&uacute;bita durante esfor&ccedil;o f&iacute;sico, podendo levar &agrave; perda de consci&ecirc;ncia. Pessoas que fumam ou que t&ecirc;m parentes de primeiro grau que j&aacute; sofreram de aneurismas s&atilde;o fortes candidatos a apresentar a doen&ccedil;a. Os hipertensos &ndash; e ainda hipertensos fumantes &ndash; correm mais riscos ainda de ter sangramentos do aneurisma. Diante de uma hist&oacute;ria sugestiva ou suspeita cl&iacute;nica, o paciente deve imediatamente procurar seu m&eacute;dico e investigar a possibilidade de ter tido uma hemorragia decorrente de ruptura do aneurisma.&nbsp;<br /><br />&ldquo;Os aneurismas podem ser cong&ecirc;nitos ou adquiridos durante a vida. Os de nascen&ccedil;a s&atilde;o maiores e, na maioria das vezes, s&atilde;o diagnosticados no momento do seu rompimento, resultando em evento catastr&oacute;fico que pode levar &agrave; morte ou causar graves sequelas neurol&oacute;gicas. Est&aacute; entre as causas mais comuns de morte s&uacute;bita em adultos e jovens&rdquo;, diz Silva. O radiologista diz que a resson&acirc;ncia magn&eacute;tica tamb&eacute;m tem sido empregada em hospitais de ponta para diagnosticar, localizar e medir a extens&atilde;o de les&otilde;es que podem levar a um acidente vascular cerebral (AVC), mais conhecido como &ldquo;derrame&rdquo;. Pacientes que chegam ao hospital com queixas neurol&oacute;gicas recentes, de poucas horas, podem receber tratamento em car&aacute;ter de urg&ecirc;ncia, a fim de reduzir as dimens&otilde;es da &aacute;rea acometida pelo AVC e ainda reduzir sequelas&rdquo;, conclui Silva.&nbsp;<br /><br />O cuidado com o corpo e a sa&uacute;de deve ser prioridade na vida de cada um de n&oacute;s.&nbsp;<br />O compromisso da cl&iacute;nica Pixel &eacute; cuidar de voc&ecirc;!</p>',1,'2020-10-21 14:20:49','2020-10-21 14:20:49','2020-10-21-angiorressonancia-magnetica-previne-a-morte-por-aneurisma',NULL,'Pixel','É cada vez mais comum a indicação de ressonância magnética com a finalidade preventiva. Em muitos casos, são encontrados pontos de dilatação nas paredes das artérias, o que pode levar à sua ruptura – o chamado aneurisma.'),(28,'DENSITOMETRIA ÓSSEA REALIZADA PELO MÉTODO DE TOMOGRAFIA COMPUTADORIZADA QUATITATIVA','<p>O que &eacute; Tomografia computadorizada quantitativa (TCQ)? &Eacute; um m&eacute;todo realizado atrav&eacute;s de medidas, feitas em cortes axiais computadorizados, mais precisamente atrav&eacute;s dos corpos vertebrais e de um dispositivo chamado &ldquo;Fanton&rdquo;. Os cortes s&atilde;o selecionados, eliminando aqueles em que altera&ccedil;&otilde;es dos corpos vertebrais podem elevar ou diminuir sua densidade, com isto tornando o m&eacute;todo bastante preciso. Ap&oacute;s esta sele&ccedil;&atilde;o, s&atilde;o realizadas as diversas medidas de densidade que s&atilde;o fornecidas a um programa espec&iacute;fico de computador, que ap&oacute;s processar todos os dados emite o resultado. Temos observado que alguns profissionais apresentam d&uacute;vidas a respeito deste m&eacute;todo. Este artigo tem a inten&ccedil;&atilde;o de esclarecer estas d&uacute;vidas.</p>\r\n<p>1) O exame realizado por TCQ, emite maior quantidade de Raio X que o m&eacute;todo de Densitometria por Raio X de dupla energia (DEXA), por&eacute;m esta maior quantidade n&atilde;o alcan&ccedil;a n&iacute;veis lesivos ao paciente. A t&iacute;tulo de compara&ccedil;&atilde;o, exemplificamos a seguir algumas situa&ccedil;&otilde;es com suas quantidades de Raio X emitidas.</p>\r\n<p>DEXA.................................................................................1 uSV</p>\r\n<p>TCQ...................................................................................30 uSV</p>\r\n<p>RX em PA do t&oacute;rax............................................................50 uSV</p>\r\n<p>4 semanas numa altitude de 2.000 m ...............................50 uSV</p>\r\n<p>Travessia do Atl&acirc;ntico de avi&atilde;o ........................................80 uSV</p>\r\n<p>Cineangiocoronariografia .................................................10.000 uSV</p>\r\n<p>2) Qual m&eacute;todo &eacute; mais preciso? Pelo fato das medidas no TCQ ser atrav&eacute;s de cortes tomogr&aacute;ficos selecionados, desprezando os corpos vertebrais que apresentam algum tipo de problema, as medidas calculadas s&atilde;o bastante precisas. Outros m&eacute;todos, como n&atilde;o t&ecirc;m a possibilidade de selecionar a estrutura &oacute;ssea a ser medida e como a densidade &oacute;ssea aferida n&atilde;o separa osso esponjoso (onde ocorre mais precocemente as altera&ccedil;&otilde;es de desmineraliza&ccedil;&atilde;o &oacute;ssea) do osso compacto, o resultado se torna menos preciso.</p>\r\n<p>3) O TCQ realiza somente exame de um segmento? Sim, o TCQ examina somente a coluna dorso-lombar. Isto se deve ao princ&iacute;pio de que este exame se presta para o diagn&oacute;stico de osteoporose. Sendo a osteoporose uma doen&ccedil;a sist&ecirc;mica, atinge todos os ossos. Quando realizamos a medida de densidade mineral &oacute;ssea (DMO) da coluna e devido a maior precis&atilde;o do TCQ, estamos consequentemente avaliando todas as estruturas &oacute;sseas. Al&eacute;m disso, no resultado deste exame, o valor encontrado da DMO &eacute; mostrado em um gr&aacute;fico, que facilmente podemos avaliar se o valor encontrado est&aacute; dentro da normalidade, ou n&atilde;o, e se o grau da altera&ccedil;&atilde;o est&aacute; dentro de uma faixa de risco maior ou menor para que ocorra uma fratura, naqueles locais sabidamente mais frequentes para este acontecimento ou seja, v&eacute;rtebras tor&aacute;cicas e lombares, f&ecirc;mur proximal, &uacute;mero proximal e r&aacute;dio distal. A osteoporose &eacute; conhecida como um dos maiores problemas de sa&uacute;de entre os idosos, especialmente em mulheres ap&oacute;s o per&iacute;odo de menopausa. Por vezes &eacute; assintom&aacute;tica at&eacute; que ocorra alguma fratura. A densitometria &oacute;ssea &eacute; o exame ideal para o diagn&oacute;stico de osteoporose. O cuidado com a sa&uacute;de e a preven&ccedil;&atilde;o &eacute; fundamental para uma vida saud&aacute;vel. A cl&iacute;nica Pixel se preocupa com informa&ccedil;&otilde;es que possam contribuir para sua conscientiza&ccedil;&atilde;o.</p>',1,'2020-10-21 14:25:24','2020-10-21 14:25:24','2020-10-21-densitometria-ossea-realizada-pelo-metodo-de-tomografia-computadorizada-quatitativa',NULL,'Pixel','O que é Tomografia computadorizada quantitativa (TCQ)? É um método realizado através de medidas, feitas em cortes axiais computadorizados, mais precisamente através dos corpos vertebrais e de um dispositivo chamado “Fanton”. Os cortes são selecionados, eliminando aqueles em que alterações dos corpos vertebrais podem elevar ou diminuir sua densidade, com isto tornando o método bastante preciso.'),(29,'DIA NACIONAL DE CONSCIENTIZAÇÃO DA PESSOA COM ALZHEIMER','<p>Voc&ecirc; sabia que dia 21 de setembro foi institu&iacute;do pela Associa&ccedil;&atilde;o Internacional do Alzheimer (ADI) , como o Dia Mundial da Doen&ccedil;a de Alzheimer? Vamos conhecer um pouco mais sobre essa doen&ccedil;a e entender a importancia de nos sensibilizarmos sobre a preven&ccedil;&atilde;o, o diagn&oacute;stico precoce, o cuidado ofertado e principalmente, o apoio aos familiares e cuidadores de pessoas que vivem com a doen&ccedil;a de Alzheimer.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Caracterizada como uma doen&ccedil;a degenerativa, progressiva e irrevers&iacute;vel, a doen&ccedil;a de Alzheimer n&atilde;o tem cura, mas pode ser tratada a fim de amenizar os sintomas. O Alzheimer afeta a mem&oacute;ria, a fala e a no&ccedil;&atilde;o de espa&ccedil;o e tempo do paciente, podendo provocar apatia, del&iacute;rios e, em alguns casos, comportamento agressivo.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Essa doen&ccedil;a geralmente afeta pessoas com mais de 65 anos, mas existem pacientes com in&iacute;cio por volta dos 50 anos. As causas da doen&ccedil;a n&atilde;o s&atilde;o totalmente conhecidas e alguns estudos citam fatores importantes para o desenvolvimento da doen&ccedil;a.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Afinal, como podemos perceber os primeiros sintomas?!&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Um dos primeiros sintomas &eacute; a perda de mem&oacute;ria para fatos recentes. Depois, ocorre a desorienta&ccedil;&atilde;o quanto a lugares e datas e mudan&ccedil;as de humor e comportamento &ndash; irritabilidade e agressividade. Na fase avan&ccedil;ada, a pessoa pode ter alucina&ccedil;&otilde;es, dificuldade na fala e na alimenta&ccedil;&atilde;o. Al&eacute;m disso, pode n&atilde;o reconhecer mais os familiares e tornar-se totalmente dependente.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;O Alzheimer afeta mais de 1,2 milh&atilde;o de brasileiros! Agora podemos entender sobre a import&acirc;ncia de nos conscientizarmos sobre essa doen&ccedil;a. Quando diagnosticado precocemente, o tratamento &eacute; fundamental para garantir uma melhor qualidade de vida ao paciente.&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;O diagn&oacute;stico &eacute; cl&iacute;nico e feito atrav&eacute;s de entrevistas, testes cognitivos e tamb&eacute;m por meio de exames laboratoriais e de imagem.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;A Tomografia Computadorizada e a Resson&acirc;ncia Magn&eacute;tica do cr&acirc;nio s&atilde;o exames que devem ser realizados para excluir a possibilidade de outras doen&ccedil;as. Sinais de atrofia cerebral podem estar ausentes em indiv&iacute;duos com algumas dem&ecirc;ncias, especialmente nas fases iniciais do Alzheimer.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Para finalizar... &eacute; importante nos conscientizarmos de que cuidar de uma pessoa com a Doen&ccedil;a de Alzheimer, &eacute; desafio para qualquer fam&iacute;lia, visto que as mudan&ccedil;as s&atilde;o significativas e precisam ser adequadas na rotina familiar. Com o avan&ccedil;o da doen&ccedil;a, pacientes com Alzheimer precisam de cuidados 24 horas e de uma rotina especial, o suporte m&eacute;dico e o carinho a aten&ccedil;&atilde;o dos familiares tamb&eacute;m &eacute; essencial durante o tratamento.</p>',1,'2020-10-21 14:30:48','2020-10-21 14:30:48','2020-10-21-dia-nacional-de-conscientizacao-da-pessoa-com-alzheimer',NULL,'Pixel','Você sabia que dia 21 de setembro foi instituído pela Associação Internacional do Alzheimer (ADI) , como o Dia Mundial da Doença de Alzheimer? Vamos conhecer um pouco mais sobre essa doença e entender a importancia de nos sensibilizarmos sobre a prevenção, o diagnóstico precoce, o cuidado ofertado e principalmente, o apoio aos familiares e cuidadores de pessoas que vivem com a doença de Alzheimer.'),(30,'RESSONÂNCIA MAGNÉTICA DA COLUNA VERTEBRAL','<p>Voc&ecirc; sabia que a Resson&acirc;ncia Magn&eacute;tica (RM) &eacute; um exame que produz imagens para fins de diagn&oacute;sticos m&eacute;dicos e que a m&aacute;quina utiliza um campo magn&eacute;tico e ondas de r&aacute;dio para criar imagens detalhadas dos &oacute;rg&atilde;os e tecidos do corpo? E melhor, esse exame &eacute; uma forma n&atilde;o invasiva do m&eacute;dico avaliar &oacute;rg&atilde;os, tecidos.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Que tal explicarmos um pouco mais sobre a RM da Coluna Vertebral? Afinal, grande parte da popula&ccedil;&atilde;o j&aacute; teve, sofre com dores ou vir&aacute; a ter algum &ldquo;problema&rdquo; de coluna ao longo da vida. Situa&ccedil;&otilde;es referentes a problemas com a coluna j&aacute; s&atilde;o esperados, pois vivemos e convivemos em uma sociedade sedent&aacute;ria, onde pessoas n&atilde;o se atentam &agrave; postura inadequada o que favorece o desenvolvimento de algumas doen&ccedil;as e dores nas costas.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Voc&ecirc; pode estar pensando: posso realizar atividades f&iacute;sicas (frequentar academias, praticar esportes...) e assim estarei livre de dores! N&atilde;o &eacute; bem assim, pois atividades f&iacute;sicas realizadas de forma incorreta, sem orienta&ccedil;&atilde;o de um especialista ou utilizando-se cargas excessivas e exerc&iacute;cios que n&atilde;o condizem &agrave;s condi&ccedil;&otilde;es do seu corpo, podem desencadear v&aacute;rios problemas.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dores na coluna podem sinalizar diversas patologias e a principal a&ccedil;&atilde;o que voc&ecirc; deve ter &eacute; procurar a opini&atilde;o de um m&eacute;dico especialista para o tratamento adequado.<br />&nbsp;Em v&aacute;rios casos o exame de RM &eacute; superior &agrave; Tomografia (TC). Para altera&ccedil;&otilde;es do corpo vertebral, como met&aacute;stases, a RM &eacute; o m&eacute;todo mais indicado. Atrav&eacute;s de t&eacute;cnicas especiais, a gordura existente no corpo vertebral &eacute; suprimida, salientando-se as les&otilde;es tumorais prim&aacute;ria ou secund&aacute;ria bem como processos inflamat&oacute;rios.&nbsp;<br />A h&eacute;rnia discal &eacute; um adas altera&ccedil;&otilde;es mais frequentes da coluna lombossacra e cervical. O estudo desta altera&ccedil;&atilde;o, bem como a avalia&ccedil;&atilde;o do como corpo vertebral, canal raquiano, ra&iacute;zes nervosas, saco dural e forames de conjuga&ccedil;&atilde;o, devido &agrave; sua capacidade multiplanar e &agrave;s t&eacute;cnicas da supress&atilde;o de l&iacute;quido e gordura, a RM &eacute; o exame mais indicado.&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;No controle p&oacute;s-operat&oacute;rio de h&eacute;rnia discal, para diferenciar o que &eacute; fibrose de h&eacute;rnia recidivada ou residual a RM &eacute; mais eficiente. Por&eacute;m, para a avalia&ccedil;&atilde;o desta situa&ccedil;&atilde;o &eacute; necess&aacute;rio o uso do contraste endovenoso, o que neste caso a resson&acirc;ncia tamb&eacute;m leva vantagem, porque o contraste usado para este exame &eacute; praticamente isento de rea&ccedil;&otilde;es al&eacute;rgicas.&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;As altera&ccedil;&otilde;es do canal raquiano, devido a processo cong&ecirc;nito ou adquirido &eacute; bem avaliado pela RM, como estenose e presen&ccedil;a de processos expansivos intracanal raquiano ou que invadem o mesmo.&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&Eacute; poss&iacute;vel tamb&eacute;m evidenciarmos as altera&ccedil;&otilde;es da osteomielite vertebral em est&aacute;gios bem mais precoce. T&eacute;cnicas especiais tornam as ra&iacute;zes nervosas mais evidentes na RM, o que &eacute; importante no estudo das aracnoidites.&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;A RM &eacute; o m&eacute;todo de imagem mais importante no estudo da medula espinhal. A conscientiza&ccedil;&atilde;o para h&aacute;bitos saud&aacute;veis garante a qualidade da sua sa&uacute;de.</p>',1,'2020-10-21 14:31:59','2020-10-21 14:31:59','2020-10-21-ressonancia-magnetica-da-coluna-vertebral',NULL,'Pixel','Você sabia que a Ressonância Magnética (RM) é um exame que produz imagens para fins de diagnósticos médicos e que a máquina utiliza um campo magnético e ondas de rádio para criar imagens detalhadas dos órgãos e tecidos do corpo? E melhor, esse exame é uma forma não invasiva do médico avaliar órgãos, tecidos.'),(31,'COMBATE A HIPERTENSÃO','<p>Voc&ecirc; sabia que o dia 26 de Abril &eacute; &ldquo;marcado&rdquo; anualmente como o Dia Nacional de Preven&ccedil;&atilde;o e combate &agrave; hipertens&atilde;o? Por&eacute;m, n&atilde;o &eacute; somente nesta data que as pessoas e/ou empresas devem realizar a&ccedil;&otilde;es de conscientiza&ccedil;&atilde;o sobre essa doen&ccedil;a, afinal, no Brasil quase 25% da popula&ccedil;&atilde;o tem hipertens&atilde;o. Vamos entender um pouco mais sobre esse assunto? De acordo com pesquisas realizadas pelo Minist&eacute;rio da Sa&uacute;de, realmente essa doen&ccedil;a atinge 25% da popula&ccedil;&atilde;o brasileira e dessa forma, &eacute; muito importante as pessoas terem cuidados b&aacute;sicos para prevenir a hipertens&atilde;o. A hipertens&atilde;o &eacute; caracterizada quando a press&atilde;o arterial est&aacute; acima dos 120 de m&aacute;xima e 80 de m&iacute;nima, ou como estamos acostumados, o famoso &ldquo;12 por 8&rdquo;. Ela &eacute; considerada por alguns m&eacute;dicos, como uma doen&ccedil;a silenciosa, que s&oacute; se manifesta em um grau avan&ccedil;ado, causando assim problemas muito maiores. &Eacute; importante saber que pessoas hipertensas apresentam um risco elevado de sofrerem infartos e desenvolverem problemas cardiovasculares, por isso que existem as a&ccedil;&otilde;es de combate &agrave; hipertens&atilde;o. Sabemos que a hipertens&atilde;o n&atilde;o tem cura, mas diversas medidas tomadas pelo indiv&iacute;duo s&atilde;o capazes de amenizar as consequ&ecirc;ncias dessa doen&ccedil;a, um exemplo &eacute; manter uma alimenta&ccedil;&atilde;o balanceada. O primeiro passo e/ou pr&aacute;tica indicada pelos m&eacute;dicos &eacute; reduzir conscientemente o uso do sal nas refei&ccedil;&otilde;es, visto que ele &eacute; o fator predominante na eleva&ccedil;&atilde;o da press&atilde;o sangu&iacute;nea. Outra atitude ben&eacute;fica ao paciente hipertenso, &eacute; a pr&aacute;tica de atividades f&iacute;sicas. Existem programas de combate ao sedentarismo que s&atilde;o excelentes aliados na preven&ccedil;&atilde;o &agrave; hipertens&atilde;o. Quando mantemos o nosso corpo em movimento, automaticamente estamos estimulando o bom funcionamento das veias e art&eacute;rias, evitando que as placas de gorduras se instalem e dificultem a passagem do sangue (elevando assim a press&atilde;o). Resumindo, a press&atilde;o alta faz com que o cora&ccedil;&atilde;o tenha que exercer um esfor&ccedil;o maior do que o normal para fazer com que o sangue seja distribu&iacute;do corretamente pelo corpo. &Eacute; uma doen&ccedil;a herdada dos pais em 90% dos casos, mas h&aacute; v&aacute;rios fatores que influenciam nos n&iacute;veis de press&atilde;o arterial, &ndash; como j&aacute; citamos &ndash; um exemplo s&atilde;o os h&aacute;bitos de vida do indiv&iacute;duo. O que espera-se, &eacute; que as pessoas se conscientizem da gravidade da doen&ccedil;a e dos danos que ela pode vir a causar. Buscar diagn&oacute;stico, orienta&ccedil;&otilde;es m&eacute;dicas e um tratamento cont&iacute;nuo &eacute; de suma import&acirc;ncia. Afinal, &eacute; estreitando os la&ccedil;os entre campanhas e parcerias com a popula&ccedil;&atilde;o que podemos ter riqu&iacute;ssimos instrumentos que possam melhorar ainda mais a qualidade de vida dos pacientes</p>',1,'2020-10-21 14:33:11','2020-10-21 14:33:11','2020-10-21-combate-a-hipertensao',NULL,'Pixel','Você sabia que o dia 26 de Abril é “marcado” anualmente como o Dia Nacional de Prevenção e combate à hipertensão? Porém, não é somente nesta data que as pessoas e/ou empresas devem realizar ações de conscientização sobre essa doença, afinal, no Brasil quase 25% da população tem hipertensão.'),(32,'COMPANHA PARA PREVENÇÃO DO CANCER DE PRÓSTATA','<p>Encerramos o &ldquo;outubro rosa&rdquo; e iniciamos o \"novembro azul\"... Muda-se a cor, mas a luta contra o C&acirc;ncer continua. Neste m&ecirc;s acontece um movimento mundial, a campanha do Novembro azul, que vem refor&ccedil;ar e alertar sobre a import&acirc;ncia da preven&ccedil;&atilde;o e do diagn&oacute;stico precoce do c&acirc;ncer de pr&oacute;stata (gl&acirc;ndula que faz parte do sistema genital masculino). Essa doen&ccedil;a &eacute; o segundo tipo de c&acirc;ncer mais comum entre os homens brasileiros. Por isso, &eacute; importante conhecer e discutir sobre esse assunto. N&atilde;o se deve aguardar o surgimento de sinais e sintomas para que haja a iniciativa de procurar um especialista. O ideal &eacute; que a partir dos 50 anos de idade, o homem inicie um acompanhamento anual realizando exames de sangue (PSA), toque retal e exames radiol&oacute;gicos, lembrando que um exame &eacute; complementar ao outro. Em casos de hist&oacute;rico familiar de 1&ordm; grau, &eacute; indicado que este acompanhamento se inicie aos 45 anos de idade. O c&acirc;ncer de pr&oacute;stata &eacute; considerado uma doen&ccedil;a da terceira idade e na maioria dos casos, cresce de forma lenta e apresenta poucos sinais. Em outros casos, pode crescer rapidamente, se espalhar para outros &oacute;rg&atilde;os e at&eacute; causar a morte. Pensando na gravidade e nos transtornos que essa doen&ccedil;a pode vir a causar, a Funda&ccedil;&atilde;o do C&acirc;ncer desenvolveu uma campanha especial para essa data &ndash; o NOVEMBRO AZUL, cujo principal objetivo &eacute; conscientizar os homens sobre os danos da doen&ccedil;a e alert&aacute;-los sobre os preconceitos que podem colocar em risco a pr&oacute;pria vida. Cuide-se! O melhor cuidado &eacute; a preven&ccedil;&atilde;o! Procure um m&eacute;dico e mantenha seus exames em dia.</p>',1,'2020-10-21 14:34:12','2020-10-21 14:34:12','2020-10-21-companha-para-prevencao-do-cancer-de-prostata',NULL,'Pixel','Encerramos o “outubro rosa” e iniciamos o &quot;novembro azul&quot;... Muda-se a cor, mas a luta contra o Câncer continua. Neste mês acontece um movimento mundial, a campanha do Novembro azul, que vem reforçar e alertar sobre a importância da prevenção e do diagnóstico precoce do câncer de próstata (glândula que faz parte do sistema genital masculino).'),(33,'TECNOLOGIA EM FAVOR DA SAÚDE','<p>Os avan&ccedil;os tecnol&oacute;gicos ocorridos nas &uacute;ltimas d&eacute;cadas possibilitaram uma mudan&ccedil;a no padr&atilde;o de vida de muitas pessoas. O advento da internet e telefonia celular contribu&iacute;ram para a dissemina&ccedil;&atilde;o de informa&ccedil;&otilde;es, assim como, a proximidade entre pessoas. As facilidades n&atilde;o param por a&iacute;! O celular, por exemplo, al&eacute;m de fazer liga&ccedil;&atilde;o tornou-se m&aacute;quina fotogr&aacute;fica, computador e banco port&aacute;til. Uma infinidade de aplicativos s&atilde;o criados a todo momento, sempre objetivando a praticidade, qualidade de vida e o ganho de tempo.</p>\r\n<p>Al&eacute;m disso, a tecnologia n&atilde;o contribui apenas para vida cotidiana. Ela auxilia de forma objetiva &aacute;reas como a sa&uacute;de. Muitos equipamentos que utilizamos quando vamos a um pronto socorro, sofreram dr&aacute;sticas modifica&ccedil;&otilde;es tecnol&oacute;gicas ao longo do tempo. Podemos citar, como exemplo, a radiologia. Mas, o que &eacute; radiologia?</p>\r\n<p>Radiologia estuda a aplica&ccedil;&atilde;o do raio x e radia&ccedil;&atilde;o no intuito de realizar diagn&oacute;sticos, ou ent&atilde;o, no tratamento de patologias. Suas aplica&ccedil;&otilde;es s&atilde;o diversas como: raio x, mamografia, ultrassonografia, tomografia computadorizada dentre outros exames. Neste sentido, a tecnologia aplicada a esta &aacute;rea da sa&uacute;de tem auxiliado no diagn&oacute;stico e preven&ccedil;&atilde;o&nbsp; de v&aacute;rias doen&ccedil;as. Muitas pesquisas tem sido realizadas com o objetivo de aprimorar os equipamentos e ferramentas usadas pela radiologia, gra&ccedil;as &agrave; parceria tecnologia/radiologia muitas vidas tem sido salvas.</p>\r\n<p>Vale frisar que a busca por solu&ccedil;&otilde;es tecnol&oacute;gicas voltadas para radiologia &eacute; uma constante realidade em institui&ccedil;&otilde;es de sa&uacute;de, &eacute; uma caminho sem volta. Assim, &eacute; importante uma constante qualifica&ccedil;&atilde;o de gestores e profissionais desta &aacute;rea. Pois, a atualiza&ccedil;&atilde;o e readequa&ccedil;&atilde;o das pr&aacute;ticas radiol&oacute;gicas s&atilde;o indispens&aacute;veis para a sa&uacute;de dos cidad&atilde;os.</p>\r\n<p>Pensar em tecnologia requer pensar em qualidade de vida, n&atilde;o apenas para satisfazer ou facilitar nosso cotidiano,&nbsp; mas tamb&eacute;m, contribuir para uma vida mais saud&aacute;vel que possibilite &aacute;reas como a radiologia progredir e beneficiar aqueles que necessitam de sua aplica&ccedil;&atilde;o.&nbsp;</p>',1,'2020-10-21 14:37:28','2020-10-21 14:37:28','2020-10-21-tecnologia-em-favor-da-saude',NULL,'Pixel','Os avanços tecnológicos ocorridos nas últimas décadas possibilitaram uma mudança no padrão de vida de muitas pessoas. O advento da internet e telefonia celular contribuíram para a disseminação de informações, assim como, a proximidade entre pessoas. As facilidades não param por aí!'),(34,'DOPPLER','<p>As famosas varizes s&atilde;o veias que se dilatam e ficam localizadas, principalmente, nos p&eacute;s e na perna. Embora algumas pessoas deem apenas aten&ccedil;&atilde;o a elas pela quest&atilde;o est&eacute;tica &eacute; importante tomar alguns cuidados. As varizes podem causar sensa&ccedil;&otilde;es desagrad&aacute;veis como: &middot; Dores; &middot; Sensa&ccedil;&atilde;o de queima&ccedil;&atilde;o; &middot; Forma&ccedil;&atilde;o de pequenos co&aacute;gulos. Buscar ajuda de um especialista pode ser a solu&ccedil;&atilde;o para evitar tais problemas. Mas voc&ecirc; consegue imaginar o que pode causar o aparecimento das varizes? Existem algumas causas dentre elas a gen&eacute;tica, proveniente de familiares de primeiro grau. Os horm&ocirc;nios presentes em alguns rem&eacute;dios tamb&eacute;m alteram os tubos sangu&iacute;neos desenvolvendo as varizes. Os quilinhos a mais (obesidade) atrapalham na circula&ccedil;&atilde;o e tamb&eacute;m pode ser outro fator que desencadeia as varizes. Geralmente, as mulheres sofrem mais com as varizes por quest&otilde;es hormonais. Gestantes tendem a desenvolver varizes, pois a presen&ccedil;a do beb&ecirc; no ventre pressiona as veias da pelve alterando assim, a circula&ccedil;&atilde;o. O sedentarismo tamb&eacute;m pode levar ao desenvolvimento de varizes, ent&atilde;o praticar algum tipo de atividade f&iacute;sica &eacute; fundamental. Mas e o tratamento das varizes? Muito se discute nos m&eacute;todos para se tratar as varizes. Dentre eles, o tratamento de Varizes com Espuminha. O uso deste tipo de tratamento obt&eacute;m-se bons resultados, e evita a cirurgia ou afastamento para tratamento. O Tratamento de Varizes com Espuminha &eacute; realizado na Cl&iacute;nica de Cirurgia Vascular Dr. Claudi Ferraz e traz &oacute;timos resultados. Ao se consultar com um Vascular, o especialista que cuida desta &aacute;rea, o mesmo far&aacute; uma avalia&ccedil;&atilde;o cl&iacute;nica. E, caso necess&aacute;rio, solicitar&aacute; exames espec&iacute;ficos como o Ultrassom Doppler para confirmar o diagn&oacute;stico e proceder com o melhor tratamento. Apenas um especialista pode orient&aacute;-lo quanto a diagn&oacute;stico, tratamento e medicamentos a serem utilizados, cuide-se. #varizes #doppler</p>',1,'2020-10-21 14:39:10','2020-10-21 14:39:10','2020-10-21-doppler',NULL,'Pixel','As famosas varizes são veias que se dilatam e ficam localizadas, principalmente, nos pés e na perna. Embora algumas pessoas deem apenas atenção a elas pela questão estética é importante tomar alguns cuidados. As varizes podem causar sensações desagradáveis como:'),(35,'TOMOGRAFIA ABDOMINAL: PARA QUE SERVE?','<p>Voc&ecirc; j&aacute; ouviu falar em tomografia computadorizada abdominal, mais conhecida simplesmente como tomografia abdominal?</p>\r\n<p>Na tomografia computadorizada abdominal &eacute; analisada a parte superior do abd&ocirc;men. Este exame &eacute; indicado, principalmente, nos casos de suspeita de tumores, apendicite, diverticulite e les&otilde;es no abd&ocirc;men. Al&eacute;m disso, pode ser realizado para o diagn&oacute;stico de patologias do f&iacute;gado, p&acirc;ncreas, ba&ccedil;o, intestino, c&oacute;lon, entre outros &oacute;rg&atilde;os.</p>\r\n<p>O exame &eacute; considerado um&nbsp;<a href=\"https://pixeldiagnostico.com.br/post/tecnologia-em-favor-da-saude\">grande avan&ccedil;o da medicina</a>, visto que possibilitou a identifica&ccedil;&atilde;o precoce de doen&ccedil;as como o c&acirc;ncer. Isso, porque a tomografia abdominal reconhece mudan&ccedil;as muito sutis no organismo.</p>\r\n<p>Nesse sentido, a tomografia &eacute; um dos exames mais importantes, considerando que pode fazer a diferen&ccedil;a no tratamento m&eacute;dico.</p>\r\n<h2>INDICA&Ccedil;&Otilde;ES DA TOMOGRAFIA ABDOMINAL</h2>\r\n<p>&Eacute; bem comum que seja solicitada pelos m&eacute;dicos quando os pacientes apresentam sintomas como dor abdominal, fadiga, emagrecimento, n&aacute;useas e v&ocirc;mitos, etc.</p>\r\n<p>Como comentamos, a tomografia do abd&ocirc;men pode ser realizada para o diagn&oacute;stico de diversas doen&ccedil;as. Dentre elas, destacam-se algumas patologias:</p>\r\n<ul>\r\n<li>Apendicite;</li>\r\n<li>Doen&ccedil;a de Crohn.</li>\r\n<li>Pancreatite;</li>\r\n<li>Colite ulcerosa;</li>\r\n<li>Pedra da ves&iacute;cula;</li>\r\n<li>Pedra nos rins;</li>\r\n<li>Pielonefrite;</li>\r\n<li>Cirrose;</li>\r\n<li>Cistos nos ov&aacute;rios;</li>\r\n<li>Tumores benignos ou malignos;</li>\r\n<li>Esprenomegalia;</li>\r\n<li>Entre outras.</li>\r\n</ul>\r\n<p>Quando h&aacute; a suspeita de um trauma no abd&ocirc;men, o m&eacute;dico procura hemorragias internas ou externas aos &oacute;rg&atilde;os, al&eacute;m de l&iacute;quidos.</p>\r\n<p>Nos casos em que h&aacute; a chance de ser apendicite, a tomografia abdominal pode ser uma alternativa a ultrassonografia.</p>\r\n<h2>COMO FUNCIONA A TOMOGRAFIA ABDOMINAL?</h2>\r\n<p>Verifica-se, com frequ&ecirc;ncia, que o exame &eacute; feito com o uso de contraste de iodo. Essa subst&acirc;ncia pode ser administrada via oral ou venosa e auxilia na visualiza&ccedil;&atilde;o dos &oacute;rg&atilde;os.</p>\r\n<p>O paciente precisa permanecer deitado e im&oacute;vel para a realiza&ccedil;&atilde;o da tomografia abdominal. Somente desta maneira, as imagens ser&atilde;o reproduzidas com qualidade.</p>\r\n<p>A tomografia abdominal ocorre por meio de radia&ccedil;&atilde;o ionizante que produz imagens do organismo.</p>\r\n<p>O exame se inicia com o deslocamento da mesa por meio de um arco. Este arco capta as imagens atrav&eacute;s da emiss&atilde;o da radia&ccedil;&atilde;o que atravessa o abd&ocirc;men em dire&ccedil;&atilde;o a um receptor.</p>\r\n<p>Assim, as imagens da tomografia abdominal, criadas a partir da radia&ccedil;&atilde;o emitida x radia&ccedil;&atilde;o recebida, s&atilde;o enviadas ao computador.</p>\r\n<p>A dura&ccedil;&atilde;o do exame pode variar entre 15 e 30 minutos.</p>\r\n<p>Essas imagens capturadas s&atilde;o analisadas por um m&eacute;dico radiologista para que seja poss&iacute;vel diagnosticar as condi&ccedil;&otilde;es normais e as patol&oacute;gicas. Com as imagens geradas pela radia&ccedil;&atilde;o, o m&eacute;dico consegue desenvolver um relat&oacute;rio do que foi observado.</p>\r\n<p>Se o radiologista n&atilde;o encontrar anormalidades, o exame &eacute; considerado como normal. Caso observe alguma altera&ccedil;&atilde;o, o m&eacute;dico ir&aacute; sinalizar no resultado.</p>\r\n<h4>FICOU COM ALGUMA D&Uacute;VIDA COM RELA&Ccedil;&Atilde;O A TOMOGRAFIA ABDOMINAL? CASO A RESPOSTA SEJA SIM, ENTRE EM&nbsp;<a href=\"https://api.whatsapp.com/send?phone=5535998357697&amp;text=ola\">CONTATO&nbsp;</a>CONOSCO. ESTAMOS &Agrave; DISPOSI&Ccedil;&Atilde;O PARA ESCLARECER TODOS OS SEUS QUESTIONAMENTOS.</h4>',1,'2020-10-21 14:45:11','2020-10-21 14:45:11','2020-10-21-tomografia-abdominal:-para-que-serve',NULL,'Pixel','Você já ouviu falar em tomografia computadorizada abdominal, mais conhecida simplesmente como tomografia abdominal?\r\n\r\nNa tomografia computadorizada abdominal é analisada a parte superior do abdômen. '),(36,'DIAGNÓSTICO POR IMAGEM: UM IMPORTANTE ALIADO DA SAÚDE','<p>As &aacute;reas da medicina v&ecirc;m passando por uma evolu&ccedil;&atilde;o constante. Para constatar essa informa&ccedil;&atilde;o, basta observarmos o avan&ccedil;o nos conhecimentos anat&ocirc;micos e na incorpora&ccedil;&atilde;o da tecnologia.</p>\r\n<p>Dentre as especialidades m&eacute;dicas, a&nbsp;<a href=\"https://pixeldiagnostico.com.br/post/evolucao-da-radiologia\">radiologia</a>&nbsp;&eacute; considerada como uma das que mais avan&ccedil;am.</p>\r\n<p>O fato se deve, principalmente, pelo desenvolvimento da&nbsp;<a href=\"https://pixeldiagnostico.com.br/post/tecnologia-em-favor-da-saude\">tecnologia</a>, que influenciou para o surgimento de diversos equipamentos e softwares para melhorar a assist&ecirc;ncia m&eacute;dica.</p>\r\n<p>Esse desenvolvimento tecnol&oacute;gico permitiu, por exemplo, a an&aacute;lise de vasos sangu&iacute;neos, ou at&eacute; mesmo da reconstru&ccedil;&atilde;o em 3D de estruturas.</p>\r\n<p>Podemos afirmar ainda, que com a evolu&ccedil;&atilde;o da sociedade, foram surgindo diversas modalidades de diagn&oacute;stico por imagem. Cada uma dessas apresentando especificidades, benef&iacute;cios, e tamb&eacute;m, algumas desvantagens.</p>\r\n<h2>MAS AFINAL, O QUE &Eacute; DIAGN&Oacute;STICO POR IMAGEM?</h2>\r\n<p>O diagn&oacute;stico por imagem refere-se &agrave; procedimentos realizados para investigar partes internas do organismo.</p>\r\n<p>Esses exames ocorrem de forma n&atilde;o invasiva, indolor e r&aacute;pida. Al&eacute;m disso, possibilitam a percep&ccedil;&atilde;o de anomalias, e consequentemente, apoiam diagn&oacute;sticos ou abordagens terap&ecirc;uticas.</p>\r\n<p>O diagn&oacute;stico por imagem pode ser dividido, basicamente, em dois grupos de m&eacute;todos de obten&ccedil;&atilde;o:</p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Os que utilizam a radia&ccedil;&atilde;o ionizante (Raio X);</p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Os que n&atilde;o utilizam a radia&ccedil;&atilde;o, como &eacute; o caso da resson&acirc;ncia magn&eacute;tica e da ultrassonografia.</p>\r\n<h2>TIPOS DE DIAGN&Oacute;STICO POR IMAGEM</h2>\r\n<p>Como comentamos, devido ao avan&ccedil;o da tecnologia, existem in&uacute;meros tipos de exames de diagn&oacute;stico por imagem.</p>\r\n<p>Dentre os mais presentes na rotina de exames radiol&oacute;gicos est&atilde;o:</p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Raio X;</p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<a href=\"https://pixeldiagnostico.com.br/post/densitometria-ossea-realizada-pelo-metodo-de-tomografia-computadorizada-quatitativa\">Densitometria &oacute;ssea</a>;</p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mamografia;</p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ultrassonografia;</p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tomografia computadorizada;</p>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Resson&acirc;ncia magn&eacute;tica.</p>\r\n<h2>QUAL A FINALIDADE DO DIAGN&Oacute;STICO POR IMAGEM?</h2>\r\n<p>Basicamente, o diagn&oacute;stico por imagem tem a finalidade de estudar partes internas do organismo. Ao analisar internamente, &eacute; poss&iacute;vel identificar padr&otilde;es e anormalidades.</p>\r\n<p>Os diferentes procedimentos fornecem informa&ccedil;&otilde;es essenciais para a an&aacute;lise de tratamentos.</p>\r\n<p>Outro ponto relevante, &eacute; que esses exames permitem constatar impacto de les&otilde;es e apoiar diversos diagn&oacute;sticos.</p>\r\n<p>Um exemplo comum de diagn&oacute;stico por imagem &eacute; a realiza&ccedil;&atilde;o da radiografia para observar fraturas &oacute;sseas e a presen&ccedil;a de pneumonia ou tuberculose.</p>\r\n<p>J&aacute; nos casos de doen&ccedil;as cardiovasculares, a resson&acirc;ncia magn&eacute;tica pode ser grande aliada.</p>\r\n<p>A mamografia &eacute; tamb&eacute;m vista como um exame de grande import&acirc;ncia, visto que auxilia no rastreamento de doen&ccedil;as de alta incid&ecirc;ncia, como &eacute; o caso do c&acirc;ncer de mama.</p>\r\n<p>Podemos considerar assim, que o diagn&oacute;stico por imagem &eacute; imprescind&iacute;vel para o tratamento promissor de diversas patologias.</p>\r\n<p>Al&eacute;m disso, h&aacute; uma expectativa de que esses exames possam ser cada vez mais detalhados, contribuindo assim, para a diminui&ccedil;&atilde;o de procedimentos invasivos.</p>',1,'2020-10-21 14:47:34','2020-10-21 14:47:34','2020-10-21-diagnostico-por-imagem:-um-importante-aliado-da-saude',NULL,'Pixel','As áreas da medicina vêm passando por uma evolução constante. Para constatar essa informação, basta observarmos o avanço nos conhecimentos anatômicos e na incorporação da tecnologia.'),(37,'DENSITOMETRIA ÓSSEA: COMO FUNCIONA?','<p>Atualmente, existem in&uacute;meras tecnologias que permitem o avan&ccedil;o na medicina de diagn&oacute;sticos. Uma das que possuem grande destaque &eacute; a densitometria &oacute;ssea. Voc&ecirc; j&aacute; ouviu falar desse exame ou sabe para que ele serve?</p>\r\n<p>Separamos algumas informa&ccedil;&otilde;es b&aacute;sicas sobre a densitometria &oacute;ssea para esclarecer as suas d&uacute;vidas. Confira a seguir.</p>\r\n<h2>O QUE &Eacute; A DENSITOMETRIA &Oacute;SSEA?</h2>\r\n<p>A densitometria &oacute;ssea (DMO) &eacute; considerada como um exame seguro, simples, r&aacute;pido e indolor.</p>\r\n<p>O exame utiliza-se de radia&ccedil;&atilde;o ionizante para ter imagens dos ossos. A quantidade de raios X &eacute; menor do que em uma radiografia comum, por conta da tecnologia empregada.</p>\r\n<p>A t&eacute;cnica (DXA) garante a visualiza&ccedil;&atilde;o do tecido &oacute;sseo de forma detalhada.</p>\r\n<p>A densitometria &oacute;ssea tem se tornado cada vez mais relevante. Basta observarmos os&nbsp;<a href=\"http://portalarquivos.saude.gov.br/images/pdf/2014/abril/02/pcdt-osteoporose-2014.pdf\">dados do Minist&eacute;rio da Sa&uacute;de</a>, os quais estimam que a partir dos 50 anos, 50% das mulheres e 20% dos homens podem sofrer fraturas osteopor&oacute;ticas.</p>\r\n<h2>PARA QUE SERVE A DENSITOMETRIA &Oacute;SSEA?</h2>\r\n<p>Atrav&eacute;s da densitometria &oacute;ssea &eacute; poss&iacute;vel diagnosticar, por meio de imagens, sinais de perda de espessura &oacute;ssea e mineral. &nbsp;</p>\r\n<p>O exame &eacute; frequentemente utilizado para avalia&ccedil;&atilde;o de doen&ccedil;as como a osteopenia e osteoporose.</p>\r\n<p>A osteopenia se caracteriza pela redu&ccedil;&atilde;o de massa &oacute;ssea, que pode indicar uma predisposi&ccedil;&atilde;o &agrave; osteoporose.</p>\r\n<p>A osteoporose refere-se a perda progressiva da densidade &oacute;ssea. O que pode contribuir para o aumento de fraturas.</p>\r\n<p>Desta maneira, podemos constatar que a densitometria &oacute;ssea &eacute; uma maneira confi&aacute;vel de realizar esse diagn&oacute;stico.</p>\r\n<p>A principal vantagem do exame &eacute; a possibilidade de diagnosticar a perda &oacute;ssea nos est&aacute;gios iniciais, o que n&atilde;o ocorre no raio X comum.</p>\r\n<h2>INDICA&Ccedil;&Otilde;ES DO EXAME</h2>\r\n<p>Segundo a Organiza&ccedil;&atilde;o Mundial da Sa&uacute;de, a densitometria &oacute;ssea &eacute; recomendada para mulheres a partir de 65 anos e homens com 70 anos ou mais.</p>\r\n<p>Al&eacute;m disso, existem pacientes com fatores de risco que necessitam maior aten&ccedil;&atilde;o:</p>\r\n<ul>\r\n<li>Mulheres ap&oacute;s a menopausa;</li>\r\n<li>Mulheres com mais de 50 anos e fatores de risco para fraturas, como falta de vitamina D ou doen&ccedil;a de Crohn;</li>\r\n<li>Pacientes com problemas na tireoide;</li>\r\n<li>Adultos com comorbidades como l&uacute;pus, artrite reumatoide ou espondilite anquilosante;</li>\r\n<li>Mulheres com uso prolongado de reposi&ccedil;&atilde;o hormonal;</li>\r\n<li>Pacientes que utilizam medicamentos como corticoides, que podem se associar a perda de massa &oacute;ssea;</li>\r\n<li>Fumantes, sedent&aacute;rios e consumidores de &aacute;lcool em excesso;</li>\r\n<li>Entre outros.</li>\r\n</ul>\r\n<h2>COMO &Eacute; REALIZADA A DENSITOMETRIA &Oacute;SSEA?</h2>\r\n<p>O exame come&ccedil;a com o fornecimento de uma roupa espec&iacute;fica ao paciente.</p>\r\n<p>Posteriormente, o paciente &eacute; conduzido para realizar a tomografia.</p>\r\n<p>Neste momento, &eacute; emitida a radia&ccedil;&atilde;o a fim de captar e digitalizar as imagens dos ossos.</p>\r\n<p>O procedimento dura apenas 15 minutos, &eacute; totalmente indolor e n&atilde;o causa desconforto.</p>\r\n<p>As regi&otilde;es comumente analisadas s&atilde;o o colo do f&ecirc;mur e as v&eacute;rtebras lombares, que normalmente s&atilde;o suficientes para refletir todo o esqueleto.</p>\r\n<h4>AGORA QUE VOC&Ecirc; J&Aacute; COMPREENDEU A IMPORT&Acirc;NCIA E AS NECESSIDADES DA REALIZA&Ccedil;&Atilde;O DA DENSITOMETRIA &Oacute;SSEA, PODE FICAR MAIS ATENTO AO SEU ORGANISMO.</h4>\r\n<h4>CASO SE IDENTIFIQUE COM ALGUM DOS FATORES DE RISCO, PROCURE O SEU M&Eacute;DICO.</h4>',1,'2020-10-21 14:50:40','2020-10-21 14:50:40','2020-10-21-densitometria-ossea:-como-funciona',NULL,'Pixel','Atualmente, existem inúmeras tecnologias que permitem o avanço na medicina de diagnósticos. Uma das que possuem grande destaque é a densitometria óssea. Você já ouviu falar desse exame ou sabe para que ele serve?'),(38,'ULTRASSOM NÃO É SÓ PARA GESTANTES','<p>Quando falamos de ultrassom, a primeira coisa que vem &agrave; cabe&ccedil;a &eacute; o exame realizado em gestantes, n&atilde;o &eacute; mesmo?</p>\r\n<p>Por&eacute;m, a ultrassonografia, ecografia, ou simplesmente, ultrassom, &eacute; um dos m&eacute;todos utilizados para o diagn&oacute;stico por imagem de in&uacute;meras patologias.</p>\r\n<p>Este exame utiliza-se de ondas sonoras, que s&atilde;o transformadas pelo computador em v&iacute;deos ou fotos. Atrav&eacute;s das quais, o m&eacute;dico realiza o diagn&oacute;stico.</p>\r\n<p>O ultrassom &eacute; um exame sem efeito radioativo, n&atilde;o invasivo e n&atilde;o cumulativo. Sendo assim, n&atilde;o causa danos aos tecidos e aos embri&otilde;es.</p>\r\n<h2>TIPOS DE EXAMES DE ULTRASSOM</h2>\r\n<p>H&aacute; uma grande variedade de exames que s&atilde;o realizados por meio do ultrassom. Listamos alguns deles abaixo:</p>\r\n<h3>ULTRASSOM DO ABD&Ocirc;MEN</h3>\r\n<p>Esse exame pode ser considerado como um dos mais comuns. &Eacute; dividido em dois tipos: o abdome superior, que avalia e diagnostica doen&ccedil;as na ves&iacute;cula biliar, p&acirc;ncreas, f&iacute;gado e ba&ccedil;o; e o abdome total, o qual analisa tamb&eacute;m rins e adrenais, grandes vasos, bexiga urin&aacute;ria e cavidades abdominais.</p>\r\n<h3>ULTRASSOM PARA CIRCULA&Ccedil;&Atilde;O SANGU&Iacute;NEA</h3>\r\n<p>Tamb&eacute;m conhecido por vasculariza&ccedil;&atilde;o, este exame realiza a avalia&ccedil;&atilde;o do fluxo sangu&iacute;neo dos &oacute;rg&atilde;os. Ele &eacute; utilizado, principalmente, para casos de varizes, insufici&ecirc;ncia arterial, etc.</p>\r\n<h3>ULTRASSOM DAS ARTICULA&Ccedil;&Otilde;ES</h3>\r\n<p>Esse tipo de ultrassom possibilita o estudo dos ombros, cotovelos, quadris, punhos, joelhos e tornozelos.</p>\r\n<h3>ULTRASSOM DEDICADO &Agrave; SA&Uacute;DE FEMININA</h3>\r\n<p>Existem alguns exames que s&atilde;o voltados aos diagn&oacute;sticos do corpo da mulher.</p>\r\n<p><strong>Confira a seguir:</strong></p>\r\n<h4>ULTRASSOM TRANSVAGINAL</h4>\r\n<p>O exame &eacute; realizado por meio da introdu&ccedil;&atilde;o do transdutor no canal vaginal da paciente. Tem como fun&ccedil;&atilde;o a avalia&ccedil;&atilde;o do &uacute;tero, endom&eacute;trio, ov&aacute;rios e outras estruturas da pelve.</p>\r\n<p>Pelo fato de ser introduzido no canal vaginal, s&oacute; pode ser feito em mulheres que n&atilde;o s&atilde;o virgens.</p>\r\n<p>Ultrassom das mamas</p>\r\n<p>O Ultrassom das mamas pode ser realizado em qualquer idade, mas &eacute; comumente utilizado como exame complementar &agrave; mamografia, indicada para mulheres acima de 40 anos.</p>\r\n<p>&Eacute; realizado para a an&aacute;lise do tecido e da gl&acirc;ndula mam&aacute;ria a fim de localizar n&oacute;dulos ou cistos.</p>\r\n<p>Tamb&eacute;m &eacute; indicado para mulheres com implantes de silicone ou pacientes gr&aacute;vidas (para evitar a radia&ccedil;&atilde;o da mamografia).</p>\r\n<h4>ULTRASSOM EM GESTANTE</h4>\r\n<p>Como comentamos, esse ultrassom para pacientes gestantes &eacute; o primeiro que vem &agrave; nossa mente. Isso porque &eacute; o mais utilizado durante a gravidez.</p>\r\n<p>Existem tamb&eacute;m alguns tipos de ultrassons dentro dessa modalidade, como por exemplo:</p>\r\n<h4>ULTRASSOM OBST&Eacute;TRICO</h4>\r\n<p>Este exame tem como fun&ccedil;&otilde;es datar a gravidez, analisar o crescimento e desenvolvimento fetal. Al&eacute;m disso, como ele &eacute; poss&iacute;vel verificar batimentos card&iacute;acos e vitalidade fetal.</p>\r\n<h4>ULTRASSOM MORFOL&Oacute;GICO</h4>\r\n<p>&Eacute; utilizado para avaliar a condi&ccedil;&atilde;o do beb&ecirc; durante o per&iacute;odo de gesta&ccedil;&atilde;o.</p>\r\n<p>A sua realiza&ccedil;&atilde;o ocorre no primeiro e no segundo trimestre a fim de examinar anatomia e desenvolvimento do feto.</p>\r\n<h5>OUTRA POSSIBILIDADE DO EXAME &Eacute; RASTREAR POSS&Iacute;VEIS DOEN&Ccedil;AS OU CROMOSSOMOPATIAS.</h5>\r\n<p>Observamos assim, que a ultrassonografia n&atilde;o existe somente para atender pacientes gestantes.</p>\r\n<p>A lista citada acima &eacute; uma pequena parte dos in&uacute;meros exames desse tipo.</p>\r\n<p>Um lembrete importante &eacute; que existem normas de seguran&ccedil;a para a realiza&ccedil;&atilde;o dos exames. Por isso, atenha-se &agrave; indica&ccedil;&atilde;o m&eacute;dica.</p>\r\n<p>Tamb&eacute;m &eacute; relevante observar que cada tipo de ultrassom deve ser realizado por um radiologista especialista naquela &aacute;rea. Ou seja, para realizar um ultrassom obst&eacute;trico, o m&eacute;dico radiologista deve ser especialista em obstetr&iacute;cia; para realiza&ccedil;&atilde;o de um ultrassom vascular, o m&eacute;dico radiologista deve ter especializa&ccedil;&atilde;o em vascular. J&aacute; para os convencionais, o m&eacute;dico deve ser especialista em ultrassom convencional e de articula&ccedil;&atilde;o.</p>\r\n<h5>PREFIRA SEMPRE CL&Iacute;NICAS QUE PREZEM POR SEGUIR ESSAS REGRAS, ASSIM COMO A PIXEL.</h5>',1,'2020-10-21 14:52:19','2020-10-21 14:52:19','2020-10-21-ultrassom-nao-e-so-para-gestantes',NULL,'Pixel','Quando falamos de ultrassom, a primeira coisa que vem à cabeça é o exame realizado em gestantes, não é mesmo?\r\n\r\nPorém, a ultrassonografia, ecografia, ou simplesmente, ultrassom, é um dos métodos utilizados para o diagnóstico por imagem de inúmeras patologias.'),(39,'RESSONÂNCIA MAGNÉTICA: QUAIS SÃO OS TIPOS E QUE DOENÇAS ELAS DIAGNOSTICAM?','<p>A resson&acirc;ncia magn&eacute;tica &eacute; um exame que produz imagens dos &oacute;rg&atilde;os com alta defini&ccedil;&atilde;o de maneira n&atilde;o invasiva e indolor.</p>\r\n<p>Al&eacute;m disso, ao contr&aacute;rio de exames como a tomografia, a resson&acirc;ncia magn&eacute;tica n&atilde;o emite radia&ccedil;&atilde;o.</p>\r\n<h2>COMO FUNCIONA A RESSON&Acirc;NCIA MAGN&Eacute;TICA?</h2>\r\n<p>A resson&acirc;ncia magn&eacute;tica &eacute; um exame que captura as imagens de &oacute;rg&atilde;os, ossos e tecidos.</p>\r\n<p>O aparelho de resson&acirc;ncia magn&eacute;tica &eacute; um equipamento possui o formato de um longo e estreito tubo com abertura nas extremidades, onde o paciente permanece deitado durante a realiza&ccedil;&atilde;o do exame. Em volta dele, cria-se um campo magn&eacute;tico que d&aacute; origem &agrave;s imagens por meio de ondas de r&aacute;dio.</p>\r\n<h2>PARA QUE SERVE A RESSON&Acirc;NCIA MAGN&Eacute;TICA?</h2>\r\n<p>Este exame possui diversas utilidades.</p>\r\n<p>Como a resson&acirc;ncia capta imagens em alta defini&ccedil;&atilde;o e com muitos detalhes, &eacute; utilizada para o diagn&oacute;stico de distintas condi&ccedil;&otilde;es.</p>\r\n<p>Diante disso, &eacute; considerada como um dos m&eacute;todos mais completos e modernos para essa finalidade.</p>\r\n<p>Por meio dela pode-se analisar suspeitas de tumores, traumas, infec&ccedil;&otilde;es, AVC&rsquo;s, entre outros.</p>\r\n<p>Dentre os &oacute;rg&atilde;os que mais s&atilde;o analisados atrav&eacute;s da resson&acirc;ncia magn&eacute;tica est&atilde;o:</p>\r\n<ul>\r\n<li>C&eacute;rebro: no caso do c&eacute;rebro, a resson&acirc;ncia magn&eacute;tica pode diagnosticar les&otilde;es por traumas, derrame, tumores, aneurismas e doen&ccedil;as como o Mal de Alzheimer.</li>\r\n<li>Ossos e articula&ccedil;&otilde;es: consegue fornecer da mesma maneira informa&ccedil;&otilde;es sobre les&otilde;es causadas por esfor&ccedil;os repetitivos ou traumas. Isso inclui o diagn&oacute;stico de tendinites, discos na coluna e tumores.</li>\r\n</ul>\r\n<p>Al&eacute;m dos &oacute;rg&atilde;os citados, a resson&acirc;ncia magn&eacute;tica pode investigar anormalidades nos pulm&otilde;es, rins, p&acirc;ncreas, f&iacute;gado, pr&oacute;stata, mama, cora&ccedil;&atilde;o, &uacute;tero e ba&ccedil;o.</p>\r\n<h2>RESULTADOS DO EXAME</h2>\r\n<p>De maneira simplificada, os m&eacute;dicos analisam os resultados por meio das imagens e da distin&ccedil;&atilde;o das cores presentes no exame.</p>\r\n<p>Atrav&eacute;s de um software, o diagn&oacute;stico pode se tornar ainda mais preciso, visto que possibilita a altera&ccedil;&atilde;o de padr&otilde;es e perspectivas.</p>\r\n<h2>PERIODICIDADE</h2>\r\n<p>Como a resson&acirc;ncia magn&eacute;tica n&atilde;o utiliza radia&ccedil;&atilde;o ionizante, n&atilde;o h&aacute; contraindica&ccedil;&otilde;es com rela&ccedil;&atilde;o &agrave; quantidade de exames.</p>\r\n<p>Todavia, os m&eacute;dicos costumam solicit&aacute;-la somente quando surge alguma suspeita de doen&ccedil;a.</p>\r\n<h2>CUIDADOS E CONTRAINDICA&Ccedil;&Otilde;ES</h2>\r\n<p>Devido ao campo magn&eacute;tico que o exame produz, &eacute; preciso retirar todos os objetos met&aacute;licos.</p>\r\n<p>Pacientes com marcapassos, cateteres e dispositivos implant&aacute;veis n&atilde;o devem realizar o exame. Isso porque se torna perigoso submeter-se ao magnetismo do equipamento.</p>\r\n<p>Por fim, pessoas com claustrofobia ou com doen&ccedil;as que as impe&ccedil;am de permanecer paradas podem prejudicar os resultados.</p>\r\n<p>Em casos espec&iacute;ficos, &eacute; necess&aacute;rio sedar o paciente.</p>\r\n<h4>QUER SABER MAIS SOBRE OS EXAMES DE DIAGN&Oacute;STICO? SE A RESPOSTA FOR SIM, FIQUE ATENTO &Agrave;S NOSSAS PUBLICA&Ccedil;&Otilde;ES!</h4>',1,'2020-10-21 14:54:40','2020-10-24 16:31:37','2020-10-21-ressonancia-magnetica-quais-sao-os-tipos-e-que-doencas-elas-diagnosticam',NULL,'Pixel','A ressonância magnética é um exame que produz imagens dos órgãos com alta definição de maneira não invasiva e indolor.\r\n\r\nAlém disso, ao contrário de exames como a tomografia, a ressonância magnética não emite radiação.'),(40,'ESCLEROSE MÚLTIPLA: POR QUE FAZER UMA RESSONÂNCIA MAGNÉTICA?','<p>Para que ocorra um tratamento de sucesso para a esclerose m&uacute;ltipla &eacute; necess&aacute;rio um diagn&oacute;stico preciso nas fases iniciais. Atualmente, a resson&acirc;ncia magn&eacute;tica &eacute; vista como um importante exame para esse diagn&oacute;stico.</p>\r\n<h2>MAS O QUE &Eacute; A ESCLEROSE M&Uacute;LTIPLA?</h2>\r\n<p>A esclerose m&uacute;ltipla (EM) &eacute; uma doen&ccedil;a que acomete o sistema nervoso central e medula.&nbsp;</p>\r\n<p>Caracteriza-se por surtos de sintomas neurol&oacute;gicos. Esses surtos podem acontecer durante horas ou dias e s&atilde;o seguidos por momentos de remiss&atilde;o completa ou parcial.</p>\r\n<p>De acordo com a Associa&ccedil;&atilde;o Brasileira de Esclerose M&uacute;ltipla (ABEM), a doen&ccedil;a &eacute; rara e atinge principalmente jovens. &Eacute; mais comum ainda em mulheres na faixa et&aacute;ria entre 20 e 40 anos.</p>\r\n<p>Os sintomas v&atilde;o desde formigamentos at&eacute; dificuldade para se locomover, al&eacute;m de problemas de vis&atilde;o, equil&iacute;brio, entre outros.</p>\r\n<p>O seu diagn&oacute;stico &eacute; basicamente cl&iacute;nico, por&eacute;m existem exames de imagem e laboratoriais do licor que auxiliam na confirma&ccedil;&atilde;o.&nbsp;</p>\r\n<h2>RESSON&Acirc;NCIA MAGN&Eacute;TICA NO DIAGN&Oacute;STICO DA ESCLEROSE M&Uacute;LTIPLA</h2>\r\n<p>A RM &eacute; um exame de extrema import&acirc;ncia no diagn&oacute;stico da esclerose m&uacute;ltipla, pois ela permite a identifica&ccedil;&atilde;o da doen&ccedil;a no seu est&aacute;gio inicial, possibilitando a exclus&atilde;o de doen&ccedil;as virais, tumores, malforma&ccedil;&otilde;es, etc.</p>\r\n<p>Como&nbsp;<a href=\"https://pixeldiagnostico.com.br/post/ressonancia-magnetica\">j&aacute; comentamos por aqui</a>, a RM &eacute; um exame de imagem que fornece informa&ccedil;&otilde;es detalhadas de estruturas do c&eacute;rebro, medula e outros &oacute;rg&atilde;os.</p>\r\n<p>Atualmente, &eacute; considerada como o exame de imagem mais completo para diagnosticar a esclerose m&uacute;ltipla e controlar sua evolu&ccedil;&atilde;o.&nbsp;</p>\r\n<p>Ap&oacute;s realizado o diagn&oacute;stico &eacute; imprescind&iacute;vel o acompanhamento com o especialista para monitorar a doen&ccedil;a e verificar o melhor tratamento.&nbsp;</p>\r\n<h4>FIQUE ATENTO AS NOSSAS PUBLICA&Ccedil;&Otilde;ES PARA SABER MAIS SOBRE EXAMES E DIAGN&Oacute;STICOS.</h4>',1,'2020-10-21 14:55:59','2020-10-24 16:27:57','2020-10-21-esclerose-multipla-por-que-fazer-uma-ressonancia-magnetica',NULL,'Pixel','Para que ocorra um tratamento de sucesso para a esclerose múltipla é necessário um diagnóstico preciso nas fases iniciais. Atualmente, a ressonância magnética é vista como um importante exame para esse diagnóstico.'),(41,'TOMOGRAFIA EM POÇOS DE CALDAS: ONDE FAZER?','<p>Est&aacute; procurando um lugar confi&aacute;vel para realizar um exame de tomografia em Po&ccedil;os de Caldas?</p>\r\n<p>Se a resposta for sim, acompanhe o nosso post para conhecer a nossa dica de hoje!</p>\r\n<h2>O QUE &Eacute; A TOMOGRAFIA?</h2>\r\n<p>Primeiramente, vamos compreender de maneira simples o que &eacute; a tomografia e para que ela serve.</p>\r\n<p>A tomografia computadorizada &eacute; um exame de diagn&oacute;stico por imagem.</p>\r\n<p>Este exame combina equipamentos especiais de raio x com computadores programados para produzir imagens do corpo.</p>\r\n<p>A tomografia gera imagens que mostram sec&ccedil;&otilde;es transversais da &aacute;rea analisada. &Eacute; como se o corpo fosse cortado em &ldquo;fatias&rdquo;, as quais podem ser avaliadas de qualquer &acirc;ngulo.</p>\r\n<h2>PARA QUE SERVE A TOMOGRAFIA?</h2>\r\n<p>A tomografia computadorizada &eacute; frequentemente utilizada para a identifica&ccedil;&atilde;o de tumores. Isso porque os detalhes gerados nas imagens conseguem detectar at&eacute; n&oacute;dulos bem pequenos.</p>\r\n<p>Este exame pode focalizar partes do corpo como c&eacute;rebro, f&iacute;gado, ossos, p&acirc;ncreas, rins, pulm&otilde;es, &uacute;tero, ov&aacute;rios e vias biliares.</p>\r\n<p>&Eacute; utilizada tamb&eacute;m para diagnosticar problemas como AVC, aneurismas, embolia pulmonar, derrames, edema cerebral, etc.</p>\r\n<p>Onde realizar a tomografia em Po&ccedil;os de Caldas?</p>\r\n<p>Se voc&ecirc; &eacute; morador de Po&ccedil;os de Caldas ou da regi&atilde;o, e ainda n&atilde;o conhece a Pixel Diagn&oacute;stico por Imagem, acompanhe o nosso post at&eacute; o fim.</p>\r\n<p>A Pixel pode ser o melhor lugar para voc&ecirc; realizar a sua tomografia em Po&ccedil;os de Caldas.</p>\r\n<h2>SOBRE A PIXEL DIAGN&Oacute;STICO POR IMAGEM</h2>\r\n<p>No dia 18 de setembro de 1991, come&ccedil;amos a nossa trajet&oacute;ria de sucesso da Unidade de Diagn&oacute;stico por Imagem (UDI).</p>\r\n<p>Inicialmente, realiz&aacute;vamos somente o exame de tomografia em Po&ccedil;os de Caldas. Mais tarde, em 1997, a cl&iacute;nica passou a oferecer servi&ccedil;os de Resson&acirc;ncia Magn&eacute;tica.</p>\r\n<p>Com a crescente demanda pelos servi&ccedil;os, em janeiro de 2010 foi necess&aacute;ria a amplia&ccedil;&atilde;o da cl&iacute;nica. Ocorreu assim, uma mudan&ccedil;a de endere&ccedil;o, onde nos encontramos at&eacute; hoje.</p>\r\n<p>Em 2012, a UDI passou a ser chamada de Pixel Diagn&oacute;stico por Imagem, levando em conta novas parcerias e amplia&ccedil;&otilde;es.</p>\r\n<p>Atualmente, a Pixel, localizada na Rua Nico Duarte, 964, bairro Vila Cruz, conta com maior conforto e equipamentos de alta tecnologia.</p>\r\n<p>Com o aumento do quadro de funcion&aacute;rios e a inser&ccedil;&atilde;o de novas tecnologias, buscamos sempre a melhoria dos servi&ccedil;os oferecidos.</p>\r\n<p>Por esses motivos, se voc&ecirc; reside em Po&ccedil;os de Caldas ou em qualquer cidade do Sul de Minas, n&atilde;o deixe de conhecer a Pixel Diagn&oacute;stico por Imagem.</p>\r\n<h2>TOMOGRAFIA EM PO&Ccedil;OS DE CALDAS</h2>\r\n<p>Agora que voc&ecirc; j&aacute; sabe onde pode realizar a sua tomografia em Po&ccedil;os de Caldas, certo?</p>\r\n<p>Venha at&eacute; a Pixel e tenha garantia de excel&ecirc;ncia no diagn&oacute;stico e profissionais extremamente capacitados!</p>\r\n<p>Caso tenha ficado interessado, entre em contato conosco e agende o seu exame de imagem.</p>',1,'2020-10-21 14:58:54','2020-10-24 16:31:06','2020-10-21-tomografia-em-pocos-de-caldas-onde-fazer',NULL,'Pixel','Está procurando um lugar confiável para realizar um exame de tomografia em Poços de Caldas?\r\n\r\nSe a resposta for sim, acompanhe o nosso post para conhecer a nossa dica de hoje!'),(42,'EXAMES COM CONTRASTE: TUDO O QUE VOCÊ PRECISA SABER','<p>Provavelmente voc&ecirc; j&aacute; deve ter ouvido falar nos exames com contraste.</p>\r\n<p>Tamb&eacute;m conhecidos por exames contrastados, s&atilde;o realizados com a utiliza&ccedil;&atilde;o de subst&acirc;ncias que melhoram a defini&ccedil;&atilde;o das imagens.</p>\r\n<p>Essas subst&acirc;ncias, chamadas de &ldquo;meios de contraste&rdquo;, auxiliam na avalia&ccedil;&atilde;o do m&eacute;dico.</p>\r\n<p>Os exames com contraste, normalmente, causam d&uacute;vidas nos pacientes quanto a realiza&ccedil;&atilde;o e os riscos envolvidos.</p>\r\n<p>Por isso, hoje resolvemos sanar os principais questionamentos sobre esses exames de imagem. Confira a seguir.</p>\r\n<h2>O QUE &Eacute; CONTRASTE?</h2>\r\n<p>&Eacute; um l&iacute;quido utilizado em alguns exames para facilitar o diagn&oacute;stico de poss&iacute;veis tecidos doentes.</p>\r\n<p>O contraste &eacute; aplicado porque esses tecidos, geralmente, s&atilde;o muito semelhantes aos saud&aacute;veis, por isso, n&atilde;o chamam aten&ccedil;&atilde;o nos exames.</p>\r\n<p>A aplica&ccedil;&atilde;o do contraste pode ocorrer por via oral e/ou venosa.</p>\r\n<h2>EXEMPLOS DE EXAMES COM CONTRASTE</h2>\r\n<ol>\r\n<li>\r\n<p>Resson&acirc;ncia magn&eacute;tica: no caso da resson&acirc;ncia, a subst&acirc;ncia utilizada como contraste &eacute; o gadol&iacute;nio. Esse exame &eacute; realizado, normalmente, para o diagn&oacute;stico de les&otilde;es no c&eacute;rebro ou na coluna vertebral. Pode ser feito ainda para verificar articula&ccedil;&otilde;es, ligamentos e vasos sangu&iacute;neos.</p>\r\n</li>\r\n<li>\r\n<p>Tomografia computadorizada: o contraste utilizado neste tipo de exame &eacute; feito &agrave; base de iodo. &Eacute; comumente utilizado para detectar les&otilde;es, tumores, infec&ccedil;&otilde;es ou altera&ccedil;&otilde;es no c&eacute;rebro, f&iacute;gado, pulm&otilde;es, p&acirc;ncreas, ossos, etc.</p>\r\n</li>\r\n<li>\r\n<p>Angiografia: assim como na tomografia, na angiografia o contraste iodado &eacute; o mais utilizado. Neste exame, o contraste facilita a verifica&ccedil;&atilde;o dos vasos sangu&iacute;neos. Al&eacute;m disso, possibilita o diagn&oacute;stico de doen&ccedil;as como aneurismas ou m&aacute; forma&ccedil;&otilde;es vasculares.&nbsp;</p>\r\n</li>\r\n<li>\r\n<p>Cintilografia: os contrastes, como tecn&eacute;cio e g&aacute;lio, tamb&eacute;m s&atilde;o utilizados nos exames de cintilografia. Este tipo de exame &eacute; realizado para avaliar altera&ccedil;&otilde;es do cora&ccedil;&atilde;o, ossos, pulm&otilde;es, c&eacute;rebro ou tireoide.&nbsp;</p>\r\n</li>\r\n</ol>\r\n<h4>AL&Eacute;M DESTES, EXISTEM DIVERSOS OUTROS TIPOS DE EXAMES QUE UTILIZAM O CONTRASTE PARA UM DIAGN&Oacute;STICO MAIS PRECISO.</h4>\r\n<h4>&nbsp;</h4>\r\n<p>Realize exames com contraste com seguran&ccedil;a!</p>\r\n<p>Sempre fique atento na hora de realizar os seus exames.</p>\r\n<p>Avise seu m&eacute;dico sobre poss&iacute;veis alergias ou desconfortos anteriores causados pelo contraste.&nbsp;</p>\r\n<p>E n&atilde;o deixe de procurar locais confi&aacute;veis para a realiza&ccedil;&atilde;o dos procedimentos.</p>\r\n<p>Conte com a Pixel Diagn&oacute;stico por Imagem! Possu&iacute;mos equipamentos de alta tecnologia e profissionais capacitados para oferecer o melhor para voc&ecirc;.</p>',1,'2020-10-21 15:00:11','2020-10-24 16:30:47','2020-10-21-exames-com-contraste-tudo-o-que-voce-precisa-saber',NULL,'Pixel','Provavelmente você já deve ter ouvido falar nos exames com contraste.\r\n\r\nTambém conhecidos por exames contrastados, são realizados com a utilização de substâncias que melhoram a definição das imagens.'),(43,'HÉRNIA DE DISCO: CAUSAS E DIAGNÓSTICO','<p>A h&eacute;rnia de disco &eacute; uma les&atilde;o que ocorre pelo desgaste dos discos intervertebrais. Esta les&atilde;o acontece, frequentemente, na regi&atilde;o lombar.</p>\r\n<p>Por existir a compress&atilde;o das ra&iacute;zes nervosas que originam da coluna, h&aacute; o surgimento de uma dor intensa nas costas. Em alguns casos, ocorre tamb&eacute;m altera&ccedil;&otilde;es de sensibilidade que chegam &agrave;s pernas, coxas e p&eacute;s.</p>\r\n<p>Quer saber mais sobre a h&eacute;rnia de disco? Se a resposta for sim, acompanhe o nosso artigo de hoje.</p>\r\n<h2>COMO SURGE A H&Eacute;RNIA DE DISCO?</h2>\r\n<p>Para entender como surge a h&eacute;rnia de disco, primeiramente, vamos compreender as estruturas da coluna.</p>\r\n<p>No interior da coluna vertebral encontra-se um canal, no qual passa a medula espinhal ou nervosa.&nbsp;</p>\r\n<p>Entre as v&eacute;rtebras lombares, tor&aacute;cicas e cervicais &eacute; que ficam os discos intervertebrais no formato de an&eacute;is. Essas estruturas s&atilde;o constitu&iacute;das por um tecido cartilaginoso e el&aacute;stico. As suas principais fun&ccedil;&otilde;es s&atilde;o o amortecimento de impacto e a preven&ccedil;&atilde;o contra atritos entre as v&eacute;rtebras.</p>\r\n<p>Devido as fun&ccedil;&otilde;es citadas e o uso repetitivo, os discos acabam desgastando-se com o tempo. Isso facilita a forma&ccedil;&atilde;o das h&eacute;rnias de disco.</p>\r\n<h2>PRINCIPAIS CAUSAS</h2>\r\n<p>Podemos considerar a predisposi&ccedil;&atilde;o gen&eacute;tica como a maior causa para a forma&ccedil;&atilde;o da h&eacute;rnia de disco.</p>\r\n<p>Al&eacute;m disso, o envelhecimento, a falta de exerc&iacute;cios f&iacute;sicos e o tabagismo podem contribuir.</p>\r\n<p>A m&aacute; postura tamb&eacute;m &eacute; uma das grandes vil&atilde;s das doen&ccedil;as presentes na coluna.</p>\r\n<p>Com a correria do dia-a-dia, nem sempre conseguimos manter a postura correta. Mas &eacute; muito importante que voc&ecirc; tome cuidado para n&atilde;o sobrecarregar os m&uacute;sculos e articula&ccedil;&otilde;es.</p>\r\n<h2>PREVEN&Ccedil;&Atilde;O</h2>\r\n<p>O principal ponto para prevenir a h&eacute;rnia de disco &eacute; o desenvolvimento de h&aacute;bitos mais saud&aacute;veis.</p>\r\n<p>Vale lembrar aqui das normas b&aacute;sicas da Ergonomia: postura corporal correta, pr&aacute;tica regular de exerc&iacute;cios f&iacute;sicos, alongamento e fortalecimento da musculatura.&nbsp;</p>\r\n<h2>SINTOMAS DA H&Eacute;RNIA DE DISCO</h2>\r\n<p>A h&eacute;rnia de disco pode ser assintom&aacute;tica, sabia? Por isso &eacute; t&atilde;o importante manter todos os cuidados com rela&ccedil;&atilde;o &agrave; coluna.</p>\r\n<p>Por&eacute;m, ela pode provocar tamb&eacute;m dor leve, moderada ou intensa, at&eacute; chegar ao ponto de se tornar incapacitante.</p>\r\n<p>Os principais sintomas est&atilde;o associados &agrave; &aacute;rea que ocorre a compress&atilde;o da raiz nervosa.</p>\r\n<p>Dentre eles est&atilde;o: parestesia (formigamento), al&eacute;m de dor na coluna, dor na coluna e na perna, somente na perna, na coluna e no bra&ccedil;o ou somente no bra&ccedil;o.</p>\r\n<h2>COMO &Eacute; FEITO O DIAGN&Oacute;STICO?</h2>\r\n<p>O diagn&oacute;stico, em geral, &eacute; feito clinicamente, com base nas caracter&iacute;sticas dos sintomas e o resultado de alguns exames.</p>\r\n<p>A resson&acirc;ncia magn&eacute;tica &eacute; essencial para avaliar o tamanho e a localiza&ccedil;&atilde;o da les&atilde;o.</p>\r\n<p>Gostou de saber um pouco mais sobre a h&eacute;rnia de disco? Conte para n&oacute;s nos coment&aacute;rios.</p>',1,'2020-10-21 15:02:22','2020-10-24 16:30:40','2020-10-21-hernia-de-disco-causas-e-diagnostico',NULL,'Pixel','A hérnia de disco é uma lesão que ocorre pelo desgaste dos discos intervertebrais. Esta lesão acontece, frequentemente, na região lombar.'),(44,'PROBLEMAS NEUROLÓGICOS: PORQUE OS EXAMES DE IMAGEM SÃO TÃO IMPORTANTES','<p>Os exames de imagem em neurologia s&atilde;o essenciais para o diagn&oacute;stico de problemas neurol&oacute;gicos que atingem o sistema nervoso central e perif&eacute;rico. Al&eacute;m disso, s&atilde;o solicitados para avalia&ccedil;&atilde;o da medula espinhal, cabe&ccedil;a e pesco&ccedil;o.</p>\r\n<p>Estes exames podem ser feitos por pacientes de todas as idades, em casos em que &eacute; necess&aacute;rio confirmar alguma suspeita.&nbsp;&nbsp;</p>\r\n<h2>PROBLEMAS NEUROL&Oacute;GICOS DIAGNOSTICADOS POR EXAMES DE IMAGEM</h2>\r\n<p>O diagn&oacute;stico de problemas neurol&oacute;gicos depende, na maioria das vezes, de exames de imagem que apontem anormalidades.&nbsp;</p>\r\n<p>Com as imagens capturadas, o m&eacute;dico consegue analisar as condi&ccedil;&otilde;es reais dos pacientes e propor os tratamentos mais adequados.</p>\r\n<p>As principais indica&ccedil;&otilde;es s&atilde;o para o diagn&oacute;stico de cefaleias, altera&ccedil;&otilde;es de equil&iacute;brio, derrames e tonturas. &Eacute; comum tamb&eacute;m que os neurologistas solicitem exames de imagem em casos de convuls&otilde;es, desmaios, trauma, dem&ecirc;ncia, e quando h&aacute; suspeita de d&eacute;ficits neurol&oacute;gicos s&uacute;bitos e doen&ccedil;as degenerativas.</p>\r\n<h2>EXAMES DE IMAGEM SOLICITADOS POR NEUROLOGISTAS</h2>\r\n<p>A tomografia computadorizada e a resson&acirc;ncia magn&eacute;tica s&atilde;o os exames de imagem mais utilizados para o diagn&oacute;stico de problemas neurol&oacute;gicos.</p>\r\n<p>Outro exame presente nesta especialidade m&eacute;dica &eacute; a angiografia por resson&acirc;ncia magn&eacute;tica, que possui a vantagem de n&atilde;o ser invasiva.</p>\r\n<p>&nbsp;</p>\r\n<h3>TOMOGRAFIA COMPUTADORIZADA</h3>\r\n<p>A tomografia computadorizada &eacute; comumente solicitada para a avalia&ccedil;&atilde;o de problemas neurol&oacute;gicos, do pesco&ccedil;o, mand&iacute;bula, ouvido e seios da face.</p>\r\n<p>Este exame de imagem &eacute; indolor e utiliza-se da radia&ccedil;&atilde;o para produzir imagens da parte interna da cabe&ccedil;a.</p>\r\n<p>Na sua realiza&ccedil;&atilde;o &eacute; importante que o paciente permane&ccedil;a totalmente im&oacute;vel, para que o equipamento capture com qualidade as imagens.</p>\r\n<p>Os exames de tomografia computadorizada podem ser realizados com ou sem contraste. O uso do contraste pode ser uma op&ccedil;&atilde;o vi&aacute;vel nos casos em que h&aacute; a necessidade de tornar o diagn&oacute;stico mais preciso, a necessidade deste &eacute; determinada pelo m&eacute;dico radiologista.&nbsp;</p>\r\n<p>Apesar de n&atilde;o ser t&atilde;o utilizada quanto a resson&acirc;ncia magn&eacute;tica, a tomografia &eacute; uma boa alternativa para pacientes que t&ecirc;m claustrofobia, e tamb&eacute;m para pessoas que n&atilde;o podem realizar exame de resson&acirc;ncia magn&eacute;tica como aqueles que possuem marca-passo ou clip de aneurisma cerebral.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>RESSON&Acirc;NCIA MAGN&Eacute;TICA</h3>\r\n<p>A resson&acirc;ncia magn&eacute;tica &eacute; solicitada quando o paciente possui sintomas de dores de cabe&ccedil;a, problemas de vis&atilde;o, tonturas, fraqueza muscular, perdas auditivas, sensa&ccedil;&atilde;o de formigamento, entre outros.</p>\r\n<p>Por apresentar imagens mais detalhadas, &eacute; considerado como a melhor t&eacute;cnica para o diagn&oacute;stico de tumores nestas &aacute;reas.&nbsp;</p>\r\n<p>A resson&acirc;ncia magn&eacute;tica do cr&acirc;nio n&atilde;o utiliza radia&ccedil;&atilde;o ionizante e dura em torno de 20 minutos, dependendo da avalia&ccedil;&atilde;o a ser realizada e o uso do contraste tamb&eacute;m neste exame &eacute; determinado pelo m&eacute;dico radiologista.</p>\r\n<p>&nbsp;</p>\r\n<h3>ANGIOGRAFIA POR RESSON&Acirc;NCIA MAGN&Eacute;TICA</h3>\r\n<p>A angiografia por resson&acirc;ncia magn&eacute;tica, ou angiorresson&acirc;ncia, &eacute; solicitada nos casos em que &eacute; necess&aacute;rio avaliar os vasos sangu&iacute;neos do c&eacute;rebro, arteriais ou venosos.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Conte com a Pixel Diagn&oacute;stico por Imagem</p>\r\n<p>Estes s&atilde;o alguns dos exames por imagem mais comuns para o diagn&oacute;stico de problemas neurol&oacute;gicos.&nbsp;</p>\r\n<p>Se voc&ecirc; apresenta alguns dos sintomas ou suspeitas que comentamos neste artigo, procure um neurologista de sua confian&ccedil;a.</p>\r\n<p>E para realizar os seus exames de imagem, conte conosco! Aqui na Pixel Diagn&oacute;stico por Imagem, voc&ecirc; realiza seus exames com conforto e equipamentos de alta tecnologia.&nbsp;</p>\r\n<p>Quer saber mais sobre os diagn&oacute;sticos por imagem? Se a resposta for sim, fique atento aos artigos do nosso blog.</p>',1,'2020-10-21 15:03:32','2020-10-24 16:30:26','2020-10-21-problemas-neurologicos-porque-os-exames-de-imagem-sao-tao-importantes',NULL,'Pixel','Os exames de imagem em neurologia são essenciais para o diagnóstico de problemas neurológicos que atingem o sistema nervoso central e periférico. Além disso, são solicitados para avaliação da medula espinhal, cabeça e pescoço.'),(45,'ANEURISMA CEREBRAL: COMO DIAGNOSTICAR?','<p>O aneurisma cerebral &eacute; uma dilata&ccedil;&atilde;o formada na parede de uma art&eacute;ria do c&eacute;rebro.&nbsp;</p>\r\n<p>Essa dilata&ccedil;&atilde;o acomete cerca de 5% da popula&ccedil;&atilde;o, que pode acarretar graves sequelas.</p>\r\n<p>Mas como diagnosticar o aneurisma cerebral? Confira a seguir.</p>\r\n<h2>CAUSAS DO ANEURISMA CEREBRAL</h2>\r\n<p>Quando h&aacute; uma regi&atilde;o enfraquecida na parede de um vaso sangu&iacute;neo cerebral, os aneurismas podem surgir.</p>\r\n<p>O aneurisma pode existir desde o nascimento. Ou ainda, pode se desenvolver no decorrer da vida, quando uma art&eacute;ria &eacute; lesionada.</p>\r\n<h2>QUAIS OS FATORES DE RISCO PARA O ANEURISMA CEREBRAL?</h2>\r\n<p>Notamos que existem alguns fatores que aumentam a chance de ser acometido por um aneurisma.</p>\r\n<p>Primeiro, vale destacar a predisposi&ccedil;&atilde;o familiar, visto que 15% dos portadores de aneurisma pertencem &agrave;s fam&iacute;lias com maior incid&ecirc;ncia da doen&ccedil;a.</p>\r\n<p>Al&eacute;m disso, pacientes com hipertens&atilde;o, diabetes e dislipidemia t&ecirc;m mais chance de desenvolver um aneurisma.</p>\r\n<p>Outro ponto relevante &eacute; que as mulheres t&ecirc;m maior preval&ecirc;ncia dessa enfermidade.</p>\r\n<p>Por fim, o uso do cigarro e excesso de &aacute;lcool tamb&eacute;m s&atilde;o fatores de risco.</p>\r\n<h2>EXISTE DIFEREN&Ccedil;A ENTRE ANEURISMA E AVC?</h2>\r\n<p>O AVC ocorre quando h&aacute; perda de circula&ccedil;&atilde;o e oxigena&ccedil;&atilde;o no c&eacute;rebro.</p>\r\n<p>J&aacute; no aneurisma cerebral, como comentamos, ocorre um alargamento na parede do vaso sangu&iacute;neo. Todavia, &eacute; poss&iacute;vel que haja o rompimento dessa art&eacute;ria, e assim, surja o AVC.</p>\r\n<p>Ent&atilde;o, as doen&ccedil;as podem ter rela&ccedil;&atilde;o, mas n&atilde;o tem o mesmo significado.</p>\r\n<h2>SINTOMAS DO ANEURISMA CEREBRAL</h2>\r\n<p>Grande parte dos casos de aneurisma cerebral s&atilde;o assintom&aacute;ticos.</p>\r\n<p>Entretanto, quando cresce, pode haver a compress&atilde;o de uma estrutura cerebral, e consequentemente, provocar sintomas.</p>\r\n<p>&Eacute; mais comum que os sintomas apare&ccedil;am quando h&aacute; ruptura seguida de hemorragia. Vale ressaltar que quando o sangramento &eacute; abundante, pode ser fatal.</p>\r\n<p>A intensidade dos sintomas varia de acordo com o tamanho do aneurisma e extens&atilde;o do sangramento.</p>\r\n<p>Dentre os mais comuns est&atilde;o n&aacute;useas, v&ocirc;mitos, dores de cabe&ccedil;a s&uacute;bitas e perda de consci&ecirc;ncia.</p>\r\n<h2>COMO OCORRE O DIAGN&Oacute;STICO DE ANEURISMA CEREBRAL?</h2>\r\n<p>Existem alguns exames que s&atilde;o comumente utilizados para o diagn&oacute;stico de um aneurisma.</p>\r\n<p>O diagn&oacute;stico do aneurisma cerebral pode ser feito atrav&eacute;s da Tomografia Computadorizada (Angio TC) e da Angiografia Cerebral, m&eacute;todos estes com o uso de radia&ccedil;&atilde;o ionizante e tamb&eacute;m o uso de meio de contraste iodado.&nbsp;</p>\r\n<p>Na Pixel utilizamos a Angioresson&acirc;ncia Cerebral que n&atilde;o utiliza o meio de&nbsp;<a href=\"https://pixeldiagnostico.com.br/post/exames-com-contraste\">contraste</a>&nbsp;e tamb&eacute;m n&atilde;o faz uso de radia&ccedil;&atilde;o ionizante, al&eacute;m de ser de r&aacute;pida execu&ccedil;&atilde;o. Este exame &eacute; considerado hoje o mais importante para o diagn&oacute;stico do aneurisma cerebral.&nbsp;</p>',1,'2020-10-21 15:05:07','2020-10-24 16:30:20','2020-10-21-aneurisma-cerebral-como-diagnosticar',NULL,'Pixel','O aneurisma cerebral é uma dilatação formada na parede de uma artéria do cérebro. \r\nEssa dilatação acomete cerca de 5% da população, que pode acarretar graves sequelas.\r\nMas como diagnosticar o aneurisma cerebral? Confira a seguir.'),(46,'A IMPORTÂNCIA DO ULTRASSOM DURANTE A GESTAÇÃO','<p>Na gesta&ccedil;&atilde;o, a ultrassonografia &eacute; a grande companheira no pr&eacute;-natal. Por isso, precisamos saber qual a import&acirc;ncia do ultrassom durante a gesta&ccedil;&atilde;o.</p>\r\n<p>Este &eacute; um exame, que atrav&eacute;s de ondas de som, permite que o m&eacute;dico tenha acesso &agrave;s informa&ccedil;&otilde;es sobre a gravidez.</p>\r\n<p>Com o ultrassom, &eacute; poss&iacute;vel ver o crescimento e desenvolvimento do beb&ecirc;.&nbsp;</p>\r\n<h2>COMO FUNCIONA O EXAME DE ULTRASSOM?</h2>\r\n<p>Antes de compreender a import&acirc;ncia do ultrassom durante a gesta&ccedil;&atilde;o, vamos ver como &eacute; seu funcionamento.</p>\r\n<p>O aparelho emite ondas sonoras que se chocam com as partes s&oacute;lidas que encontram pela frente. Dessa maneira, s&atilde;o formadas as imagens.</p>\r\n<p>O ultrassom n&atilde;o &eacute; invasivo e &eacute; totalmente inofensivo para a m&atilde;e e para o beb&ecirc;.</p>\r\n<h2>E QUAL A IMPORT&Acirc;NCIA DO ULTRASSOM DURANTE A GESTA&Ccedil;&Atilde;O?</h2>\r\n<p>Esse exame &eacute; solicitado logo no in&iacute;cio da gesta&ccedil;&atilde;o. Assim, d&aacute; para saber se est&aacute; no lugar certo, ou se &eacute; uma gravidez ect&oacute;pica. Ou seja, se o &oacute;vulo foi implantado dentro ou fora do &uacute;tero.</p>\r\n<p>Outro ponto relevante, &eacute; que o ultrassom permite analisar de quanto tempo &eacute; a gravidez e a quantidade de fetos.</p>\r\n<p>Depois deste per&iacute;odo inicial, o ultrassom &eacute; importante para acompanhar a sa&uacute;de da placenta, posi&ccedil;&atilde;o do beb&ecirc;, sexo, movimentos, etc.</p>\r\n<p>Em resumo, a import&acirc;ncia do ultrassom durante a gravidez est&aacute; no acompanhamento da sa&uacute;de da m&atilde;e e do beb&ecirc;.</p>\r\n<h2>QUANDO VOC&Ecirc; DEVE FAZER O ULTRASSOM GESTACIONAL?</h2>\r\n<p>Nas unidades p&uacute;blicas de sa&uacute;de, o pr&eacute;-natal tem como meta a realiza&ccedil;&atilde;o de 3 ultrassons gestacionais, sendo 1 por trimestre.</p>\r\n<p>Essa quantidade de exames &eacute; suficiente para acompanhar o desenvolvimento do beb&ecirc; e detectar algum tipo de problema.</p>\r\n<p>Entretanto, alguns m&eacute;dicos podem solicitar mais exames de ultrassom durante a gesta&ccedil;&atilde;o.</p>\r\n<p>Frequentemente os ultrassons ocorrem nos per&iacute;odos seguintes:</p>\r\n<ul>\r\n<li>\r\n<p>Entre a 7&ordf; e 8&ordf; semanas: o exame &eacute; solicitado nesse momento para saber a quantidade de fetos e a idade gestacional;</p>\r\n</li>\r\n<li>\r\n<p>Entre a 11&ordf; e a 14&ordf; semanas: neste per&iacute;odo, &eacute; realizada a Transluc&ecirc;ncia Nucal. &Eacute; ideal para diagnosticar problemas cromoss&ocirc;micos no desenvolvimento, como por exemplo, a S&iacute;ndrome de Down;</p>\r\n</li>\r\n<li>\r\n<p>Entre a 18&ordf; e a 24&ordf; semanas: o ultrassom morfol&oacute;gico tem como fun&ccedil;&atilde;o mostrar cada parte do beb&ecirc;. As informa&ccedil;&otilde;es v&atilde;o desde o tamanho at&eacute; a quantidade de dedinhos. Al&eacute;m disso, com o exame, o m&eacute;dico pode verificar o funcionamento dos &oacute;rg&atilde;os do beb&ecirc;, assim como a sa&uacute;de da placenta da m&atilde;e;</p>\r\n</li>\r\n<li>\r\n<p>Com 27 semanas: muitas vezes, este exame &eacute; feito com doppler para averiguar a circula&ccedil;&atilde;o e movimenta&ccedil;&atilde;o do sangue que leva nutrientes e oxig&ecirc;nio ao beb&ecirc;. Permite tamb&eacute;m, analisar a maturidade da placenta;</p>\r\n</li>\r\n<li>\r\n<p>Com 33 semanas: neste momento da gesta&ccedil;&atilde;o, o exame &eacute; solicitado para observar a quantidade de l&iacute;quido amni&oacute;tico e o crescimento do beb&ecirc;. Outro ponto relevante &eacute; a verifica&ccedil;&atilde;o da posi&ccedil;&atilde;o do beb&ecirc;, para saber se j&aacute; est&aacute; de cabe&ccedil;a para baixo, preparado para nascer.</p>\r\n</li>\r\n</ul>\r\n<h4>SE VOC&Ecirc; CHEGOU AT&Eacute; AQUI, AGORA J&Aacute; SABE A GRANDE IMPORT&Acirc;NCIA DO ULTRASSOM DURANTE A GESTA&Ccedil;&Atilde;O.</h4>\r\n<p>Considerando que &eacute; um exame muito relevante, n&atilde;o esque&ccedil;a de procurar&nbsp; um local como a Pixel, que oferece seguran&ccedil;a e qualidade para acompanhar a sua sa&uacute;de e a do seu beb&ecirc;!</p>',1,'2020-10-21 15:07:41','2020-10-21 15:07:41','2020-10-21-a-importancia-do-ultrassom-durante-a-gestacao',NULL,'Pixel','Na gestação, a ultrassonografia é a grande companheira no pré-natal. Por isso, precisamos saber qual a importância do ultrassom durante a gestação.\r\nEste é um exame, que através de ondas de som, permite que o médico tenha acesso às informações sobre a gravidez.'),(47,'OSTEOPOROSE: COMO DETECTAR?','<p>Os casos de osteoporose est&atilde;o cada vez mais frequentes, por conta do envelhecimento da popula&ccedil;&atilde;o.</p>\r\n<p>Mas voc&ecirc; sabe o que &eacute; a osteoporose e como detect&aacute;-la?</p>\r\n<p>Caso voc&ecirc; n&atilde;o saiba ou tenha algumas d&uacute;vidas, confira o nosso artigo de hoje.</p>\r\n<h2>O QUE &Eacute; A OSTEOPOROSE?</h2>\r\n<p>&Eacute; uma condi&ccedil;&atilde;o metab&oacute;lica caracterizada pela redu&ccedil;&atilde;o gradual da densidade &oacute;ssea, que aumenta o risco de fraturas.</p>\r\n<p>Primeiramente, &eacute; essencial destacar que os ossos se comp&otilde;em de uma matriz onde s&atilde;o depositados complexos minerais com c&aacute;lcio.&nbsp;</p>\r\n<p>Al&eacute;m disso, vale destacar que ossos est&atilde;o em constante processo de renova&ccedil;&atilde;o, o que possibilita a sua reconstitui&ccedil;&atilde;o quando h&aacute; algum tipo de fratura.&nbsp;</p>\r\n<p>Com o passar do tempo, a absor&ccedil;&atilde;o de c&eacute;lulas vermelhas aumenta, e tamb&eacute;m ocorre o decl&iacute;nio da forma&ccedil;&atilde;o de c&eacute;lulas &oacute;sseas novas. Consequentemente, os ossos v&atilde;o se tornando mais porosos e perdendo a resist&ecirc;ncia.</p>\r\n<p>Quando as perdas s&atilde;o mais leves, caracteriza-se como osteopenia. Por outro lado, quando as perdas &oacute;sseas s&atilde;o maiores, h&aacute; a osteoporose, respons&aacute;vel por fraturas espont&acirc;neas.</p>\r\n<h2>SINTOMAS</h2>\r\n<p>Comumente, a osteoporose se instala de maneira silenciosa.</p>\r\n<p>Os primeiros sinais, como fraturas espont&acirc;neas de um osso poroso e fraco, podem aparecer em est&aacute;gios mais avan&ccedil;ados da doen&ccedil;a.</p>\r\n<h2>POR QUE A OSTEOPOROSE ACOMETE MAIS AS MULHERES?</h2>\r\n<p>O estrog&ecirc;nio, horm&ocirc;nio feminino, exerce forte influ&ecirc;ncia nos ossos. Ele auxilia na manuten&ccedil;&atilde;o do equil&iacute;brio entre o ganho e perda de massa &oacute;ssea.</p>\r\n<p>Esse horm&ocirc;nio tamb&eacute;m est&aacute; presente nos homens, mas em uma quantidade bem menor.</p>\r\n<p>O que ocorre &eacute; que na menopausa os n&iacute;veis de estrog&ecirc;nio das mulheres diminuem drasticamente.</p>\r\n<p>Dessa forma, os ossos descalcificam mais facilmente e se tornam mais fr&aacute;geis.</p>\r\n<p>Por isso as mulheres s&atilde;o mais atingidas pela osteoporose.&nbsp;</p>\r\n<p>Esse fato pode ser comprovado em estat&iacute;sticas as quais mostram que a doen&ccedil;a acomete um homem para cada quatro mulheres.</p>\r\n<p>A densitometria &oacute;ssea &eacute; o exame mais indicado para diagnosticar a doen&ccedil;a.</p>',1,'2020-10-21 15:08:50','2020-10-24 16:30:03','2020-10-21-osteoporose-como-detectar',NULL,'Pixel','Os casos de osteoporose estão cada vez mais frequentes, por conta do envelhecimento da população.\r\nMas você sabe o que é a osteoporose e como detectá-la?\r\nCaso você não saiba ou tenha algumas dúvidas, confira o nosso artigo de hoje.'),(48,'TOMOGRAFIA COMPUTADORIZADA NO DIAGNÓSTICO DA TUBERCULOSE','<p>A Radiografia de T&oacute;rax ainda &eacute; bastante utilizada para o diagn&oacute;stico e acompanhamento de pacientes com Tuberculose. Todavia, a Tomografia Computadorizada tem conquistado espa&ccedil;o em v&aacute;rias especialidades como radiologia, cirurgia tor&aacute;cica, pneumologia, entre outros. Dessa forma, tamb&eacute;m passou a ser empregada com mais frequ&ecirc;ncia no diagn&oacute;stico da Tuberculose.</p>\r\n<h2>O QUE &Eacute; TUBERCULOSE?</h2>\r\n<p>A Tuberculose &eacute; transmitida pelo Mycobacterium tuberculosis, o bacilo de Koch.</p>\r\n<p>&Eacute; considerada como a doen&ccedil;a infecto-contagiosa que mais causa mortes no Brasil. Acredita-se que cerca de 30% da popula&ccedil;&atilde;o mundial esteja infectada, por&eacute;m, nem todos desenvolvem a doen&ccedil;a.</p>\r\n<p>A primoinfec&ccedil;&atilde;o (primeiro ataque ao organismo) ocorre quando o paciente entra tem contato pela primeira vez com o bacilo.</p>\r\n<p>Isso pode ocorrer com mais facilidade quando h&aacute; proximidade com pessoas infectadas, principalmente, em ambientes fechados e pouco ventilados.</p>\r\n<p>A evolu&ccedil;&atilde;o da Tuberculose ocorre quando o organismo n&atilde;o consegue bloquear o bacilo. Neste ponto, desenvolve-se uma rea&ccedil;&atilde;o inflamat&oacute;ria intensa em diversos tecidos. Consequentemente, o pulm&atilde;o reage e produz muco, surgindo assim, uma tosse produtiva.</p>\r\n<h2>PRINCIPAIS SINTOMAS DA TUBERCULOSE</h2>\r\n<p>Destacam-se como principais sintomas da Tuberculose:</p>\r\n<ul>\r\n<li>\r\n<p>Tosse que permanece por mais de duas semanas com produ&ccedil;&atilde;o de catarro;</p>\r\n</li>\r\n<li>\r\n<p>Sudorese;</p>\r\n</li>\r\n<li>\r\n<p>Cansa&ccedil;o;</p>\r\n</li>\r\n<li>\r\n<p>Febre;</p>\r\n</li>\r\n<li>\r\n<p>Dor no peito;</p>\r\n</li>\r\n<li>\r\n<p>Emagrecimento e falta de apetite;</p>\r\n</li>\r\n<li>\r\n<p>Em casos mais graves, pode existir escarro com sangue.</p>\r\n</li>\r\n</ul>\r\n<p>Caso voc&ecirc; apresente esses sintomas isoladamente ou associados, procure com urg&ecirc;ncia um m&eacute;dico. O tratamento para Tuberculose &eacute; gratuito e deve ser iniciado imediatamente.</p>\r\n<h2>USO DA TOMOGRAFIA COMPUTADORIZADA PARA O DIAGN&Oacute;STICO DA TUBERCULOSE</h2>\r\n<p>Para o diagn&oacute;stico da Tuberculose, os exames de diagn&oacute;stico por imagem possuem um papel relevante.</p>\r\n<p>A Radiografia de T&oacute;rax, em jun&ccedil;&atilde;o com a Baciloscopia do Escarro ainda s&atilde;o considerados como os principais m&eacute;todos de avalia&ccedil;&atilde;o e acompanhamento desses pacientes.</p>\r\n<p>Entretanto, a Tomografia Computadorizada (TC) &eacute; mais sens&iacute;vel e espec&iacute;fica, por isso pode ser utilizada quando h&aacute; altera&ccedil;&otilde;es duvidosas.</p>\r\n<p>A TC &eacute; indicada comumente em casos que:</p>\r\n<ul>\r\n<li>\r\n<p>Existem sintomas respirat&oacute;rios, mas a Baciloscopia do Escarro &eacute; negativa;</p>\r\n</li>\r\n<li>\r\n<p>H&aacute; suspeita de Tuberculose, mas a Radiografia de T&oacute;rax &eacute; normal ou possui altera&ccedil;&atilde;o duvidosa;</p>\r\n</li>\r\n<li>\r\n<p>Apresentam sequelas extensas, com a necessidade de interven&ccedil;&otilde;es cir&uacute;rgicas;</p>\r\n</li>\r\n<li>\r\n<p>&Eacute; essencial uma avalia&ccedil;&atilde;o mediastinal mais detalhada;</p>\r\n</li>\r\n<li>\r\n<p>A doen&ccedil;a &eacute; difusa;</p>\r\n</li>\r\n<li>\r\n<p>Os pacientes t&ecirc;m altera&ccedil;&otilde;es endobr&ocirc;nquicas.</p>\r\n</li>\r\n</ul>\r\n<p>Diferentemente da Radiografia, a TC possui a vantagem de diagnosticar altera&ccedil;&otilde;es em estruturas pulmonares bem pequenas.</p>\r\n<p>Diante disso, a Tomografia Computadorizada pode ser um m&eacute;todo fundamental para o diagn&oacute;stico da Tuberculose, nos casos em que os outros exames n&atilde;o identificam altera&ccedil;&otilde;es claras.</p>\r\n<h2>CONTE COM A PIXEL DIAGN&Oacute;STICO&nbsp;</h2>\r\n<p>Se voc&ecirc; apresenta alguns dos sintomas apresentados anteriormente, procure um m&eacute;dico de sua confian&ccedil;a.</p>\r\n<p>Al&eacute;m disso, se for necess&aacute;rio realizar exames de diagn&oacute;stico por imagem, opte por locais seguros e com garantia de qualidade.</p>\r\n<p>Conte com a Pixel e realize seus exames com seguran&ccedil;a, conforto e alta tecnologia!</p>',1,'2020-10-21 15:09:58','2020-10-21 15:09:58','2020-10-21-tomografia-computadorizada-no-diagnostico-da-tuberculose',NULL,'Pixel','A Radiografia de Tórax ainda é bastante utilizada para o diagnóstico e acompanhamento de pacientes com Tuberculose. Todavia, a Tomografia Computadorizada tem conquistado espaço em várias especialidades como radiologia, cirurgia torácica, pneumologia, entre outros. '),(49,'COMO DIAGNOSTICAR TROMBOSE VENOSA?','<p>A Trombose Venosa Profunda &eacute; uma doen&ccedil;a que atinge principalmente as pernas e pode trazer complica&ccedil;&otilde;es a curto ou longo prazo.</p>\r\n<p>Voc&ecirc; sabe quais os sintomas e como diagnosticar a doen&ccedil;a? Se ainda n&atilde;o, confira o nosso artigo.</p>\r\n<h2>O QUE &Eacute; TROMBOSE VENOSA?</h2>\r\n<p>A trombose venosa &eacute; uma doen&ccedil;a grave que forma co&aacute;gulos sangu&iacute;neos em uma ou mais veias da parte inferior do corpo.</p>\r\n<p>Existem dois tipos de trombose venosa, a aguda e a cr&ocirc;nica. Contudo, essa doen&ccedil;a tamb&eacute;m pode se manifestar como trombose hemorroid&aacute;ria, trombose cerebral e trombose arterial.</p>\r\n<h2>TIPOS DE TROMBOSE VENOSA</h2>\r\n<h3>TROMBOSE AGUDA</h3>\r\n<p>A trombose, incialmente, pode ser considerada como um evento agudo. Ocorre ainda, que muitas vezes, o pr&oacute;prio corpo utiliza alguns mecanismos para dissolv&ecirc;-lo.</p>\r\n<h3>TROMBOSE CR&Ocirc;NICA</h3>\r\n<p>Verifica-se em alguns casos, que durante a dissolu&ccedil;&atilde;o do co&aacute;gulo de maneira natural, podem permanecer algumas sequelas no interior das veias. Isso pode destruir a estrutura das v&aacute;lvulas e tornar a doen&ccedil;a cr&ocirc;nica.</p>\r\n<p>Devido essas altera&ccedil;&otilde;es, h&aacute; um preju&iacute;zo no retorno do sangue. Consequentemente, podem surgir varizes, escurecimento, incha&ccedil;o e endurecimento da pele.</p>\r\n<h2>SINTOMAS DA TROMBOSE VENOSA</h2>\r\n<p>Em uma quantidade consider&aacute;vel de casos, a trombose n&atilde;o apresenta sintomas. Todavia, alguns pacientes podem manifestar os seguintes sintomas:</p>\r\n<ul>\r\n<li>\r\n<p>Queima&ccedil;&atilde;o na regi&atilde;o afetada;</p>\r\n</li>\r\n<li>\r\n<p>Dor nas pernas;</p>\r\n</li>\r\n<li>\r\n<p>Edema (incha&ccedil;o) na perna afetada;</p>\r\n</li>\r\n<li>\r\n<p>Mudan&ccedil;as de cor na pele.</p>\r\n</li>\r\n</ul>\r\n<h2>DIAGN&Oacute;STICO</h2>\r\n<p>O diagn&oacute;stico da trombose venosa &eacute; feito levando em conta os sintomas e fatores de risco. Isso, em conjunto com a confirma&ccedil;&atilde;o por exames de laborat&oacute;rio e de imagem.</p>\r\n<p>Quanto antes o diagn&oacute;stico for realizado e mais cedo o tratamento se inicie, maior &eacute; a possibilidade de reverter o quadro.</p>\r\n<h3>PRINCIPAIS EXAMES&nbsp;</h3>\r\n<h4>EXAME DE SANGUE</h4>\r\n<p>Comumente os m&eacute;dicos solicitam um hemograma completo para identificar as subst&acirc;ncias na corrente sangu&iacute;nea que facilitam a coagula&ccedil;&atilde;o.</p>\r\n<h4>ULTRASSOM</h4>\r\n<p>O Ultrassom &eacute; utilizado a fim de verificar os locais onde existe a coagula&ccedil;&atilde;o de sangue.</p>\r\n<h4>ECO COLOR DOPPLER (ULTRASSOM VASCULAR)</h4>\r\n<p>Esse exame apresenta imagens precisas das veias que foram acometidas pelo problema.&nbsp;</p>\r\n<p>Ele funciona por meio da tecnologia do ultrassom e &eacute; considerado como um exame n&atilde;o invasivo.</p>\r\n<h4>TOMOGRAFIA E RESSON&Acirc;NCIA MAGN&Eacute;TICA</h4>\r\n<p>Os dois exames tamb&eacute;m podem ser utilizados para o diagn&oacute;stico da trombose venosa.</p>\r\n<p>Eles podem produzir imagens dos vasos e apresentar as coagula&ccedil;&otilde;es.&nbsp;</p>\r\n<h4>TRATAMENTO</h4>\r\n<p>O tratamento da trombose venosa &eacute; aplicado para evitar a forma&ccedil;&atilde;o de co&aacute;gulos.</p>\r\n<p>Caso eles j&aacute; tenham se instalado, objetiva-se facilitar a reabsor&ccedil;&atilde;o pelo organismo.</p>\r\n<p>Para isso, s&atilde;o indicados pelos m&eacute;dicos os medicamentos anticoagulantes e os fibrinol&iacute;ticos, que ajudam a dissolver os trombos.</p>\r\n<p>Em casos mais espec&iacute;ficos, &eacute; necess&aacute;ria interven&ccedil;&atilde;o cir&uacute;rgica.</p>\r\n<h2>PREVEN&Ccedil;&Atilde;O DA TROMBOSE VENOSA</h2>\r\n<p>Algumas medidas importantes para prevenir a forma&ccedil;&atilde;o de trombos s&atilde;o:</p>\r\n<ul>\r\n<li>\r\n<p>N&atilde;o fumar;</p>\r\n</li>\r\n<li>\r\n<p>Manter o peso dentro dos limites saud&aacute;veis;</p>\r\n</li>\r\n<li>\r\n<p>Praticar exerc&iacute;cios f&iacute;sicos;</p>\r\n</li>\r\n<li>\r\n<p>Restringir o consumo de bebidas alco&oacute;licas.</p>\r\n</li>\r\n</ul>\r\n<p>Al&eacute;m disso, para pessoas com predisposi&ccedil;&atilde;o a desenvolver trombos, vale ressaltar o uso de meias el&aacute;sticas e evitar o consumo de medicamentos para dormir.</p>',1,'2020-10-21 15:12:08','2020-10-21 15:12:08','2020-10-21-como-diagnosticar-trombose-venosa',NULL,'Pixel','A Trombose Venosa Profunda é uma doença que atinge principalmente as pernas e pode trazer complicações a curto ou longo prazo.\r\nVocê sabe quais os sintomas e como diagnosticar a doença? Se ainda não, confira o nosso artigo.'),(50,'ULTRASSONOGRAFIA DAS MAMAS: POR QUE REALIZAR?','<p>A ultrassonografia das mamas &eacute; um exame utilizado no diagn&oacute;stico de algumas altera&ccedil;&otilde;es mam&aacute;rias.</p>\r\n<p>Hoje iremos compreender as diferen&ccedil;as existentes entre esse exame e a mamografia, bem como a import&acirc;ncia da ultrassonografia das mamas.</p>\r\n<h2>COMO FUNCIONA A ULTRASSONOGRAFIA DAS MAMAS?</h2>\r\n<p>O ultrassom &eacute; um m&eacute;todo de diagn&oacute;stico por imagem que n&atilde;o utiliza radia&ccedil;&atilde;o ionizante para produzir imagens.</p>\r\n<p>Atrav&eacute;s de um transdutor que emite um som de alto frequ&ecirc;ncia. Este som atravessa tecidos de diversas imped&acirc;ncias ac&uacute;sticas. Cada tecido emite ecos diferentes que formam as diversas imagens do tecido ou &oacute;rg&atilde;o examinado.</p>\r\n<p>Dessa forma, o m&eacute;dico consegue interpretar as imagens geradas pela ultrassonografia das mamas e realizar o diagn&oacute;stico.</p>\r\n<h2>DIFEREN&Ccedil;A ENTRE MAMOGRAFIA E ULTRASSONOGRAFIA DAS MAMAS</h2>\r\n<p>Voc&ecirc; j&aacute; deve ter ouvido falar nesses dois exames, certo? Mas voc&ecirc; sabe qual a diferen&ccedil;a entre eles?</p>\r\n<p>A mamografia &eacute; o exame mais solicitado para rastrear o c&acirc;ncer de mama.</p>\r\n<p>A grande diferen&ccedil;a, se comparada ao ultrassom, &eacute; que a mamografia &eacute; um m&eacute;todo de raio X. Esse exame realiza uma compress&atilde;o do tecido mam&aacute;rio, a fim de verificar poss&iacute;veis les&otilde;es.&nbsp;</p>\r\n<p>A ultrassonografia das mamas &eacute; um m&eacute;todo auxiliar nesses diagn&oacute;sticos. Por esse motivo, n&atilde;o pode substituir a mamografia, mas sim complementar a detec&ccedil;&atilde;o de altera&ccedil;&otilde;es mam&aacute;rias.</p>\r\n<h2>IMPORT&Acirc;NCIA DA ULTRASSONOGRAFIA DE MAMAS</h2>\r\n<p>Como comentamos, a ultrassonografia de mamas pode ser um exame auxiliar da mamografia.</p>\r\n<p>O ultrassom consegue evidenciar n&oacute;dulos, cistos, espessamento do tecido mam&aacute;rio, secre&ccedil;&otilde;es nos mamilos, entre outros.&nbsp;</p>\r\n<p>O exame de imagem &eacute; essencial para verificar altera&ccedil;&otilde;es mam&aacute;rias que podem ser sentidas, mas visualizadas na mamografia.&nbsp;</p>\r\n<p>Al&eacute;m disso, pode ser importante na distin&ccedil;&atilde;o de les&otilde;es c&iacute;sticas (com l&iacute;quido dentro) e s&oacute;lidas. Essas, muitas vezes, possuem aspecto semelhante na mamografia.</p>\r\n<p>Outro ponto relevante &eacute; que o ultrassom das mamas pode direcionar as bi&oacute;psias das mamas em pacientes que precisam destes procedimentos.</p>\r\n<p>&Eacute; recomend&aacute;vel ainda, que sejam realizadas tanto a mamografia, quanto a ultrassonografia de mamas nos casos de mamas mais densas. Isso porque o ultrassom pode aumentar a sensibilidade para diagnosticar c&acirc;nceres de mama, nestas mamas mais densas.</p>\r\n<h2>QUANDO &Eacute; INDICADO REALIZAR A ULTRASSONOGRAFIA DAS MAMAS?</h2>\r\n<p>Existem alguns casos espec&iacute;ficos em que o ultrassom &eacute; indicado. Veja alguns deles:</p>\r\n<ul>\r\n<li>\r\n<p>Pacientes com hist&oacute;rico familiar de c&acirc;ncer de mama;</p>\r\n</li>\r\n<li>\r\n<p>Jovens (at&eacute; 40 anos) com altera&ccedil;&otilde;es palp&aacute;veis;</p>\r\n</li>\r\n<li>\r\n<p>Pacientes com tecido mam&aacute;rio denso;</p>\r\n</li>\r\n<li>\r\n<p>Nos casos em que &eacute; necess&aacute;rio avaliar implantes de silicone;</p>\r\n</li>\r\n<li>\r\n<p>Gestantes, as quais n&atilde;o podem ser expostas &agrave; radia&ccedil;&atilde;o ionizante;</p>\r\n</li>\r\n<li>\r\n<p>Pacientes que possuem altera&ccedil;&otilde;es diagnosticadas na mamografia, mas que necessitam de avalia&ccedil;&atilde;o complementar.</p>\r\n</li>\r\n</ul>\r\n<h2>CONTE A PIXEL DIAGN&Oacute;STICO</h2>\r\n<p>Na hora de realizar seus exames de diagn&oacute;stico por imagem, conte a garantia de qualidade da Pixel!</p>\r\n<p>Aqui, voc&ecirc; encontra novas tecnologias que aprimoram os exames e profissionais capacitados para lhe oferecer o melhor.</p>',1,'2020-10-21 15:13:31','2020-10-24 16:29:56','2020-10-21-ultrassonografia-das-mamas-por-que-realizar',NULL,'Pixel','A ultrassonografia das mamas é um exame utilizado no diagnóstico de algumas alterações mamárias.\r\nHoje iremos compreender as diferenças existentes entre esse exame e a mamografia, bem como a importância da ultrassonografia das mamas.'),(51,'ULTRASSOM DA TIREOIDE','<p>O ultrassom da tireoide &eacute; um exame que produz imagens da gl&acirc;ndula tireoide para o diagn&oacute;stico de algumas doen&ccedil;as e condi&ccedil;&otilde;es.&nbsp;</p>\r\n<p>Vamos entender melhor como ele funciona e para que serve.</p>\r\n<h2>MAS AFINAL, O QUE &Eacute; A TIREOIDE?</h2>\r\n<p>&Eacute; uma gl&acirc;ndula end&oacute;crina que fica na regi&atilde;o anterior do pesco&ccedil;o. Produz e envia horm&ocirc;nios para a corrente sangu&iacute;nea.<br />A tireoide produz os horm&ocirc;nios T3 (triiodotironina) e T4 (tiroxina), os quais auxiliam no funcionamento do cora&ccedil;&atilde;o, rins e c&eacute;rebro.</p>\r\n<h2>QUAIS DOEN&Ccedil;AS O ULTRASSOM DE TIREOIDE DIAGN&Oacute;STICO?</h2>\r\n<h3>HIPOTIREOIDISMO E HIPERTIREOIDISMO</h3>\r\n<p>Nessa gl&acirc;ndula podem ocorrer inflama&ccedil;&otilde;es.</p>\r\n<p>Essas podem reduzir ou acelerar a capacidade de funcionamento, o que causa hipotireoidismo ou hipertireoidismo.</p>\r\n<p>No hipertireoidismo ocorre um aumento da produ&ccedil;&atilde;o dos horm&ocirc;nios. Isso pode influenciar para perda de peso, ansiedade, ins&ocirc;nia e aumento de batimentos card&iacute;acos.</p>\r\n<p>J&aacute; no hipotireoidismo h&aacute; o oposto. A produ&ccedil;&atilde;o de horm&ocirc;nios diminui, o que acarreta o aumento de peso, fraqueza, cansa&ccedil;o, entre outros.&nbsp;</p>\r\n<p>As causas podem ser autoimunes, inflamat&oacute;rias, cong&ecirc;nitas ou efeitos colaterais de outras doen&ccedil;as.</p>\r\n<p>Nos dois casos, o ultrassom de tire&oacute;ide auxilia na detec&ccedil;&atilde;o e diagn&oacute;stico.</p>\r\n<h3>N&Oacute;DULOS E CISTOS</h3>\r\n<p>O ultrassom de tireoide pode demonstrar tamb&eacute;m se um n&oacute;dulo est&aacute; surgindo na tireoide ou em outra estrutura.</p>\r\n<p>A grande maioria &eacute; benigno, mas &eacute; necess&aacute;rio avaliar cada caso e verificar se h&aacute; necessidade de realizar bi&oacute;psia.</p>\r\n<h3>DOEN&Ccedil;AS DE GRAVES</h3>\r\n<p>A doen&ccedil;a de Graves pode ser causada por condi&ccedil;&otilde;es autoimunes e &eacute; um tipo de hipertireoidismo.&nbsp;</p>\r\n<p>Os pacientes com a doen&ccedil;a podem ter a forma&ccedil;&atilde;o de placas avermelhadas na pele e apresentar olhos salientes.</p>\r\n<h3>TUMORES</h3>\r\n<p>Os tumores podem ser benignos ou malignos.</p>\r\n<h3>B&Oacute;CIO</h3>\r\n<p>O B&oacute;cio &eacute; considerado como o aumento vis&iacute;vel da tireoide, que tamb&eacute;m pode ser visualizado pelo ultrassom.</p>\r\n<p>Como sintomas comuns est&atilde;o a dificuldade para respirar e engolir, al&eacute;m da sensa&ccedil;&atilde;o de aperto na garganta.</p>\r\n<h2>FUNCIONAMENTO DO ULTRASSOM DE TIREOIDE</h2>\r\n<p>O ultrassom de tireoide &eacute; indolor e n&atilde;o invasivo.</p>\r\n<p>Como os outros procedimentos de ultrassom, n&atilde;o &eacute; necess&aacute;rio preparo do paciente.&nbsp;</p>\r\n<p>O procedimento ocorre por meio de um transdutor que percorre a parte externa da garganta com ajuda de um gel.</p>\r\n<p>O aparelho emite ondas sonoras de alta frequ&ecirc;ncia, as quais geram imagens da regi&atilde;o analisada.</p>\r\n<h2>LEMBRE-SE DE PROCURAR ORIENTA&Ccedil;&Atilde;O M&Eacute;DICA!</h2>\r\n<p>Como comentamos o ultrassom &eacute; importante para o diagn&oacute;stico de diversas altera&ccedil;&otilde;es na tireoide.&nbsp;</p>\r\n<p>Se voc&ecirc; est&aacute; com algum sintoma ou preocupado com uma poss&iacute;vel altera&ccedil;&atilde;o, procure um m&eacute;dico de sua confian&ccedil;a.</p>\r\n<p>Ap&oacute;s realizar os exames f&iacute;sicos, ir&aacute; indicar o melhor procedimento para o seu caso!</p>',1,'2020-10-21 15:15:03','2020-10-21 15:15:03','2020-10-21-ultrassom-da-tireoide',NULL,'Pixel','O ultrassom da tireoide é um exame que produz imagens da glândula tireoide para o diagnóstico de algumas doenças e condições. \r\nVamos entender melhor como ele funciona e para que serve.'),(52,'AMAMENTAÇÃO E EXAMES DE IMAGEM','<p>&Eacute; muito comum que as m&atilde;es tenham receio de realizar exames de imagem no per&iacute;odo de amamenta&ccedil;&atilde;o. Por isso, no artigo de hoje voc&ecirc; entender&aacute; melhor a rela&ccedil;&atilde;o entre amamenta&ccedil;&atilde;o e exames de imagem.</p>\r\n<p>Essa preocupa&ccedil;&atilde;o, compreens&iacute;vel, aparece por conta da d&uacute;vida quanto aos riscos para os beb&ecirc;s que ingerirem leite materno ap&oacute;s a m&atilde;e realizar exames como radiografia, tomografia e resson&acirc;ncia magn&eacute;tica. E o receio aumenta ainda mais quando esses exames envolvem o uso de contraste.</p>\r\n<h4>MAS SER&Aacute; QUE REALMENTE OFERECE RISCOS AO SEU FILHO?&nbsp;</h4>\r\n<p>Acompanhe nosso artigo para saber a resposta.</p>\r\n<h2>EXAMES DE RADIOGRAFIA E TOMOGRAFIA</h2>\r\n<p>Para compreendermos a rela&ccedil;&atilde;o entre amamenta&ccedil;&atilde;o e exames de imagem, vamos come&ccedil;ar pelos exames de Raio X.</p>\r\n<p>A radia&ccedil;&atilde;o que &eacute; liberada pela m&aacute;quina pode matar algumas c&eacute;lulas presentes no leite, mas &eacute; s&oacute; isso que acontece. Essa radia&ccedil;&atilde;o n&atilde;o &eacute; passada para o filho.</p>\r\n<p>O exame de imagem &eacute; seguro com rela&ccedil;&atilde;o ao leite. Ele n&atilde;o afetar&aacute; a qualidade e n&atilde;o prejudicar&aacute; a sa&uacute;de do beb&ecirc;.</p>\r\n<h2>RESSON&Acirc;NCIA MAGN&Eacute;TICA</h2>\r\n<p>Outra d&uacute;vida recorrente entre as m&atilde;es sobre amamenta&ccedil;&atilde;o e exames de imagem, &eacute; a realiza&ccedil;&atilde;o da resson&acirc;ncia magn&eacute;tica.</p>\r\n<p>A resson&acirc;ncia n&atilde;o cont&eacute;m radia&ccedil;&atilde;o. Por isso, tamb&eacute;m &eacute; segura para mulheres que est&atilde;o amamentando.</p>\r\n<h2>USO DE CONTRASTE</h2>\r\n<p>Em alguns tipos de exame &eacute; preciso aplicar contraste na paciente.</p>\r\n<p>Neste sentido, h&aacute; ainda muitas d&uacute;vidas quanto &agrave; elimina&ccedil;&atilde;o de contraste pelo leite materno.</p>\r\n<p>Apesar de limita&ccedil;&otilde;es na literatura sobre a elimina&ccedil;&atilde;o da subst&acirc;ncia no leite, estudos apontam que a absor&ccedil;&atilde;o pelo beb&ecirc; &eacute; muito baixa.&nbsp;</p>\r\n<p>Sabe-se que a meia vida plasm&aacute;tica do contraste iodado &eacute; em torno de 2 horas. Al&eacute;m disso, h&aacute; 100% de depura&ccedil;&atilde;o no per&iacute;odo de 24 horas.</p>\r\n<p>Neste per&iacute;odo de 24 horas, menos de 1% do contraste &eacute; eliminado no leite materno. E o beb&ecirc; absorve na regi&atilde;o do trato gastrointestinal menos de 0,01% da dose utilizada na m&atilde;e.</p>\r\n<p>Como vimos, a ingest&atilde;o &eacute; m&iacute;nima. Desse modo, n&atilde;o existem efeitos adversos nos beb&ecirc;s.</p>\r\n<p>Ficou com alguma d&uacute;vida sobre a rela&ccedil;&atilde;o entre amamenta&ccedil;&atilde;o e os exames de imagem?</p>\r\n<p>Se a resposta for sim, entre em contato conosco!</p>',1,'2020-10-21 15:17:10','2020-10-21 15:17:10','2020-10-21-amamentacao-e-exames-de-imagem',NULL,'Pixel','É muito comum que as mães tenham receio de realizar exames de imagem no período de amamentação. Por isso, no artigo de hoje você entenderá melhor a relação entre amamentação e exames de imagem.'),(53,'TOMOGRAFIA COMPUTADORIZADA E RESSONÂNCIA MAGNÉTICA: QUAIS AS DIFERENÇAS?','<p>Existem diversas d&uacute;vidas quanto &agrave; realiza&ccedil;&atilde;o de exames como a tomografia computadorizada e resson&acirc;ncia magn&eacute;tica. Isso porque, normalmente, as pessoas realizam mais os populares ultrassom e raio x. Assim, para esclarecer as d&uacute;vidas, hoje iremos apresentar as principais diferen&ccedil;as entre os dois exames de imagem.</p>\r\n<h2>COMO &Eacute; O FUNCIONAMENTO DOS EXAMES TOMOGRAFIA COMPUTADORIZADA E RESSON&Acirc;NCIA MAGN&Eacute;TICA?</h2>\r\n<p>O funcionamento de exames como a tomografia computadorizada e resson&acirc;ncia magn&eacute;tica s&atilde;o bem distintos.</p>\r\n<p>A tomografia, basicamente, utiliza radia&ccedil;&atilde;o ionizante. As imagens s&atilde;o geradas por feixes que atravessam os &oacute;rg&atilde;os e analisadas por meio das diferen&ccedil;as na densidade dos tecidos.&nbsp;</p>\r\n<p>Deste modo, o m&eacute;dico consegue diferenciar os ossos do ar e identificar partes como f&iacute;gado, rins e ba&ccedil;o, por exemplo.</p>\r\n<p>Podemos dizer assim, que a tomografia &eacute; um raio x muito mais sens&iacute;vel.&nbsp;</p>\r\n<p>J&aacute; a resson&acirc;ncia magn&eacute;tica, se baseia no uso de um campo magn&eacute;tico de alta pot&ecirc;ncia. Atrav&eacute;s da intera&ccedil;&atilde;o com as mol&eacute;culas de &aacute;gua, esse campo consegue gerar imagens em tr&ecirc;s planos.&nbsp;</p>\r\n<p>Considera-se a resson&acirc;ncia magn&eacute;tica como uma fotografia tridimensional de dentro do corpo.&nbsp;</p>\r\n<h2>QUANDO CADA UM DOS EXAMES &Eacute; INDICADO?</h2>\r\n<p>A indica&ccedil;&atilde;o da tomografia computadorizada ou da resson&acirc;ncia magn&eacute;tica varia de acordo com a regi&atilde;o que precisa ser analisada.</p>\r\n<p>Para avaliar os pulm&otilde;es, por exemplo, que possuem muito ar, a tomografia &eacute; a mais indicada. Al&eacute;m disso, a tomografia &eacute; ideal para gerar imagens anat&ocirc;micas em poucos segundos.&nbsp;</p>\r\n<p>Por outro lado, no caso de avalia&ccedil;&atilde;o da regi&atilde;o p&eacute;lvica de mulheres, &eacute; mais recomendado o uso da resson&acirc;ncia magn&eacute;tica. O exame tamb&eacute;m &eacute; comumente utilizado para investigar tend&otilde;es, m&uacute;sculos e as mamas.</p>\r\n<p>Dessa forma, fica claro que a indica&ccedil;&atilde;o da tomografia ou da resson&acirc;ncia podem variar com o tipo de doen&ccedil;a ou regi&atilde;o que se pretende estudar.&nbsp;</p>\r\n<h2>EXISTEM CONTRAINDICA&Ccedil;&Otilde;ES PARA A REALIZA&Ccedil;&Atilde;O DOS EXAMES?</h2>\r\n<p>Para a realiza&ccedil;&atilde;o da resson&acirc;ncia magn&eacute;tica, pacientes com marca-passo ou clip de aneurisma n&atilde;o podem realizar o exame, o campo magn&eacute;tico do aparelho pode danificar ou interferir no funcionamento dos mesmos.&nbsp;&nbsp;</p>\r\n<p>Outro ponto relevante, &eacute; que em casos de insufici&ecirc;ncia renal acentuada, pode existir a contraindica&ccedil;&atilde;o do uso de contrastes tanto na tomografia, quanto na resson&acirc;ncia.</p>\r\n<h2>ONDE REALIZAR TOMOGRAFIA COMPUTADORIZADA E RESSON&Acirc;NCIA MAGN&Eacute;TICA?</h2>\r\n<p>Se voc&ecirc; reside em Po&ccedil;os de Caldas ou em outra cidade do Sul de Minas, pode contar com a Pixel Diagn&oacute;stico por Imagem.</p>\r\n<p>Estamos preparados com equipamentos de alta tecnologia e profissionais qualificados para te atender da melhor maneira poss&iacute;vel.</p>\r\n<p>Caso tenha alguma d&uacute;vida quanto &agrave; realiza&ccedil;&atilde;o dos exames, entre em contato conosco!</p>',1,'2020-10-21 15:18:21','2020-10-24 16:29:40','2020-10-21-tomografia-computadorizada-e-ressonancia-magnetica-quais-as-diferencas',NULL,'Pixel','Existem diversas dúvidas quanto à realização de exames como a tomografia computadorizada e ressonância magnética. Isso porque, normalmente, as pessoas realizam mais os populares ultrassom e raio x. Assim, para esclarecer as dúvidas, hoje iremos apresentar as principais diferenças entre os dois exames de imagem.'),(54,'RESSONÂNCIA MAGNÉTICA DO JOELHO','<p>A resson&acirc;ncia magn&eacute;tica de joelho &eacute; um tipo de exame de imagem utilizado para diagnosticar diversas patologias. Dentre elas est&atilde;o as tendinites, les&otilde;es no menisco, nos ligamentos, bursites de joelho, entre outras.</p>\r\n<p>Esse exame n&atilde;o utiliza radia&ccedil;&atilde;o ionizante, o que configura uma de suas vantagens.</p>\r\n<p>Mas voc&ecirc; sabe qual a import&acirc;ncia da resson&acirc;ncia magn&eacute;tica de joelho e como o exame funciona?</p>\r\n<p>Se ainda n&atilde;o, continue lendo o artigo de hoje para compreender as especifica&ccedil;&otilde;es desse exame de imagem.</p>\r\n<h2>POR QUE REALIZAR UMA RESSON&Acirc;NCIA MAGN&Eacute;TICA DE JOELHO?</h2>\r\n<p>A resson&acirc;ncia magn&eacute;tica permite visualizar imagens muito detalhadas, como de tend&otilde;es, ligamentos e cartilagens. Por isso, o diagn&oacute;stico se torna mais preciso.</p>\r\n<p>Com as imagens da resson&acirc;ncia, o m&eacute;dico consegue avaliar, por exemplo, a diferen&ccedil;a entre tecidos lesionados e saud&aacute;veis. Isso ocorre mesmo nos casos de fraturas bem pequenas, por conta do detalhamento do exame.</p>\r\n<h2>MAS AFINAL, QUANDO FAZER UMA RESSON&Acirc;NCIA MAGN&Eacute;TICA DE JOELHO?</h2>\r\n<p>Esse exame de imagem &eacute; ideal para o diagn&oacute;stico de patologias quando existem alguns sintomas e sinais espec&iacute;ficos.</p>\r\n<p>Confira alguns deles:</p>\r\n<ul>\r\n<li>\r\n<p>Deformidades no joelho;</p>\r\n</li>\r\n<li>\r\n<p>Instabilidade;</p>\r\n</li>\r\n<li>\r\n<p>Incha&ccedil;os;</p>\r\n</li>\r\n<li>\r\n<p>Dores;</p>\r\n</li>\r\n<li>\r\n<p>D&eacute;ficits de extens&atilde;o;</p>\r\n</li>\r\n<li>\r\n<p>Entre outros sintomas.</p>\r\n</li>\r\n</ul>\r\n<h2>O EXAME PRECISA DE CONTRASTE?</h2>\r\n<p>Em alguns casos &eacute; necess&aacute;rio o uso de contraste. Contudo, isso ser&aacute; comunicado ao paciente com anteced&ecirc;ncia.</p>\r\n<p>A subst&acirc;ncia utilizada como contraste na resson&acirc;ncia magn&eacute;tica, normalmente, n&atilde;o causa efeitos colaterais.&nbsp;</p>\r\n<h2>&Eacute; PRECISO TER RECEITA M&Eacute;DICA PARA REALIZAR O EXAME?</h2>\r\n<p>Sim! &Eacute; importante ter a solicita&ccedil;&atilde;o m&eacute;dica, porque isso indica que o paciente j&aacute; foi avaliado pelo profissional. Assim, j&aacute; se sabe quais s&atilde;o as contraindica&ccedil;&otilde;ese qual a regi&atilde;o realmente precisa ser avaliada.</p>\r\n<p>Por isso, &eacute; essencial que voc&ecirc; procure um m&eacute;dico ao sentir os sintomas mencionados. Dessa forma, ele indicar&aacute; o procedimento necess&aacute;rio.</p>',1,'2020-10-21 15:19:29','2020-10-21 15:19:29','2020-10-21-ressonancia-magnetica-do-joelho',NULL,'Pixel','A ressonância magnética de joelho é um tipo de exame de imagem utilizado para diagnosticar diversas patologias. Dentre elas estão as tendinites, lesões no menisco, nos ligamentos, bursites de joelho, entre outras.\r\nEsse exame não utiliza radiação ionizante, o que configura uma de suas vantagens.'),(55,'COMO SABER SE É PEDRA NO RIM?','<p>Voc&ecirc; sabia que pode estar com pedra no rim e nem percebeu? Em alguns casos, o c&aacute;lculo se aloja no &oacute;rg&atilde;o e n&atilde;o causa sintomas. Por outro lado, a pedra no rim pode ser para outros pacientes, uma das condi&ccedil;&otilde;es mais dolorosas existentes.</p>\r\n<p>Vamos entender hoje o que &eacute; afinal a pedra no rim e quais as formas de diagnostic&aacute;-la. Confira a seguir.</p>\r\n<h2>O QUE &Eacute; A PEDRA NO RIM?</h2>\r\n<p>O c&aacute;lculo renal ou pedra no rim &eacute; considerado como uma forma&ccedil;&atilde;o endurecida nos rins, ou ainda, nas vias urin&aacute;rias.</p>\r\n<p>Como comentamos, em alguns pacientes n&atilde;o causa sintomas aparentes. Contudo, em outros, pode gerar uma dor extremamente forte que inicia nas costas e chega na regi&atilde;o inguinal.</p>\r\n<p>Al&eacute;m disso, a pedra no rim pode gerar sintomas como sangue na urina, febre, v&ocirc;mito e dor ao urinar.</p>\r\n<p>Por esses motivos, algumas crises necessitam de atendimento m&eacute;dico.</p>\r\n<h2>PRINCIPAIS CAUSAS DA PEDRA NO RIM</h2>\r\n<p>Nota-se como algumas das principais causas das pedras no rim, o volume insuficiente de urina ou a supersatura&ccedil;&atilde;o de sais.</p>\r\n<p>&Eacute; importante destacar tamb&eacute;m como causas a grande quantidade de fosfatos, cistina, c&aacute;lcio ou oxalatos&nbsp;</p>\r\n<h2>COMO &Eacute; REALIZADO O DIAGN&Oacute;STICO DAS PEDRAS NO RIM?</h2>\r\n<p>Al&eacute;m do diagn&oacute;stico atrav&eacute;s dos sintomas f&iacute;sicos, a pedra no rim pode ser diagnosticada por alguns exames. Veremos alguns deles a seguir.</p>\r\n<ul>\r\n<li>\r\n<h3>EXAME DE SANGUE</h3>\r\n</li>\r\n</ul>\r\n<p>&Eacute; comum utilizar o exame de sangue para verificar se os rins est&atilde;o funcionando corretamente. Isso &eacute; feito por meio da an&aacute;lise de c&aacute;lcio, &aacute;cido &uacute;rico, creatinina e ureia.</p>\r\n<p>Quando existe altera&ccedil;&atilde;o nessas subst&acirc;ncias, h&aacute; chances de o paciente apresentar problemas nos rins. A causa dessas altera&ccedil;&otilde;es deve ser analisada pelo m&eacute;dico.</p>\r\n<ul>\r\n<li>\r\n<h3>TESTE DE URINA</h3>\r\n</li>\r\n</ul>\r\n<p>Outro exame solicitado com frequ&ecirc;ncia para diagnosticar pedra no rim &eacute; o teste de urina. Nesse caso, o paciente deve coletar a urina por 24 horas seguidas. Assim, &eacute; poss&iacute;vel verificar se o corpo elimina subst&acirc;ncias que favorecem a forma&ccedil;&atilde;o da pedra no rim.&nbsp;</p>\r\n<p>Al&eacute;m disso, em alguns casos o m&eacute;dico consegue diagnosticar a presen&ccedil;a de peda&ccedil;os pequenos de pedra.</p>\r\n<ul>\r\n<li>\r\n<h3>TOMOGRAFIA COMPUTADORIZADA</h3>\r\n</li>\r\n</ul>\r\n<p>A tomografia &eacute; utilizada com o intuito de diferenciar e identificar as pedras. Esse tipo de exame possibilita o diagn&oacute;stico at&eacute; mesmo de pedras bem pequenas. Isso porque consegue registrar imagens em diferentes &acirc;ngulos do corpo.</p>\r\n<ul>\r\n<li>\r\n<h3>ULTRASSOM DOS RINS</h3>\r\n</li>\r\n</ul>\r\n<p>Por fim, o ultrassom dos rins tamb&eacute;m &eacute; comumente utilizado para o diagn&oacute;stico de pedra no rim.</p>\r\n<p>Esse exame de imagem identifica se existem pedras, a quantidade existente, bem como o tamanho delas.</p>\r\n<p>Tamb&eacute;m &eacute; essencial para diagnosticar inflama&ccedil;&otilde;es nos &oacute;rg&atilde;os.</p>\r\n<h2>QUER SABER MAIS SOBRE OS EXAMES DE IMAGEM?</h2>\r\n<p>Se voc&ecirc; quer entender mais sobre o funcionamento dos exames de imagem, acompanhe os posts no Blog da Pixel!</p>\r\n<p>Sempre preparamos artigos com informa&ccedil;&otilde;es fundamentais para voc&ecirc; se sentir mais seguro ao realizar esses exames.&nbsp;</p>',1,'2020-10-21 15:21:05','2020-10-21 15:21:05','2020-10-21-como-saber-se-e-pedra-no-rim',NULL,'Pixel','Você sabia que pode estar com pedra no rim e nem percebeu? Em alguns casos, o cálculo se aloja no órgão e não causa sintomas. Por outro lado, a pedra no rim pode ser para outros pacientes, uma das condições mais dolorosas existentes.\r\nVamos entender hoje o que é afinal a pedra no rim e quais as formas de diagnosticá-la. Confira a seguir.');
