INSERT INTO `services` VALUES (3,'RESSONÂNCIA MAGNÉTICA','Considerada uma das técnicas mais modernas em se tratando de diagnóstico por imagem, este exame acompanha a evolução da tecnologia, proporcionando aos seus clientes qualidade e precisão. O aparelho usa um campo magnético para gerar as imagens, reproduzindo melhor definição às estruturas internas dos órgãos, favorecendo um diagnóstico efetivo.','map-marker','2020-10-10 12:09:47','2020-10-10 12:09:59'),(5,'ULTRASSOM','O Ultrassom é normalmente usado para uma primeira avaliação, podendo assim dar uma melhor perspectiva ao médico sobre os órgãos internos do paciente. É muito eficaz para o diagnóstico de doenças de tecidos moles que não aparecem de forma adequada em radiografias e também para distinguir, como por exemplo, formações císticas de tumores sólidos, pois estes produzem diferentes padrões de eco.','medkit','2020-10-10 12:11:26','2020-10-10 12:11:26'),(6,'TOMOGRAFIA COMPUTADORIZADA','É um diagnóstico por imagem que combina equipamentos especiais de raio x com computadores programados para produzir imagens do corpo. Este exame gera imagens que mostram secções transversais da área estudada, como se o corpo fosse cortado em “fatias”, e podem ser avaliadas de qualquer ângulo.','stethoscope','2020-10-10 12:14:03','2020-10-10 12:14:03'),(10,'DENSITOMETRIA ÓSSEA','É um exame que usa a radiação para medir a densidade mineral dos ossos, e a partir deste avaliar a possível perda de massa óssea e identificar o risco de fraturas e investigar possibilidade de osteoporose.','user-md','2020-10-10 12:23:43','2020-10-10 12:23:43');
